('aamnd06@gmail.com', '                              Hello Mr. teacher / mother teacher What I want to tell a little about myself and my family, My name is Aulia Amanda, I am 14 years old, I am second child from three brothers, I come from simple family, my father is a construction laborer and mother sayaseibu but my mom and dad separated since I was 2 years old, and my sister was still a baby and my mother took my sister from that moment I was in foster care by my grandmother and my sister in the care of my aunt and kakaksaya aunt to jakarta and now at the age of 22 years and he works as an employee in a foreign company even as a maid and he is not college but I am proud to have such a great brother for me, and when I split up 12 years with my mother and my sister I know where she is, until now we just communicate with my brother and my father, my father also married again and he has 2 children and diatingg al with his wife even though met once 3 months but the heart is very happy indeed our distance is same in the city of palembang but the condition of the father as a construction worker who work in the area because we rarely met, and me from my tk to smp now all that the cost of donation family me, my father and my aunt\'s uncle, that\'s why 10 years of school fees, daily needs to continue to jejang sma I intend to enter sma sumatera south, with me register to school sma sumatera south will reduce cost burden my family especially grandmother I am 86 years old and father can no longer work because of the factors stopped and not in the work lg, then by me determined to be a woman polis by karna that I will really learn in order to get that ideals to compose the fate of my family even though the father of a construction worker and mother of a charlatan karna in has a lot of debt and he ran away but I should not like that I want to change the contempt for my family, especially I want to find my mother and when said manda manda already successful manda want to raise the mother of hajj that\'s my dream from small want to change my family life hence hopefully ridho allahswt will allow me to achieve my goals and hopefully I can pass in South Sumatera sma and so my story, thank you father teacher / mother teacher who has read my story'),
('abelaldi25@gmail.com', 'My name is abelika. I was the first child of two brothers, my father worked as a casual laborer, my mother was a housewife. I stayed at my grandfather\'s house with my parents and my uncle. my grandfather is a lepaas daily worker just like my dad who sometimes works and sometimes does not work. my uncle is a taxi driver, and my sister is a student. this is my reason for applying to SMAN SUMSEL for looking at my family\'s economic situation and I want to make my parents happy in their old age by making small businesses so that my parents no longer work hard and can have their own business. the reason I took the entrance test is SMAN SUMSEL also because SMAN SUMSEL is a school that can help the students who come from disadvantaged families into someone who is successful. in addition I also feel capable and confident in my ability that I can and deserve to go to SMAN SUMSEL. and in the future if I can become a caring, fair, wise leader of a lousy family to be a happy family. because in my opinion, with my ability, I am sure I can change my family\'s situation for the better with the way I study science well.                                        '),
('Achmadh504@gmail.com', '                             My name is Achmad Hasan, I am a ninth grader at SMP N 29 Palembang. I am the fourth child of 4 siblings. 2 older sisters and 1 older brother. I am the first to work as a daily freelancer in a company to save in order to continue their studies. my second sister is still in college now. my brother\'s fund is now twelfth grade in high school N 14 Palembang, my sister once a week helps in the fishing pond, and from helping there my sister can help my parents in buying textbooks. My father was a day laborer and my mother was a housewife and also helped to take care of our neighbor\'s child because her mother worked. I feel that I deserve to be a student in SMA Negeri SUMSEL because I am a person who will strive to learn, I am also an unyielding person and I am also an active student and very easy to be friends. I aspire to become a doctor because I think the duty of a doctor is very noble, can help many people who are sick, especially can care for parents and family. Both Parents and the people closest to me also would be proud and happy if I could become a doctor, and make them happy also one of my ideals.\r\nI am sure to be one of the students from SMA Begeri SUMSEL can help me realize my goals.                               '),
('adam15112002@gmail.com', '              I will reply essay about about registration requipments SMAN South Sumatera\r\nmy name Adam Aditya Ramadhan, I was born in Baturaja on November 15, 2002, I was the eldst son of the couple Effyanto and Sri Astuti, thanks to they I can be like this, they are also very supportive of my desire to visit in SMAN Sumsel. My reason  to enroll and be really accepted to be student of SMAN Sumsel, because I have academic achievement since from elemantary school, without khursus or attain, it is because of a disadvantage economically, from information I get SMAN Sumsel is a place for the outstanding students, to be educated provided and prepared to be the future leader to come, therefore I try to be accapted to be students of SMAN Sumsel. armed with the talent and knowladge I have, I want to be a person who has the soul of leadership in the future, I want to become a day into a regent so I can implement immediately the knowladge gained to the nation and the state. I end this short answer, before and after I say thank you\r\nAdam Aditya Ramadhan             '),
('adealwi2018@gmail.com', ' Assalamu Alaykum Warahmatullahi Wabarakatuh\r\n\r\nThank God I pray Allah SWT over given the opportunity to enroll in this SMAN SUMSEL.\r\nAllow me to introduce myself,  I’m the eldest son of the couple Maslukhi and Roihan. I have five brothers, whose second brother is 11 years old, and then 10 years, 9 years, 6 years, and 1.5 years.  My father worked as an employee in an oil palm Company in OKI area, while my mother as a housewife.\r\n\r\nI enrolled in SMAN SUMSEL because in my opinion I meet the required criteria.\r\nI attended several activities such as PRAMUKA and NASYID, I also active in the Organization of OSIS as chairman.\r\nSMAN SUMSEL is one of the international school which provides learning opportunities for the underprivileged, especially for students who excel. \r\nI am so inspired that SMAN SUMSEL can produce a RELIABLE FUTURE LEADER  generation.  Therefore I sincerely hope to be a \"noble”, dedicated, disciplined, and ready-made leaders.   So that later I can help alleviate the burden of both my parents and help to finance my siblings continue high school education.\r\nSuch is the description of myself, my family and my aspirations to be a future Leader.            '),
