('agustaangel925@gmail.com', '                        I\'m Agusta Angel Marisa, i\'m a Catholic, i have one brother his name Ludowikus Gustia Aldo Didi Krismawan, My Mother\'s name is Ani Yulisetiawati, and My Father\'s Name Is Budi Santoso. My priority is more to Science, and civic education. And my weakness at sport, mathematic, and History. \r\n                         My Father is work far from my city, so he isn\'t often back to home, only when saturday and sunday.  my  family ever cheated so, I want to help him with this program scholarship. Why i deserve to be student of SMAN SUMSEL is because i have   superiority in traditional and modern dancing, singing, and i\'m  good in organization too. Although i\'m not join in school organization, but i\'m join community and religious organizations.   and i\'m sure if i can be accepted by SMAN SUMSEL.\r\n                          Why i choose  SMAN SUMSEL, because with my economic limitations, i hoping so much to get better education in the best School which i want, to my first step for reach my dreams.\r\n                          My Leader in the future, i want to be useful person for nation and this country, also be a Leader who has great attitude, fair and wise for solving any problems in this life.\r\n'),
('ainun.ansar10@gmail.com', '  \r\n  My name is Ainun. I was born in Banyuasin on October 10, 2003. I am the fourth of six children. I was born from a simple family. My dad\'s job is farmer and my mother as housewife. Earnings my parents are not necessarily and not big because as a farmer who sometimes rice plants are often affected by diseases and pests that cause the result is not much.\r\nI am currently studying at SMP N 3 MUARA TELANG. Now it\'s headed to the National Examination of academic year 2017-2018. One of the reasons I want to go to SMA N SUMATERA SELATAN is because of my aspirations.\r\nI aspire to become a professional teacher. There is much evidence that SMA N SUMATERA SELATAN has created highly qualified human resources in certain fields. My hobbies are reading and writing, hopefully with my schooling in SMA N SUMATERA SELATAN this can develop more talent that I have, I also hobby sports especially in badminton game I ever championed in one of O2SN activities on year 2016.\r\nMaster teaches us to be smart leaders. not only that, we must also be a person who can change any bad attitude for the better. GOOD LUCK!'),
