('aisyahazzahra03@gmail.com', '                                                                                      ABOUT ME\r\n\r\n    Assalamu\'alaikum wr.wb. The honoroble,teacher of goverment south sumatera senior high school, let me introduce my self.\r\n    My name\'s Aisyah Azzahra. You may call me, Icha. I\'m from Prabumulih. It\'s about 150 km from Palembang. I was born in Prabumulih, 16th june 2003.\r\n    I\'m the first child and I have young sister. Her name\'s Anastasya Azzahra. She is a funny and smart girl. She is in the third grade of elementary school, now.\r\n    My father\'s name is Ari meidiantoni, and my mother\'s name is Reni Anggraini. My father was died, when I was in the second grade of elementary school. Since that, my mother worked to support and finance our family. My mother selling breakfast every day. My mother is everything for me. I loves her very much.\r\n    I lived in simple home, three rooms, guest room, bedroom, and kitchen+bathroom. My home beside my grandmother\'s home. \r\n    I\'m the student of goverment junior high school number 2 in Prabumulih, now. I active in extracullicular like marching band as bellira, scout, and choir. I ever followed marching band contect and we got the winner in 2016. Science olympiade while sitting in the fifth grade of elementary school and the first grade junior high school.\r\n    I wish the one of student in goverment south sumatera senior high school. I worthy of school in here, because I want realize my dream. I always study hard. I like school organization, the place where the talents and achievements are delivered. I want to be a doctor for poor people, help them. The doctor teaches about healthy life, good medicine from nature. Being the pride of my parents, especially my mother. Hopefully everything can be realized.\r\nWassalamu\'alaikum.wr.wb.'),
('aisyahkhazanahmiwa@gmail.com', 'My name is Aisyah Khazanah Miwa. A simple name that means \"the wealth of a prophet\'s wife\". My friends call me Aisha. I was born in Palembang, on 08 April 2004. I am the first child of four siblings and now live in Palembang area.\r\nMy father is Hifni, he is a laborer and my mother is Sri Mulyani and he is a housewife. Although my brother and I often quarrel, we still love each other.\r\nMy religion is Islam as well as my parents and sisters. has a blood group A newly known in 2011. Height of about 142 cm and weight 30kg. I have straight black hair. The light blue color is my favorite color. One of my favorite places is the beach. It was as if looking at the vast blue sea and hearing the sound of the waves roaring, my mood calmed down and all the heavy thoughts that are being felt can be reduced.\r\nRegarding personality, I have a cheerful, friendly, and kind nature because I love to help friends and happy to get along. I am also the type of person who will work hard in every job I am working on so that the work can produce something that is maximal. However, I also have some bad traits. I am spoiled and still often selfish. Until now, I have tried to reduce those bad qualities by trying to study independently.\r\nI have a hobby of reading motivational books. That\'s why I\'m interested in the business world. And free time I use to read books, reading newspapers, swimming, browsing, and watching news in order to benefit from these activities.\r\nAround the age of 1 to 9 years, I graduated from SDN 237 Palembang in 2015. I graduated in elementary school with a satisfactory value                              '),
