('alfina.muizana91@gmail.com', '                                                            Tujuan yang Kuinginkan\r\nDari kecil saya ingin sekali menjadi dokter, saya ingin menjadi orang yang sukses yang dapat membuat kedua orang tuaku bahagia.\r\n\r\nHal yang membuatku ingin menjadi dokter ialah ketika saya sakit waktu kecil,saya sudah sakit terlalu lama karena waktu itu saya sakit tifus dan saya dibawa ke rumah sakit BARI, di sana saya melihat banyak dokter dan perawat sehingga timbul di benakku untuk menjadi dokter. Kedua orang tuaku mendukungnyasehingga membuatku menjadi lebih bersemangat.\r\n\r\nNamun setiap perubahan waktu keputusanku berubah untuk menjadi guru, saya pikir setiap saat cita-citaku berubah tetapi saya ingin menginginkan yang terbaik karena tujuan yang kuinginkann adalah melihat kedua orang tuaku tersenyum dan bangga melihat keberhasilanku.                              \r\n'),
('alfindamafazaa@gmail.com', 'Assalamualaikum wr.wb\r\n          \r\n          My name is Alfinda Mafaza Azim. I’m  fourteen years old. I have two sisters. They are Adhinda Nabilla Sukma and Aura Nadya Jeng Safa.  My father is  Slamet Abdillah and my mother is Irmayani.  We live in village,  people called my village C.Nawangsasi. We live harmoniously.\r\n         I want to study in senior high school of south sumatera because I want to make my parents proud of me. I are determined to be succeed. I will study hard so that I can become useful person.  I want to prove to many people that success people are not only from rich  people, but those who will really study and work hard.\r\n        Since I was child my father work hard for paying my school finance. because we are not from wealthy family. My parents always encourage me to be success. I idolize my parents. \r\n        My hobby is playing chess. to fill my free time, I like reading too. I want to be a teacher because I want to help students in order to be clever so that their parents will be proud of  them.\r\n        I do hope I can study at senior high school of south sumatera. Hopefully I will be one of the students in SMAN south  sumatera.\r\n\r\nWa\'alaikumsalam wr.wb\r\n\r\n\r\n\r\n\r\n'),
('alfurqonfurqon@ymail.com', '    GOOD MORNING, ALLOW ME TO INTRODUCE MYSELF. MY NAME IS MEILISA NINDIA IRELLA. I WAS BORN IN PRABUMULIH ON MAY 23rd, 2003. I COME FROM SIMPLE FAMILY. MY FATHER’S NAME IS ELWAN SUPANI AND MY MOTHER’S NAME IS DAMISAH. BOTH OF THEM ARE FARMERS. I HAVE ONE SISTER. HER NAME IS NOVA CAROLINE. SHE IS A HOUSE WIFE. I LOVE THEM VERY MUCH. I LIVED AT LUBUK RAMAN VILLAGE RAMBANG DANGKU SUB DISTRICT MUARA ENIM REGENCY. I GO TO SCHOOL AT STATE JUNIOR HIGH SCHOOL NUMBER THREE RAMBANG DANGKU IN LUBUK RAMAN VILLAGE. I WOULD LIKE TO CONTINUE MY STUDY AT STATE SENIOR HIGH SCHOOL OF SUMATERA SELATAN SINCE I WANT TO DEVELOP NOT ONLY MY KNOWLEDGE BUT ALSO MY SKILL IN SCIENCE, TECHNOLOGY AND ARTS. BESIDES, MY SCORE STARTS FROM SEMESTER ONE UNTIL SEMESTER FIVE IN MY SCHOOL IS QUALIFIED WITH THE REQUIREMENTS.I LIKE AN ART VERY MUCH THAT IS WHY MY HOBBY IS DANCING. IT IS ONE OF MY FAVORITE AND POSITIVE ACTIVITIES. I CAN DO IT AFTER SCHOOL AS AN ADDITIONAL ACTIVITY AND IN MY SPARE TIME AT HOME. I CAN EXPRESS MY EMOTION THROUGH DANCING. I LIKE DANCING VERY MUCH ESPECIALLY TRADITIONAL DANCING. I WOULD LIKE TO PRESERVE TRADITIONAL CULTURAL VALUES OF THE REGION. I THINK THAT IS ALL ABOUT ME THANK YOU FOR YOUR ATTENTION.GOOD MORNING.                         '),
('alifiashoumiladief@gmail.com', '              \r\n\r\nI would like to introduce myself, my name is Alifia Shoumi Ladief, my friends call me Alif. I was born on October 27th 2003 in Tugumulyo, Musi Rawas. Now, I attend Junior High School B.Srikaton. I really like reading and writing, especially reading novel. I have read many novels. I like reading Andrea Hirata’s novel, KKPK, and novels about detective. I also writing a story. My favorite subjects are science, mathematic, and english. I want to be a doctor in the future. In my opinion, being a doctor is a noble profession because I can help many people who are sick.\r\nI am a daughter from couple Darmanto and Delsi. My father, Darmanto, is a teacher. My mother, Delsi, is a teacher too. I am the first child in my family. I have two siblings, one sister and one brother. My sister’s name is Auren, she is eleven years old. She studies in Elementary School. My broter’s name is Noah, he is five years old. He studies in Kinder Garden. I really love my family.\r\nI want to study in Senior High School South Sumatra (Sempurna School), because it is one of the best school that I know. I want to get the best education. I read from internet that Senior High School South Sumatra have many good teachers, good ficilities, extracuricullar, and the main thing that I like the school has dormitories. Many alumnus from Senior High School South Sumatra enter favorite universities in Indonesia. I hope I can study in this school. I really want to get the best from this school.\r\n                '),
