('alpansyah2006@yahoo.com', '   My name is Bayu Samudera. I was born in Palembang on July 9, 2003. I was the second of three children. I have an older sister and a sister. My father is a teacher while my mother is a housewife. Our family is a simple family and happy family because happiness depends on gratitude, according to my father\r\nI always remember the advice of both parents. From childhood until now we can say our sisters rarely denied the advice of parents, especially father advice. Honesty, responsibility, gratitude, discipline and hard work are the values of character that are upheld in our family. Again, according to my father being a good person and being a smart person both must be aligned. A smart but not good man he can be a villain but a good person but not smart then he will be used by others. Thus the values of kindness in our family are always developed.\r\nIn terms of the ideals of both my parents are very democratic, we are asked to determine the direction of our own goals respectively. Both parents guide and show only. Given the high school is one of the steps in determining the next goal I really hope to get a chance to educate in SMA Negeri Sumsel this. With the discipline and qualification of SMA Negeri Sumsel achievement which in our opinion no doubt then I am very sure this high school can lead me to enter the international-class college.\r\n                           '),
('amitasuri78@gmail.com', 'Assalammualaikum. WR.WB.                                                                                                                                                                                     \r\nMy name is Amita Suri Alsabana,aged fourten years and I have hobby or practically talent which is gift from god from god SWT.Namely singing,dancing,reading poetry,making up can be either romposing poetry or stories.I attend school at Junior High School number eleven Palembang.Speaking of my family , my father named sungkono,while my mother Sunarti and I’m three brothers,named is Satria Aji Bramanta and Mendhita Sangrila.My brother is second grade senior high school and young sister four grade.\r\n\r\nI intend to enroll Senior High School Sumatera Selatan.Regarding me,I deserve to be a student in this school.Because,I am from a family who are less able in terms of economy, but have dreams or high  expectation.Therefore I try to study hard and accompanied prayer,alhamdulillah all that reap the result is the proof  with the achievements that get on the gift of god SWT.\r\n\r\nI have a dream in the future to become a teachers,we as the nation’s leaders we as the nation’s successor must have a leadership spirit that is honest,trust worthy and responsible.Sticking to the value of honesty is one that must be applied from the very .Well that’s the dcescrption and beginning information from me.More and my lack of apology.\r\n'),
('anandaadi711@gmail.com', 'Assalammu’alaikum Wr Wb\r\nMay be always on the protection of God. Hallo, my name is Ananda Adi Kusuma and my nick name is Adi. I am studying at SMPN O.Mangunharjo which is in Musi Rawas regency. I was born in O.Mangunharjo, December 27, 2003. My hobby is reading and I love it because by reading I can see the world. I lived with my father named Winarno and my mother is Sukeriningsih. My father work as a seller (jual beli motor seken) and my mother is a teacher at SMAN Megang Sakti. Besides, I also have one brother and my sister. They are Afifah Cindai Kusuma and Alfito Dianova Kusuma. My sister is a student of elementary school grade three meanwhile my brother is in grade one.\r\nDuring my junior high school, I have win many competition in many kind of competition such as the second winner of  Ceramah Agama for Musi Rawas regency, then third winner of math poem which participate by junior and senior high school of Musi Rawas, Lubuk Linggau, and MuraTara regency. After that, I also become the second expected winner of folk song in MAN 1 Lubuk Linggau and the first winner of folk song festival in Sport garden, first winner of folklore story telling and the third expected winner of story telling in English and the second winner of the speech competiton in HANA ENGLISH COURSE which participate by many regency too. In addition, I do really active at Scout and I love to do a camp (kemah) because I can learn how to do cook by myself. It also teach me about family, togetherness, and cares each others as well as to our environment.\r\nBesides reading, I actually love singing, dancing, acting, reading poetry, and doing a story telling. And I am typically humoris because I like to make someone else smile and happy.\r\nAt school, I am active in OSIS and I am as the chairman coordinator for Art Division. It is nice to be the coordinator because I can participate in many art event because througt art can express my self and art is my soul.\r\nI do really want to be a student of  SMAN Sumatera Selatan because I believe througt this school can give me a better education. I can learn English more, improve my skills. I want to be state ofisials, because I want to serve the country, and one important thing “honestly is the key success”. Besides, I want to make our country free from corruption, I want to increase the productivity of the society, and fix economy’s infrastructure in Indonesia.\r\nI hope SMAN Sumatera Selatan would welcome me to be the new student and become the family of SMAN Sumatera Selatan because this school is very awesome. I believe with myself that I can contribute many things trough my skills and I believe that this school would make my skills better. Thank you. Alhamdullillahirobbil’alamin.\r\nWassalammu’alaikum Wr Wb\r\n                              '),
