o really want to be a student of  SMAN Sumatera Selatan because I believe througt this school can give me a better education. I can learn English more, improve my skills. I want to be state ofisials, because I want to serve the country, and one important thing “honestly is the key success”. Besides, I want to make our country free from corruption, I want to increase the productivity of the society, and fix economy’s infrastructure in Indonesia.\r\nI hope SMAN Sumatera Selatan would welcome me to be the new student and become the family of SMAN Sumatera Selatan because this school is very awesome. I believe with myself that I can contribute many things trough my skills and I believe that this school would make my skills better. Thank you. Alhamdullillahirobbil’alamin.\r\nWassalammu’alaikum Wr Wb\r\n                              '),
('anast041103@gmail.com', '	My name is Anastasya. I’m fourteen years old. I was the first child of two siblings. My father\'s name is Suminardi, he’s a freight driver in a CV. Every month, he only gets a salary of 1.5 million., which should be used to meet the needs of the family and so forth. While my mother named Rusdiyanah, her main job is a housewife. However, as family needs become more complex, Mom decides to help our family finances by selling \"pempek kuah model\" and \"es balon\". \r\n	There are several reasons why I deserve to be a student of SMANSS. First, economically I feel desperately need this help, because I want to lighten the economic burden of my family. Second, I have a strong motivation to reach what I want. I have a high learning spirit, where I believe that this school can be a place where I can sharpen or optimize my knowledge/skills. Third, I am an independent, diligent, hardworking and unyielding person. So for some reason I wish I could be part of this school.\r\n	In the future, I want to be a teacher who benefits others. I want my knowledge to have a positive impact on others.\r\n\r\n\r\n'),
('anggicahyani19@gmail.com', '        Assalamulaikum wr.wb\r\nHello, my name is anggi dwi cahyani, you can call me anggi. I was born in Palembang on 19 september 2003 I was the second child of two brothers, from fahrul rahman and weni haryanti couple, I have a sister named mayang kinanti. she is now studying SMKN 5 palembang. \r\nI was born in a very simple family, my father is a trader and my mother is a housewife, even though I am not born in a rich family but both my parents always try to make their children live well, my  hobby is reading a book or a novel .Because, when I\'m reading book my mind will be more relax than before and even I can forget the time when reading a book. I wan to be a doctor and becoming a police woman  too. I started to go school  in a kindergarten called handayani, then I went to public elementary school 128 palembang, and continue to Islamic junior high school 2 kota Palembang, and now I hope I can continue  to my favorite senior high school. And that is SmaN South Sumatera. Why i want to enter SmaN South Sumatera? Since I wanted my parents not to be overhelmed with my school, I had heard that the southern summits were funding students, and I wanted to be one of those students. I also want to be an outstanding student there. So, I can take care of  both my parents, being a Senior High school student in south sumatera is a pride for me. I wish I could enter SmaN South Sumatera.\r\n                      '),
('anhisapitriani251@gmail.com', '                              Name anhisa pitriani\r\nClass : IX D\r\nMyself and my family\r\nMy name is anhisa pitriani , you can call me pitri or anhisa. I am 14 years old , i was born in pagaralam. I am second child in my family and i live in pagaralam.  My father’s name akmal ludin he is a farmer and my mother is a housewife and also a farmer. I have one brother, his named amat alfath tan har , he is still elementary school in first grade. They love us and we do too. Every night w are always watching tv and talking together . every day my parent go to the risefield , at noon they have lunch and take a rest . they work hard for us.\r\nI and my family are moslem., my blood type is B my weigh 45 kg, and my high is 163 cm .       I like reading and writing. My favourite color are : black, blue, green and red. When i do not have a work , i will reading book and playing handphone although sometimes i write my book. I am a nice and spirit girl.\r\n\r\nMy reson and my purpose in senior high school sampoerna (sma sampoerna) ,Palembang.                                                            \r\nI have a reason why i choose sma sampoerna as my next stepping stone , because his school is very interesting , there are many great student in there and i really want to be part of them , surely i will work hard to reach the achievement , i motivate my self to be the best and not just my dream. That school special for underfrivilledged student, beside that way learning curricullum also enconrages me to go there. In addition i like to speak english , and in that school english is daily language. It is why i make this school as one of my way to improve my english ability. \r\nLeader in future.\r\nDiplomat.\r\nI want to be a diplomat when i become a diplomat i will protect indonesian people that work in one country , bacause that mainly task as a diplomat . i  will do the best  to protect them. Cause nowadays there are many news about indonesian people ( WNI) they hurted in their place work, for me that news so pathetic, i will assure that news will not occur again. I take a responsibility by tasks from head  of state . i will using my knownledge and all my ability to make this country better han before, than promise to do as great as i can do.\r\nBecome a negosiator as one of the best way why?\r\nIt’s because negosiation is a peace way , i love peace i know many people in this world like peace although they rich country such as: amerika serikat ( united state), inggris ( england), etc.   And poor country in deep heart of them they are not want to war. in negosiation there are many lucky in between country , they get something that they want and so we are. I have a ambition that i will have a good relation in a country and make negosiation as a way to eggresion.\r\n'),
('anisnovita1923456@gmail.com', '                    Assalamualaikum wr.wb\r\n\r\n        Hello!!! My name is ANIS NOVITA SARI. I’m the first daughter. I was born in Megang Sakti, at November, 19th 2002. I’m 15 years old. I live in Megang Sakti 4. My father name is SUPRIYADI and My mother name is SUMINI. They are work farmer. I have stepbrother name is KARFUAN NUR FAIS. He is 4 years old. My father and my mother has separated since I was 6 age years old. Now my mother has merried later, but I not live with them . I live with grandmother. I go to school use student transport car. My school to compare Full Day School. I go to school at 06:30 am from home and going to home at 04:00 pm.  After going I help grandmother clean up home.\r\n        I’m a student of SMPN Megang Sakti in nine point one class. My hobby is Dancing. I’m join in dancing ekstraculicular in the school. I also ever to join in dancing contest. But, I’m not becam to winner. Maybe it’s a lesson to be more active in developing my talent. I also often to join Marching Drum event. Alhamdulillah, we often to get champion, even general champion.\r\n        I want a be a teacher. My desire to be a teacher has been embedded since childhood . I want to become success people and can become pride my parents. And I want also help my parent in economy my family.\r\n        I deserve to be student of SMAN SUMSEL , because I have spirit to reach my expectation . I hope, I can make my mother proud and it will decrease the load of my mother and I hope my dreams comestrue. I will study very hard for realize my idea.\r\n \r\n      Wassalamualaikum wr.wb\r\n                    '),
('Anisyahlestari792@gmail.com', '                                   MY NAME IS ANISYAH LESTARI,I USED TO CALL ANISA.I LIVE IN SUNGAI JERUJU VILLAGE. I AM FIFTEEN OLD,I WAS BORN IN SUNGAI JERUJU, MY HOBBY ARE READING BOOKS, COOKING AND BADMINTON, I ASPIRE TO BECOME A SUCCESSFUL ENTREPRENEUR. I COME FROM A SIMPLE FAMILY AND I LIVE WITH MY PARENTS, MY FATHER NAME IS FIRLINAN AND MY MOTHER NAME IS YUNANI,MY FATHER JOB IS FARMER AND MY MOTHER JOB IS HOUSEWIFE,I AM THE SECOND OF THREE CHILDREN,I HAVE  ONE OLDER SISTER AND ONE YOUNGER SISTER, MY YOUNGER SISTER IS STILL SITTING IN THE CLASS 1st ELEMENTARY SCHOOL.BEING A STUDENT OF SMA NEGERI SUMATERA SELATAN IS MY DESIRE, BECAUSE I WANT TO REACH MY GOALS AND I WANT TO PROVE THAT I CAN COMPETE, I REALLY WANT AND HOPE CAN BE SCHOOl IN SMA NEGERI SUMATERA SELATAN, I WANT TO EXPLORE MORE KNOWLEDGE IN SMA NEGERI SUMATERA SELATAN. I LIKE TO DO BUSINESS, I WANT TO BE A GOOD LEADER, AND THE GOOD NAME OF MY VILLAGE. I AM A STUDENT AT SMP NEGERI 1 CENGAL. I REALLY LIKE A LOT OF ACTIVITIES THEREFORE I HOPE TO JOIN IN SMA NEGERI SUMATERA SELATAN. I ALWAYS PRAY TO ALLAH SWT FOR MY SUCCESS. I HAVE ALSO BEEN AN OSIS IN MY SCHOOL. I HAVE ALSO PARTICIPATED IN TRAINING ACTIVITIES TO SCOUT AN ALERT, IN ELEMENTARY SCHOOl SUNGAI JERUJU.I EVER BECOME A MEMBER  OF PASKIBRA TO COMMEMORATE RI ANNIVERSARY 70th AND 71th. \r\n');
