('Anjar.febriyani@yahoo.com', '   Assalamu\'alaikum wr.wb.\r\nHi, My name is Sophia Nadzwa Mutia, I was born in Palembang on october, 22nd 2003. I am 14th years old. I lived at D.I Panjaitan Street Lorong Damai II, RT. 1 RW. 1 Number 82. I am from the junior high school number 56 Palembang. My Hobby is bussiness and my ambition are police woman and indrustrialist. And than, My mother\'s name is Titin Sumarni, she was born in Palembang on february 28th 1976. my father\'s name is Mustopa, he was born in OKI-P Gemantung on June 30th 1973. and the last my brother\'s name is Muhammad Bagus Pamungkas, he was born in Palembang on March 31st 2007.\r\nWhy I want to join to the senior high Sumatera Selatan ? \r\nbecause, the senior hifh school Sumatera Selatan has mission and vission clearly:\r\nVission becoming creator school for Indonesia\'s future leader who are competent and globally-minded.\r\nMission: 1. Creating a learning enviroment that provides a sense as of security and comfort for the student to innovate and ekspression.\r\n2. developing the school to be the pillars for another school Indonesia\r\nand the last, through this school I can get my ambition and also give the happiness for my parents.\r\nWassalamu\'alaikum wr. wb.\r\n                       '),
('annisaauliaputri121@gmail.com', '                              ASSALAMMUALAIKUM WR.WB\r\n\r\n May be always on the protection of God. hello my name is Devy Sefiana Putri. i am ussually called Putri. i want to junior high school O.Mangunharjo, Purwodadi Subdistrict, Musi Rawas district. i was born in R.Rejosari village on september 11,2002. i am the first child of one brother. i have a brother named farhan hafisz ibni.\r\nmy hobby is reading, because from reading, i get a broad insight and also can give enough knowledge. i live with my parents, my father\'s name is Sarni and my mother\'s name Desi. my father worked as a wiraswasta and my my mother worked as a housewife. to supplement the income, my parents opened a small business that is opening a small shop. every day, after i get home from school, i help my parents to sell at the stall. while i sell at my stall as well while studying. sometime there are elementary school children who ask to be though to work on homework.\r\nthe lesson that i like is the math lesson. i also ever participate in LCC mathematics competition level musi rawas regency in 2017.\r\ni actively study math to win. i did not expect that i waschoosen to follow the LCC competition. alhamdulillah, thanks to the omnipotent god and thanks to god to the prayers of both parents, i can champion three LCC mathematics level district musi rawas year 2017. i am very grateful and happy, besides that i also always follow eskul that exist in school like english club and eskul math. i also joined an organization at the school osis. an organization osis me as osis treasurer in the academic year 2016/2017. i want to be a doctor because i want to treat people who are sick.\r\ntherefore i am very anxious to be a high school student south sumatra, because i believe through this school can provide a better education and also can provided a broader knowledge and i can learn more english with good and true and i hope high school south sumatra can accept me to study there and study.'),
('aprizal810@gmail.com', '                              My name is Aprizal.i\'m 15 years old. i was born at 8 october 2003. i live in jl gunung kemala rt.04 rw 02 kelurahan anak petai kecamatan prabumulih utara no.27. my hobby is singing. My father\'s name is arlan Hepi. he was born at 1 July 1974. and my mother\'s name is ida Lisanti. she was born in 31 december 1975. i have two brother, they are Joni Ardiansyah and Erik/ and i have two sister ,they are Rike Wulandari abd Andini Permata Sari.\r\n\r\n\r\ni have wish for become person the smart and adept speak english.i also wish be alive stand alone too. i also make my family to happily.\r\n\r\n\r\nI will become to Bishop, i will contrive nation in indonesian become better. i will help childrens in indonesia the less apt for education. so that, they become to generation the will make shift positive for nation in Indonesia'),
('Aris9000.aa@gmail.com', '          Assalamualaikum Wr. Wb.\r\n    On this occasion, allow me to make an introduction about who i am. My name is R.M. Idris. I am the third child of three siblings. I was born in Palembang, 27 November 2003. Now, i am the ninth graduate of junior high school number 47 Palembang. My hobby is curious about of the world by updating and checking social media. \r\n     I Live with my parents, my brother, and my sister. My father’s name is R.A.Romadon. He was a security quard, but now he is a temporary worker. My mother’s name is Robiatul Adawiyah. She is a merehant. My Sister’s name is R.A.Hurun In. She studies at senior high school number twelve and my brother’s name is R.A. Dinul Hawari. He is in training in a workshop because he is from vocational high school number two in Palembang.\r\n     SMA N Sumsel is one of school models for another schools because all students passed from hard competitions and they are from lower economy families, but they are smart. This school has got internatonal Certificate. This school also has dormitories. That’s why i want to study in this school. I want to make SMA N Sumsel’s name famous in the world.\r\n     My future view towards SMA N Sumsel is i want to make all students in SMA N Sumsel and all people always devote their nationalism, patriotism, sportiv, and souls. The best nation is the nation which appreciates its heroes. So that, i will make the SMA N Sumsel’s name reverberates around the world. The others important thing we should have are “IMTAK & IPTEK”. Therefore, our country will be prosperous, safe, and peaceful. As if we have honest officials goverment in our country because they have IMTAK & IPTEK. \r\nWassalamualaikum Wr. Wb.                     '),
('arsasipratama02@gmail.com', 'MY NAME IS ARSASI PRATAMA , I AM THE FISRST CHILD FROM MY FATHER KANANG RUSLIN AND MY MOTHER ANITA AND I HAVE TWO SISTER , SHE IS THE SECOND GRADE OF ELEMENTARY SCHOOL AND THE OTHER IS STILL BABY . AND I STUDY AT SMPN 1 CENGAL.\r\nSINCE I WAS ELEMENTARY SCHOOL I STAYED WITH MY GRANDMOTHER BECAUSE MY PARENTS ARE FAR AWAY ,IT IS IN SUNGAI JANUN . MY GRANDMOTHER WORKED TO FISH IN THE RIVER .HONESTLY AT THAT TIME I AM VERY SORRY FOR  MY GRANDMOTHER BECAUSE SHE WAS OLD AND STILL LOOKED FOR MONEY BUT IF NOT .WE CAN NOT EAT EVERY SUNDAYS I ALWAYS HELP HER FISHING AND MY GRANDMOTHER TAUGHT ME TO COOK AND COOK RICE UNTIL I CAN COOK MYSELF THOUGH I AM BOY.\r\nWHEN I WAS IN SEVENTH GRADE . MY GRANDMOTHER HAS PASSED AWAY , IT WAS A VERY SAD THING FOR ME AND FINALLY I SHOULD TAKE CARE OF MYSELF , COOKING AND EVERYTHING TAKE CARE OF MYSELF SINCE THE DAETH OF MY GRANDMOTHER , BECAUSE MY PARENTS STILL WORK IN SUNGAI JANUN AND I KEEP THE SPIRIT OF SCHOOL AND THANK’S TO GOD NOW I AM IN NINTH  GRADE SOON TO SMA. MY FATHER WORKS AS A FISHERMAN AND HIS INCOME IS VERY DEPEND 0N THE NATURE . WHEN I GET A HOLIDAY I VISIT MY PARENTS IN SUNGAI JANUN AND THERE I LOOK FOR MONEY SO I CAN BUY NEW SCHOOL EQUIPMENTS. EVEN A LITTLE IT CAN REDUCE THE BURDEN OF MY PARENTS, BECAUSE MY FATHER IS SICK TO WORK HARD TO MAKE MONEY FOR FAMILY NEEDS.\r\nTHEREFORE FROM I REALLY HOPE TO STUDY IN SMAN SUMSEL IN ORDER TO ACHIEVE MY DREAM IS A ENTREPRENEUR AND I CAN PROVE THAT I CAN COMPETE. AND WHEN ONE DAY I BEC0ME A LEADER I WANT TO UPHOLD TRUTH AND JUSTICE . MAY  ALLAH SWT. ALWAYS GIVE THE WAY...Aamiin.\r\nGOD DOES NOT CHANGE A PERSON’S FATE UNLESS THE PERSON CHANGES HIS DESTINY.\r\n                              '),
('arumanggitad@gmail.com', '     My Name Is Arum Anggita Dinar,i was born on June 28 2003, i have 3 sister and 1 brother . My first sister a houswife the ladder her name is Mita Kusuma Andriani her has 3 daughters,her lives in Semarang city. My second sister as her also a housewife her name is Soraya Anggun Sasmita , graciously has 1 son and 1 daughter her lives next to my house .The Third brother of a man whose name is Achmad Bayu Anggoro ,he is a honorer at the subdistrict office , his has been married and only has 1 son an he lives at home with my parent .The 4th sister named Woro Ayu Wigati she is a graduate student of Sultan Agung Semarang her majured dam and still looking for work on is not enought to meet the needs of 5 childern .The reason i want to go to SMAN SUMSEL is that i do not want to charge my parent in cost and i want to be recoguized by people ,become successful people and boast both parents.                          '),
('ASTUTI1908@gmail.com', 'A.   I was born in OKU TIMUR nineteen twenty and two.I was sixteen years old .My father deed on in date fourteen march twenty and fourteen. My father deed on because sick. Since father deed on all to be responsible family there is my mother. My mother to work as worker.\r\n\r\nB.     I really to want to enter SMAN SUMSEL because i want to raise the degree of both my parents, especially my mother.I also want to make my mother praund of what i have accomplisshed so fer but that is not enough, because i have not become what my mother hopes. I would like to lighten the burden of my mother\'s life\' the woman the has contributed in my life and repaid all the sacrifices she has made to her children so far.\r\nI should be able to enter SMAN SUMSEL because it is not easy to enter his prestigious school.Probably because of the impossible economic circumstances ans my mother\'s enormous expectations for her son\'s future.\r\n\r\nC.    I want to be a judge because i want to uphold justice in this country. A just word that has been able to be replaced by money. Besides that also do not want orders to feel what i feel. Because i never get justice in my mother\'s family I want to fight for the right of those who are oppressed.\r\n '),
('ayuasriyani23@gmail.com', 'My name is Ayu asriyani , i was born in Boyolali , Central Java on the date may 3 , 2003 . I have a brother named Adri atninto  and he is in the third grade of high school. My mother is named Jumarmi and is 37 years old . My father has died when i was in grade 3 0f primary school . My father died of a motor accident in 2011 and died in the scene . So now my mother become the backbone of my family . I moved to sumarta when i was 2 of primary school . My house in java has been sold and now my family live with my aunt and my uncle in Sumatra . My motivasion and my reason to join at sman sumsel because i come from a family can’t afford and i wont to reduce my mother burden as the backbone of the family and because my mother just works as rubber farmer or rubber tapper and his monthly income didn’t reach 800.000 . my ambition in the future is I want to be someone who isn successful and earning more so I can build orphanages of orphans like me and I also want to help less fortunate people like my family .'),
('azhary_0707@yahoo.co.id', '                                      Assalamualaikum Warahmatullahi Wabarakatuh.\r\n Hi, My name is Yurico Febriano. I\'m 14 years old. I was born at Palembang,12 february 2003. Yeah, its a few more days to celebrate my birthday.So back to topic, i have a mother, a father, a brother, and a sister. My father name is Azhary, not too long, right? He works as an employees  in a company. My mother name is Sri Wardhani Gustiningsih. Nah, now its a long one, She doesn\'t work as employees too, she works as a housewife. Yeah she takes care of everything in household. My brother name is Rayhan Novaliano, He is 12 years old, he school at the same school with me, Smpn 8 Palembang. At last but not least, my sister. Her name is Salsabilla Augustine. She is 6 years old. She school at Sd Pusri Palembang. That\'s all about my family.\r\n        So, I have a biggest question in my life. Why i deserve to be accepted in Sma Negeri Sumsel Palembang. Because i think I have confidence in my ability to learn the lesson from teacher. Inshaallah, I can learn the lesson from Sman Sumsel Teacher. And i want to make my Parent proud with me. My Father said, if i accepted in this school, he will really proud with me.\r\n          And, 1 more thing, I really wanna be a leader of a company. I want to start my career from zero. I wanna try how difficult a leader responsibility is. That\'s why i want to accepted from this school. Cause i want to learn what is Responsibility, Independence, and       Togetherness with new friend. I think that is all from me. Forgive me if there\'s something wrong. Wassalamualaikum Warah matullahi Wabarakatuh.\r\n'),
('Azizahalpasyah@gmail.com', '   I come from a simple family. My father has died. I have a mother, a brother, and a sister. My mother worked as a laundry worker. My brother is the first child of our family, he has a family and he works as a private employee. My sister is the second child of our family, she works at the counter. And those struggling to meet my needs are mothers.\r\n   I feel that I deserve to be a student in South Sumatra, because for me the school is the right place for me to improve my achievement. And I am convinced that I am one of the disciples of the prestasu. With great will and will, there will be a way out.\r\n   My goal is to be a teacher, one of which is a math teacher. I want to be a math teacher because I want to prove to people that mathematics is not difficult and not complicated, even I want to make a lot of people to like the lesson instead of hating it. And I want to prove that success does not have to be with money, but with intention, passion, and great effort will make us successful.'),
('azzahraakbarr@gmail.com', '   I AM A SECOND OF THREE CHILDREN. MY NAME IS AUREL AZZAHRA AKBAR. I LIVE IN MY GRANDMOTHER\'S HOUSE, BUT WITH MY FAMILY TOO. I HAVE A BROTHER AND A SISTER. MY FATHER\'S JOB AS PRIVATE EMPLOYEES AND MY MOTHER AS HOUSE WIFE. MY HOBBY IS READING NOVEL. AND MY AMBITION IS DOCTOR.\r\n   I HAVE QUALITY ABOUT MY ACADEMIC AND NON ACADEMIC. I AM ACHIEVEMENT AT SCHOOL AND I ALSO WON SOME ART COMPETITIONS IN ELEMENTARY SCHOOL. IN JUNIOR HIGH SCHOOL I WAS ONCE THE FIRST CHAMPION IN ACTING COMPETITION \'\'STUDENT 5\'\'. I AM HUMBLE, NEVER GIVE UP, HAVE A GREAT WILL, CONFIDENCE, AND TO BE PROBLEM SOLVER. AND I SURE I CAN ADJUST IN INTERMEDIATE SUMATRA SELATAN WELL AND QUICKLY.\r\n   WHEN I AM TO BE A DOCTOR. I WANT USEFUL FOR EVERYONE, ANYONE, AND WHEREVER, ALWAYS BE FAIR IN PERFORM TASK. I WILL NOT DISTINGUISH MY PATIENTS EITHER RICH (PERSONAL) OR NOT (BPJS). I WILL BE PATIENT, FIRM, AND HONEST TO ALL MU PATIENTS. I WANT MAKE THE FREE HOSPITAL TO POOR PEOPLE. I WILL ALSO GIVE THE BEST TREATMENT TO ALL MY PATIENTS. I WILL TO BE A AUTHORITATIVE LEADER BUT FRIENDLY AND HUMBLE TO EVERYONE, ANYONE, AND WHEREVER.'),
('balqistw@yahoo.com', 'My name is Winda Tri Balqist. My address is Mega Asri II Blok H.10. No. 10. Rt 27. Rw 13. I went to Junior High School 51 Palembang. Jl Yusuf Senen Sukamulya.\r\n\r\nMy Dad\'s Name Mirza Hasra. My mother is Novianti. I\'m the 3rd child of 4 siblings. My first brother named Wahyu Ali Prasetya, my second brother named M. Ali Pamungkas, And my sister named Wirda Hakim. I look forward to my acceptance in Senior High School SOUTH SUMATERA, In order for what I aspire to achieve so that I can boast my parents, my brother and my family. I honestly aspire to be an Accounting.\r\n\r\nI was educated in Junior high school 51 Palembang is a lot of achievement. Grade 1 odd semester I earned 4th place. Even semester rank 3. The second grade semester ganjiI earned a rating of 1st semester. Class 2nd grade was ranked 1st. This 3rd grade odd semester I earned 2nd place. I am very happy to get the achievement. Not only in the academic field but I accomplish in other fields as well. As the 1st Winner of TPA-B Al-Hikmah Unit 107 of 2014. Winner 2 TPA-B Al-Hikmah unit 107 in 2015. Winner of TTQ TPA-B Al-Hikmah Unit 107 of 2016. I am very grateful and continue to pray to God my goal is achieved. Aamiin.'),
('bellindaulviana13@gmail.com', 'My name is Bellinda Ulviana. I’m the youngest child over three siblings, born in Palembang, 13th of April 2003 and I come from JHS no.19 Palembang. I’m coming from a simple family that has our super father who works so hard for me and my brothers since I was left by my mother eight years ago. My friend says I’m a cheerful girl, that is why I have many friends surround me.Becoming one of Student of SMAN Sumatera Selatan is one of my biggest ambition. I come from an economically-disadvantaged family. Then, I really want to raise my parents dignity and evolve my passion to pursue my big dream in the future. Thus why, being part of SMAN Sumatera Selatan may facilitate me to achieve those.I have dreamed to be a doctor in the future, holding up together with those in need and take their arms to the brighter life. For instance, when my family is sick, I could easily take care of them. To be a doctor is not easy so it drives me to study hard and strive for that. Hope I could be a good doctor in the future.'),
('betran.yunior2017@gmail.com', '                              Halo, My name is Betran Yunior,  i was born in Palembang, 31 August 2003. I have a family consists of 4 member  : My Father, My Mother, My Brother, and Me. \r\nWe Live in Jl. Bina warga II, Palembang. My Father work in construction site in Palembang, \r\nMy Mom is a housewife, My Brother is an unemployed.\r\n\r\nWe have a little house in here, which we have living since 10 years ago.\r\n\r\nWhy i deserve?\r\nBecause come from poor families, I am smart enough, got the highest ranking in the class, and always wanted to learn something new\r\n\r\nwhy do I want to school in here?\r\nBecause I feel will get a bright future here, I want to change my life, I want to change my family life, I want to improve the family economy, and I will make changes...\r\n\r\nMy Ambition:\r\nI will try to be a successful person\r\n'),
