('bonhardberliana03@gmail.com', '     Assalamu\'alaikum, introduce my name is berliana bonhard, I was born in Palembang, 24 July 2003, I was the second of five children, from bredhy bonhard and hartati couple. Berliana is my nickname. I was born from a very simple family, my father was a cleaning service and my mother was a housewife. Although I live in a very simple family, I am still proud to have parents like them. They always teach kindness to their children, I do not know what happens if I do not have them. My father is a great man, he is willing to work day and night for his son and his wife. my father never complains about what he feels, he will keep trying to make ends meet. Likewise with my mother, he always keep and teach his children goodness and still to always remember the god By doing prayer five times. In every prayer I hope Allah will continue to keep both my parents, giving them health and long life and still waged their sustenance. I am very fond of my family because they will always be in times of joy and sorrow, they are always the ones I really need, and they too will protect me.\r\n         When I was five years old, I started my education at RA.PERWANIDA 2, then I continued my education in MIN 2 MODEL PALEMBANG, after graduation I went to the next education in MTsN 2 Palembang, after graduated from MTsN 2 I really want to enter SMAN SUMSEL. Why do I really want to go to SMAN SUMSEL? Because SMAN SUMSEL is one of the international public schools that provide scholarships to outstanding students from disadvantaged families. By entering SMAN SUMSEL I can lighten my parents burden. In addition I can learn more independently again. And if I can go to this school, I will definitely have a glorious future. This school also not only develops academic skills but also non-academic as well as the development of leadership character, entrepreneurship, and social responsibility. Hopefully I can attend this school so I can lighten the burden of parents and have a glorious future. in the future I have the ideal of wanting to become a famous entrepreneur in order to raise the degree of my parents for the better. Thanks to all those who have established SMAN Sumsel and provide scholarships to underprivileged students, so I and all who want to enter SMAN SUMSEL and the people who have attended school there are opportunities to feel the international school that provides scholarships to students who are less able, so it can have a glorious future. May all who are involved with this school are always protected by gods and given abundant health and fortune because you have helped thousands and even millions of children to have a glorious future so that they become successful people and they can elevate their family for the better.\r\nThat is all of i can tell about my life . Thank you for your attention. Wassalamualaikum wr. wb.\r\n\r\n                         '),
('brinthacindyirawan@gmail.com', '               My name is Brintha Cindy Irawan. Now, I\'m 14 years old. I\'m the first child in my family. My hobbies are singing, reading, and do activities that can make me sweat. My father is an entrepreneur, but went bankrupt a few years ago. My mother is a housewife. I join some of extra-curricular which are Scout, PMR, Paskibra, and Sanggar Seni. I have a dream to be a scientist, a policewoman, and a doctor. I feel deserve to be a student of SMAN SUMATERA SELATAN is because I often get an achievement. I have some talent which are singing, playing music instrument, and public speaking. I also like physics. I want to set up s laboratory for physics studies. I think I have good enough leadership skill, because I have an experience in organizing at my junior high school. It\'s as Vice President of student council. SMAN SUMATERA SELATAN is looking the one wish coming from family that not rich. Because I including to one of that not rich. I want make my parents happy and proud of me. I\'ll do effort, so that I can make my family\'s life be better and realizing my dream. I hope I can be a successful person in the future.               '),
('chikavinolia@gmail.com', 'My name is Chika Vinolia my address in Simpang Tiga Village, Kisam Tinggi District, South OKU District.\r\nwith the twists and turns of life I was born in bekasi on March 14, 2004, at that time my parents work wander there because of the economic difficulty of both my parents in bekasi then we go back to the village and at the time of entering elementary school I live with my beloved grandmother, while my parents went to the garden in the intersection of three villages, so the distance between me and my parents made me miss, sometimes I was forced to go to school when I was at my parents\' house.\r\nafter I sit in junior level sometimes I live in my grandmother\'s house too, because closer to school I am very grateful to my loved ones who have been care and guided me to grow up, thank God thanks to the prayers of both parents and the support of all that I love can cultivate my enormous ideals, so I will keep the spirit to not break the struggle of parents and those who love me.\r\nWhen I\'m in the 9th I often confide in the teachers at school about my desire to go to high school but I am confused by the circumstances of my two poor and weak economies, I can not afford to force my parents to finance high school later.\r\none day the teachers and principals are looking for information about schools that can help educate students like me.\r\nThank God With the existence of SMAN Sum-Sel school is very support me in the world of education in Indonesia, although both my parents are weak economy but I do not desperate to continue school education.\r\nI have a high determination to be a dutiful child to both parents and can be useful for religion, nation and state.\r\n                   '),
