e accepted in SMAN Sumatera Selatan. Im appropriate to become part of SMAN Sumatera Selatan student because im motivated person and have big motivation to reach my dream for helping my parent to up my family’s degree so my family will not underestimated by others and make me more independent, more get new knowledge, more get new friends and also i want to get more experience by studying in SMAN Sumatera Selatan because as i know where this school is really- really good to prepare indonesian future leader that was my sister said to me. I want to change everything in my life through becoming part of student in SMAN Sumatera Selatan. \r\nIf i’m being chosen by SMAN Sumatera Selatan school i will study harder than before i will give more my effort and contribution for SMAN Sumatera Selatan School. SMAN Sumatera Selatan gives the opportunities to poor students like me to school without paid with the complete facilities and SMAN Sumatera Selatan has ability to create all of their student become the best which is successful and good person. Only SMAN Sumatera Selatan that only can ease my parents burden because my parent’s incomes less than Rp.1000.000 each month is not enough,  im not sure if my parents will be able to finance my school if i attend regular high school.  If i’m being chosen by SMAN Sumatera Selatan im ability to join social class in SMAN Sumatera Selatan as the top 3 highest scores National Examination in Sumatera Selatan in 2017 because I want to be director of a company so i can lead all of my members to be great team then all of my experiences and the knowledge that i get from SMAN Sumatera Selatan i can share it to all of people for better future Indonesian generation leader in next 10 years later.\r\n\r\n \r\n'),
