tudying in SMAN SUMSEL  because as i know where this school is really- really good to prepare indonesian future leader that was my sister said to me. I want to change everything in my life through becoming part of student SMAN SUMSEL school. If im choosen by SMAN SUMSEL school i will study harder than before i will give more my effort and contribution for SMAN SUMSEL School. SMAN SUMSEL gives opportunity to poor students like me to be the best student without cost, but with complete facilities. Only SMAN SUMSEL that can ease the burden of my parents. With my parent incomes less than Rp.1000.000 per month is not enough,  im not sure if my parents will be able to finance my school if i attend regular high school.  If im being choosen by SMAN SUMSEL im ability to join social class in SMAN Sumatera Selatan as a top 3 highest scores National Examination in Sumatera Selatan because I want to be director of a company so i can lead all of my members to be great team then all of my experiences and the knowledge that i get from SMAN SUMSEL i can share it to all of people for better future  Indonesian generation in next 10 years later.   '),
