('devimultiani15@gmail.com', 'My namr is Devi multiani oktavia, i\' m a 9th grader of SMP NEGERI 55 PALEMBANG, i am one of students who can be said to achievement at school, i got a champion class and i also got the first winner of the class level review contest of Smp negeri 55 palembang.\r\nMy habit at home is help the parents and not forget study as students. I was the first child of 4 siblings in my family. I have 2 younger sister and 1 younger brother. My first younger sister in grade 6 and the second grade 2 in elementry school. And my little brother is 2 years old. My father is a laborer and my mother helped father with a small sale.\r\nMy interest in Sman sumatera selatan is because i am full of the circumstances of my parents who are less able to finance my school and my two younger siblings. And also Sman sumatera selatan is looking for outstanding students and from poor families, i use this program to get a free school opportunity.\r\nMy dream in the future besides wanting to make my parents happy, i also want to be one of the successful people out there.\r\nMy ideal of leadership is to be a fair, firm, and hardworking woman. I learned that from osis organization at school.                              '),
('dhimasalannas9626@gmail.com', '              Assalamualaikum Wr.Wb\r\n    May be always in the protection of God. Hallo my name is DHIMAS AL ANNAS and my nick name is Dhimas. I am studying at Junior High School O.Mangunharjo which is in Musi Rawas rengency. I was born in O.Mangunharjo, January 10 2003. My hobby is swimming, play volley ball, and reading. I love reading because by reading i can know many things. I live in with my parents my father named is Surip Harianto Siswoyo and my mother is Sami. My father work as farmer and my mother is housewife. I am the second child of two sibling. I have a sister, her name is Neny Listiany.\r\n    During in Junior High School. I have followed several competition. Among the third champion of the competition singing songs of Musi Rawas regency, the drama competition, the competition read poetry, competitions speech english, and dance. In addition i do really active at scout and i love to do a camping because i can learn how to cook by myself and learn to live independent.\r\n    At school i am active in OSIS and i am as the chairman coordinator for flag ceremony. It is nice to be the coordinator because i can how to perform the flag ceremony well.\r\n    For me education is the key in shaping a better civilization, with that i want to share to many people that education can change things for the better. Besides education is an important thing to prepare the generation of Indonesia to become a leader. There for i am very trying to get a good education despite hanpered by many obstacles. Especially in the econimic field. But i believe with education i can change my familly and ennvironment for thr better.\r\n    I do really want to be a student of SMA NEGERI SUMATERA SELATAN, because there i believe i can obtain education that well, and because i want to be useful young generation for many people. I want to be a state officials, because i want to serve the country. Besides, i want to make country free from corruption, free from country from poverty, dissociate Indonesia from various chaos, make Indonesia country that secure, serene, and peace.\r\n “ I IS YOUTH I IS HOPE NATION THEN I WILL CONTINUE SHARE TO FELLOW”\r\nThank you \r\nWassalamualaikum Wr.Wb\r\n'),
