('Diananisaa12@gmail.com', 'Assalamualikum wr.wb introduce my name Dian Anisa I come from the Seri Kembang 1 village sub district Payaraman Ogan Ilir regency I come from a harmony family I also have 2 sisters and both women. I feel proud to have a family harmony like now even though our economy is enough. Now I am sitting on the bench nine junior high school one Tanjung Batu village. From the beginning I wanted to go to SMAN SUMSEL because want to science and want to ful fill the ideals and want burden of parents and want to raise my family\'s degree.\r\nThe dream of being a doctor is actually too high for children who belong to poor like us. However, for our ideals can grasp and we believe certainly get help from Almighty Got. If only I was already successful in future I want to have its own hospital because I really want to give free services and fulfilling to patients who are poor like me right now. So that the next generation of the nation\'s future continues to be healthy and intelligent.\r\nWant to high school but the economy does not support ? SMAN SUMSEL is his choice                                                            \r\n'),
('dianprameswari31@gmail.com', '                        Introduce my nme Dian Prameswari, i;m 16 years old. I was born in the city of Pekanbaru in 2002, precisely on 7 october. Ilive on Padat karya street. I was made up of 4 brothers, and i happened to be the first child. I have 3 sisters, 2 girls and one boy. I have a swimming hobby. Both my parents are from the tribe of Java. My mother was named Sri Rahayu and my father was named Sudarko. I am a junior high school 29 student of Palembang country. Here i have some achievements in my class.\r\n                       That is class i get the rank 3, in class 2 i get the rank 1, and on semester yesterday exactly in grade 3 i get champion i back. And yesterday i participated in winning energy saving competition representing junior high school 29 Palembang country. We have won i st school level in south Sumatera. As soon as i am graduating, I am thinking of going to high school for SUMSEL because that school is the school that i can pass on the SMA.\r\n                       Amen .....\r\n    '),
('diffashakira@gmail.com', '      I am the usual person that want to reach my dream will come true in my life.  My name is Diffa Shakira Muhammad Thalib.My friends call me Diffa.I was born in Bogor,january 2th 2003.I’m fifteen years old.My father’s name is Muhammad Aziz Thalib,he is bussines man and my mother’s name is Reni Istapra,she is a PNS in health.I am the first child of three siblings.My little sister named Nisa muhammad Thalib she is number second,she study at SMPN 1 Srikaton.And the third is my young sister she is Naffa Muhammad Thalib,she study at SMPIT al-qudwah Musi Rawas.\r\n     Last years when I was six years,I took TK Dharma wanita D.Tegalrejo.    After that I continued in SDN 1 Srikaton ,and now Iam in junior high school in SMPN 1 Srikaton .My hobby are reading and writing.I love reading and  writing for all genres,but I love fiction books,like novels,short story,and fairytale.My favorite author is edgar allan poe,he is famous with creepy and horror story like the reaven and midnight stories.And the midnight stories is my favorites books.The midnight stories contains of many short story,that make you goosebumps.Since I was child,I really love english.I like english because I often watch english movie.Besides lesson english I also like ipa lessons.\r\n     I choose SMAN Sampoerna in Palembang,because SMAN Sampoerna is my favorite and I like study here to make me responsibility for my self and I hope I am Study in SMAN Sampoerna and I want to be a teacher in the future.I want to be a teacher because the teacher is the work of the noble work.\r\n  ');
