('dindayunatha1@gmail.com', 'My name is Dinda Yuntatha Ashyla. My nick name is Dinda. I am the first children of three children. I was born in Palembang,  April 5th 2003. Now I am study in Junior High School Number 3. My family live in Kayu Agung, but now i live with my aunty in Palembang. I live in Kalimusi street, Gotong Royong alley, number 3980B. My father’s name is Yuhanas Sapa. He works as an entrepreneur. My mother’s name is Nita Herlina and she is a housewife. I have two younger brother and sister. My sister’s name is Dzahra. She is 7 years old. And my brother’s name is Bara, he is 2 years old. My hobby is swimming.\r\nMy achievement at school is always in the top 3. I also active in osis organization and served as vice chairman of the period 2016-2017 osis. In the 3 years i live with my aunty, I am used to not living with my parents, so I\'m ready to stay in dormitory for the next 3 years. All this time I am used to washing my own clothes, washing dishes, ironing, sweeping, and mopping. \r\nI have a dream to be a policewoman. I thought the policewoman is a woman who firmly has the soul of leadership and responsible. Besides being a policeman I want to be a pediatrician because when i was in lementary school i was once be a little doctor. Then i thought being a doctor someday will be a great job.\r\n\r\n             '),
('dini101@gmail.com', '   ASSALAMUALAIKUM WARRAHMATULLAHI WABARAKAATUH \r\n\r\n   HALLO . MY NAME IS DINI NURAINI . MY NICK NAME IS DINI. I WAS BORN IN\r\n MARDIHARJO VILLAGE AT APRIL 28, 2003. I AM STUDYING AT JUNIOR HIGH \r\nSCHOOL O.MANGUNHARJO. I LIVED WITH MY PARENTS. MY FATHER NAMED IS \r\nMARHISAM AND MY MOTHER NAMED IS SRI SUNARI. MY PARENTS WORK FARMER. MY \r\nHOBBIES IS READING, START FROM READ BOOK UNTIL READ KORAN BECAUSE READ \r\nWE CAN GET KNOWLEDGE.\r\n  I WAS BORN FROM THE LESS FORTUNATE FAMILY. WITH INCOME MY PARENTS \r\nAVEREGE Rp.500.000-Rp.1.000.000. IN MY VILLAGE MANY PEOPLE SAYING THAT \r\nTHE UNDERPRIVILEGED DON\'T NEED HIGH SCHOOL. BUT I IGNORE ALL THESE WORDS\r\n I BELIEVE THE WORDS IS WRONG. PEOPLE CAN NOT AFFORD TO BE SUCCESSFUL IF\r\n STUDY EARNESTLY, TRY, AND PRAY TO GOD.\r\n  IN MY VILLAGE, I JOIN ORGANITION IRMAS. DURING IRMAS, I WAS APPOINTED \r\nTO CONTESTANTS THE QUIZ RELIGION FOR THE DISTRICTS.\r\n  DURING AT SCHOOL, I EVER I\'VE BEEN IN A DRAMA RACE , THE READING OF \r\nTHE 1945 CONSTITUTION, EVEN I WAS APPOINTED TO BE A COMPETENT RACE \r\nCONTEST AT JUNIOR HIGH SCHOOL THE LEVEL OF MUSI RAWAS REGENCY. \r\n    I\'D LOVE TO BE A LECTURER . IF I GET A CHANCE TO BE A LECTURER, I \r\nWILL EDUCATE THE NATION\'S CHILDREN THEY HAVE , WANT TO IMPROVE HOW TO \r\nLEARN TO BE MORE CREATIVE .\r\n    I WANT TO SMAN SUMATERA SELATAN , TO BE WELCOME ME THE NEW STUDENT \r\nBECAUSE I WANT TO THE STUDY MORE GOOD AND I WANT TO LEARN ENGLISH MORE .\r\n THANK YOU . \r\n\r\n  ALHAMDULILLAH HIRABBIL\'ALAMIN \r\n\r\nWASSALAMUALAIKUM WARRAHMATULLAHI WABARAKAATUH .                                              '),
('diniandriani0906@gmail.com', 'HELLO! I WANT TO INTRODUCE MY FAMILY! SHE IS MY MOTHER. HER NAME IS ASMUNAH EKAWATI. HE IS MY FATHER,HIS NAME IS M.EDWAR.HE IS MY BROTHER, HIS NAME IS FEBRIANSYAH THAT IS MY FAMILY. MY ACTIVITIES IN SCHOOL AND STUDYING AND FOLLOW OTHER ACTIVITIES THERE ARE LIKE SPORT.AND I LIKE BASKETBALL. BASKETBALL IS NOT A GAME HARD TOO AND IT\'S SO EASY NEITHER. YEAH, BUT IT\'S A PROBLEM IF YOU WANT TO TRY. \r\nTHE FIRST TIME I ANTERED THIS SMP I WAS A LITTLE AWKWARD BUT IF TURNS OUT THE TEACHERS ARE GOOD, AND THE TEACHERS TEACHES HIGH DISCIPLINE AND ALSO TEACHES THE COURTESY. BECAUSE, I WANT TO BOAST BOTH MY PARENTS AND REALIZE MY AMBITION TO BECOME A FIGURE THAT IS USEFUL FOR THE NATION AND RELIGION, AND MY AMBITION HAS BEEN TO BE A PERSON WANT TO BE SOMEONE CAN HELP THE COMMUNITY THAT IS POLICE WOMEN. I JUST AN ORDINARY HUMAN WHO CAN ONLY PRAY AND TRY TO KEEP THE WHAT I TRY NOT WASTED. I KNOW THAT MY PARENTS ARE LESS FORTUNATE. BUT WHY? SUCH A PROBLEM CAN NOT BE A BEAN FOR ME TO STUDY AND ENTER A GOOD SCHOOL AND WHAT I WANT. THIS IS A SCHOOL THAT I LONGED FOR BECAUSE THIS IS AN OPPORTUNITY THAT WILL NOT HAPPEN AGAIN,I WILL NOT MISS THIS ONE. \r\nOK, THANKS FOR YOUR ATTENTION I SAY WASSALAMUALIKUM WR. WB.'),
('diyelarjuna17@gmail.com', '                              My name is Diyel Arjuna. I was born in Umo jati, June 17th 2003. I live in a small village of Empat Lawang regency named Umo Jati. My parent work as a farmer. My mother\'s name is Yenti and my father\'s name is Edy but unfortunately he already died about three years ago. I also have two older sister, the first one named Dhera Love Nia she is a nurse and already married and the second one is Nada Melinda she is studying in accounting department state of Polytechnic Sriwijaya. When my sister talking about this school i already interested eventhough i know to enter this school is not easy but i just want to try. Through the score i have in junior high school and my attitude i hope i can join this school to be a leader. My purpose for joining this test is hopefully when i enter this school i can be a successful person in the future and make my parent proud of me especially my mother because she always spirit to give us good service even my father already gone. '),
('dltlorenza@gmail.com', 'Full name of Delta Lorenza, Delta nickname, place of birth date of Pagar Jati, June 01, 2003, female gender, Islam, relationship status in the family of Anak Kandung. The first child of three siblings, aspiring to become English Teacher, residence address of Pagar Jati Lintang Kanan Empat Lawang village of South Sumatera. Name of father Aryadi, born in Pagar Jati on July 1, 1980, Mrs. Jusna Wati was born in Pagar Jati on 30 August 1981, the work of Father and Mother is a Farmer. The names of Nadila Humairoh\'s sister and Restu Aprilio. Grandfather of Nirhamzah\'s Father and Grandma Nurma, Grandfather of Mother Mat Aris (The deceased) and Grandmother Mordia. My hope if you go to SMAN South Sumatra is want to add knowledge and also want to add my learning insight, my interest to the achievements achieved by the students of SMAN South Sumatra and the most important is to ease the burden of both my parents because we from poor families.'),
('dndapl35@gmail.com', '   Let me introduce my self, My name is Dinda Putri Letari. Usually called Dinda. I go to school in Junior High School 6 Sekayu. I am 3rd child of 3 siblings. I was born may, 3rd 2003. By astrology, I am Taurus. My relegion is ISLAM. My blood type is O. That is know since childhood. My height 156 cm, and my weight 55 kg. My hobby is  swim, read a novel book, and watch korean drama. \r\n   About my personality. I\'m a hard person socialize, and hard get to know the new environment. but now i am trying to changed to be better. Mybe, I hard to get socialize. Because, I hard to smile and laugh. If already nearby, I am very noisy person and kind.\r\n   I live with my parents and 2 brothers. My parents name is Rozali and Khoirunnisak. My dad works as employe BUMN, and my mom is a housewife. My parents only SHS graduate. And my old brother is Wahyu Andika Rohmadhoni, And my young brother is Muhammad Iqbal\r\n   My ambition is a Neurosurgery. I want tobe Neurosurgery because, in INDONEISAN the least. More or less 150 Neurosurgery. And Neurosurgery Indonesia must serve 220 million people.        '),
('dwiamelia227@gmail.com', '                              My name is Dwi Amelia. My age 14 years old. I am Second Child of my dad Mustopa Kamal from Lahat Gunung Meraksa and my mom\'s Siti Nurlaela from Kuningan Cirebon.\r\n                              I am nine class from Junior High School at SMPN 50 and i want continue to my education to SMAN SUMSEL. I hope i can be accepted for sustainability my education Sriwijaya University to be provesional secretary which i aspire to because i will change image bad about secretary that\'s all beautiful but not smart'),
('dwijaniar_28@gmail.com', '                           MY NAME IS DWI JANIAR QURNIA. PEOPLE USEALLY CALL ME NIAR OR NAYER. I\'AM FIFTEEN YEARS OLD. I STUDY AT JUNIOR HIGH SCHOOL NUMBER SIX, SEKAYU. I AM AN ONLY CHILD IN MY FAMILY. MY MOTHER’S NAME IS ROSADAH AND MY FATHER’S NAME IS JABIDI. I WAS BORN IN SEKAYU, JANUARY 28TH 2003. I LOVE READING NOVEL BECAUSE IT IS MY HOBBY. I LIVE IN A SMALL CITY IN MUSI BANYUASIN REGENCY. CALLED SEKAYU CITY. SINCE I WAS KID. MY AMBITION IS BE COMEING A DOCTER BUT THAT AMBITION DISSAPEARED BECAUSE I HAVE CHANGE MY MIND.\r\nI DESERVE TO BE STUDENT SMAN SUMATERA SELATAN BECAUSE I HAVE A STRONG WILL TO LEARN WEATHER IN ACADEMIC OR NON ACADEMIC.I ALWAYS TRYING GO OUT FROM MY COMFORT ZONE. I MEAN GOING OUT FROM COMFORT ZONE IS I WANT TO TRY LIVING FAR FROM MY PARENT. ALTHOUGH IT’IS JUST GOING TO THE INNER CITY OF PROVINCE, PALEMBANG.  MANY PEOPLE SAID IF WE GO OUT FROM MY COMFORT ZONE WE CAN GET MANY DIFFERENCIES FROM OTHER. BECAUSE WE WILL FIND NEW PEOPLE, NEW ACTIVITIES, NEW ATMOSPHERE, AND NEW ENVIRONMEN. I AM ALSO A HARD WORK. I AM SURE FOR BECOMING STUDENT OF SMAN SUMATERA SELATAN WHO LIVE IN DOOR MITORY, THAT CHARACTHER IS NUMBER ONE. \r\nIN THE FUTURE, FIRSTLY, I WILL CHANGE MY SELF. FOR EXAMPLE I WILL MANAGE MY TIME WELL AND WE IT FOR POSITIVE THINGS. MY CURRENT AMBITION IS ENTERPRENEAR. IF MY AMBITION IS HAPPEND. I WILL BUILD MY PERSONAL COMPANY. THE REASON I CHOOSE TO BE ENTERPRENEAR IS I WANT TO GIVE CHANCES FOR PEOPLE TO WORK IN MY COMPANY. SO THEY AND THEIR FAMILY CAN GET A WELL BEING LIFE.\r\n             '),
('dwimuharromi11@yaho.com', 'Hello my name is Dwi Muharromi. I was born in Palembang,March 11,2003. I’m 14 years old. I\'m ninth grade at junior high school 20 Palembang. My hobby is singing,writing,and reading. And,I want to be a lecturer. I have two sisters.\r\n       The first is my older sister, Febriyani Amizwan. She was born in Palembang,February 4,1998. She is 20 years old. She is a student at Sriwijaya University. She got a Scholarship Bidikmisi at Sriwijaya University. Now,she is 6th semester.\r\n       The last is my younger sister, Triana Maharani. She was born in Palembang,October 29,2009. She was a fourth grade at MI Nusantara Primary School. She is 8 years old. We come from poor families. But,we’re always happy.\r\n       My father is Darmawan. He was born in Lampung, July 5, 1972. He is 45 years old. My father worked as a casual laborer. Her earnings are approximately Rp1,500,000.-  Now,  Dad is in good health.\r\n       My mother is Amizawaty. She was born in Palembang, December 17, 1972. My mother was 45 years old. Mom doesn’t work. Now, my mother is in good health.\r\n       My father strongly supports me to connect my education in high school South Sumatera or Sampoerna Academy. I promised him that I won’t disappoint him.\r\n   Every day,I always pray to God so that I can go to high school South Sumatera.                              '),
('dwinormaapriyanti@gmail.com', 'My name is dwi norma apriyanti,i\'m a student of SMPN 24 Palembang. I have one sister, her name is fadhilah apri wulandari. i have a very good mother in the world. she is a teacher at SMPN 1 betung, her name is suparni. when i lived in betung, in the 2005 when i was 2 years old.my father was got an accident. it was about 10 am because he was take to the hospital but my father was died before arrived to the hospital'),
