('dwiranti191102@gmail.com', '      INTRODUCING MY NAME I DWI RANTI BORNED THE BATURAJA AT NOVEMBER 19, 2002, I WAS BORNED BY MULYADI AND SUSILAWATI EKHWAN PARTNERS. I HAVE A SINCE WHICH WAS REDUCED NICHIC AND A SENSE OF WIDYA FRISCA.\r\n      I AM FROM SMPN 02 OKU REASONS I WANT TO ENTER SMA N SUMSEL IS WANTED TO HAVE A LEADER LEADER AND OBTAINING MANY ACHIEVEMENTS.\r\n      BECAUSE MY OBJECTS WANT TO BE A UNITED STATES DUBES.\r\n\r\nIMMEDIATE MY DATA OFFICIAL AND THANK YOU\r\n\r\nDWI RANTI'),
('dwiranti200211@gmail.com', '                       MY NAME DWI RANTI BIRTH IN DAY 19 NOVEMBER 2002 IN BATURAJA. I BORN FROM MULYADI AND SUSILAWATI EKHWAN PAIRS, I HAVE TWO BROTHERS A YEARS OF A SINGLE WHO ARE REDUCED NEDIKA, AND A LITTLE WHO IS WIDYA FRISCA.\r\nI AM FROM SMP NEGERI 02 OKU, I WANT TO ENTER THE SMA N SUMSEL BECAUSE BY THE INFORMATION THAT I CAN SUMS SMA IS A SMA HAVING A HIGH LEADER LEADER, HAVING A STUDENTS OF ACHIEVING SISWI.\r\nBY BECAUSE I WANT TO ENTER THE SMA N SUMSEL BECAUSE I WANT TO HAVE A MORE LEADER LEADER.\r\nIMMEDIATE MY DATA I THANK YOU.       '),
('Egiruanda1510@gmail.com', '       My name is Egi Ruanda Putra. I was born on Tempirai, 15 October 2003. I am the third child of four siblings. I am the nineth grade students in SMPN 4 Penukal Utara. In Junior high school, I follow many organizations. The first organization, I follow are asis and scout. I also get a grade rating as well as some awards. I am discipline and independent person. I always want to seek knowledge and always study hard. It makes me able to continue studying in SMAN SUMSEL Palembang.\r\n      I was born from Mr. Kosasi and Mrs. Winarni. I live from a simple family. My father worked as a civil servant and my mother as a housewife. My parents always teach me to be a discipline person and study hard. Because they hope I can continue to  SMAN SUMSEL, Palembang\r\nIf the future I want to be a Doctor. If at the level of education in the SMA, I want to school in SMAN SUMSELPalembang. I am sure I can reach what my dream in the future. My hope is I can continue in SMA SUMSEL Palembang.\r\n'),
