('eldacimol187@gmail.com', '   My name is Elda Nuriza,you\r\ncan call me Elda.I Live in Tanjung Payang,I was born on July,18 2003.I am the second child of three brothers.My height is 146 cm and My weigh 50 Kilograms,My blood type is AB.my religion is islam and my physical characteristic are Have Chubby cheeks and flat nose also I am not too tall.But I have a good voice.My hobbies are reading book,playing badminton,and travelling.I think my hobby have benefits for me and maybe other people.about my personality,I have a friendly  nature,kind,and slightly quiet attitude.I am  type who cares about  others,my friends said.and I also have a bad nature . I’m easy to get emotional.but I’m trying  to be a better human being.\r\n       I have a happy little family,my father named WENI OKIANTO.he is a farmer something idle,while  my mother named IDA ROYANI.she is work in Taiwan as a maid.I have one brother and one sister.my brother named Eldi Hopizen,he is a student in a vocational high number 2 pagaralam and my sister named aliyya sheli qhalika, she is a student in elementary school number 61 pagaralam.I became a mother at my house. I was sweeping the house,washing dishes, cooking, washing clothes, and many others.\r\n     The reason I want joint at sampoerna school,because I am come from the poor family, my score enough to register to SMANSUMSEL,and I can to compete with other students to enter SMAN SUMSEL,and also I have academic and non academic achievement,I was quite active in learning and the organization,I have some talent that I can tackle to make it an achievement,I studied diligently and it made me smart and often got first rank in the class.\r\nMy future leadership aspiration is?\r\n     After graduation from SMAN SUMSEL, I want to continue my studies at oxford university,I will major in science field because I want to be a great scientist and can help my family\'s economy,also make my parents proud.I want to can experience the thriil of discovery,the incredible visceral feeling of doing something no one has ever done before,see things no one has ever known before and I will try so hard that my dreams can be achieved,I believe SMANSUMSEL will help me realize my dream because I know that SMANSUMSEL wear dual curriculum that is national curriculum(K13)and also international standard curriculum(CEIE and IGCSBE Cambrige)\r\n\r\n                           '),
('elisjabar87@gmail.com', 'MUTHIA ANANTA\r\nMy name is Muthia Ananta. I was born in Palembang on August 09, 2003. I am the first child of two siblings. My father\'s name Levi Azuar and my mother Elis Suriyana. I am very grateful to be born in the midst of a family who loves me very much. I used to live with my father, mother and sister in a rented house. But, since my grandmother passed away my family and I had to move to my grandmother\'s house to take care of my grandmother\'s household. And now I live with my grandfather, my aunts, uncles, and cousins in one house. Because my mother\'s first child so has the responsibility to take care of family replacing my grandmother\'s position.\r\nSince sitting in elementary school until now. I am known as a child who is smart enough, active, sociable, and religious. This self-assessment was done by people around me. Although they judge me like that, but I do not feel at all that I am smart, active, let alone religious. More precisely I am trying to be like that and the claim has no effect on me.\r\nIn my school years I often follow sports championships like Karate martial arts, Volley Ball. This sports championship I often follow both the district level, city districts, and so on .. and Alhamdulillah my achievements get thanks to the struggles and support of people around me.\r\nSince junior high school, I started to follow some self-development, Organization and extracurricular, such as Paskibra and OSIS. And Alhamdulillah I was trusted to hold the position as secretary of Paskibra and Vice Chairman of Osis at Junior High School Number 19 Palembang. In addition to being active outside the classroom, I can also balance the achievements in the class. Alhamdulillah I always get a class champion.\r\nI am interested in studying in Senior High School Sumatera Selatan because this school is a pure and disciplined school, in addition to that this school also uses an international curriculum that is only used by excellent schools in the city of Palembang. My desire to go to school here is fully supported by the people around me, as well as the intention of my heart to become a more independent person. My goal after graduating from high school is to continue my education to Sekolah Akutansi Negara (STAN) in Jakarta. My wish was so high that my parents could not afford to fulfill it. But because of determination and desire, I have to work hard. Perhaps if I was accepted in this State High School of South Sumatra, I could start a career life journey from here, I try to get what I want through the help of this Senior High School Sumatera Selatan.\r\n'),
('elizabethfebrian17@gmail.com', 'My name is Elizabeth Febrian Sitinjak. People used to call me Elisa. I was born in Palembang on February 17, 2004. I live with my parents, my grandmother and four of my siblings. My dad\'s job is a street hawker and my mom is a housewife. I was inspired by both my parents because my parents never gave up and worked hard. I have a determination and a strong desire to move forward. I want to change my family life for the better and I want to raise the degree of my parents. I really want to be one of the students of SMAN South Sumatera because I am confident of my ability to compete with other students. I want to be a good leader in the future. I also want to turn this nation into a better future and if I succeed in the future, I want to give education to Indonesian children so that Indonesian children can turn Indonesian nation into a better nation and Indonesia can become a respected nation in the eyes of the world. That is a biography of myself and my family, my eligibility to become a student of SMAN South Sumatera and my future leadership aspirations                              '),
('elsamonica799@yahoo.com', ' Hello. I want to introduce myself, my name is Elsa Monica, and you can call me Elsa. I am 14 years old. I like drawing and writing. Why I like it? Because I can share my feeling and shed my problems on the paper. But, actually my ambition is psychologist. I like human character and all about psychology of human being. I want to accompany people who feel lonely and not only be psychologist but also become their friend. Because that, I should try and give my best.\r\nI life in simple family. My family consist of my father, my mother, my brother, and my sister, also include me. My mother`s job is housewife. And my father`s job is farmer. As you know, I often troublesome them because our financial is weak. I want to help my family and make them proud of me. \r\nSo, I try to enter the test of SMAN Sumatera Selatan as the way to make they proud. I realize that many people are better than me, but I still want to try. Sometimes, I am not confident but my family, my teachers, and my friends always support me. I know I will make them disappoint if I fail. But before I give up, I will fight for my dreams and give my best. I trust nothing is impossible. There is no effort in vain. Ok, I think enough for my description. Thanks.                                       '),
('email612700@gmail.com', 'Assalamu’alaikum Wr. Wb\r\n	Good Morning Everyone\r\nOn this occasion, allow me to make an introduction about who I am. My name is Mutia Puji Lestari, I am the oldest of two children, I was born in Banyuasin, Juny, 14th 2004. Cudennty, my family and I live in Talang Keramat street Lrg. Keladi Number 1.\r\n	I deserve to be student of SMA N Sumatera Selatan, Because my father is farmer and my mother is housewife. I feel sorry them, sometimes my father goes from morning until afternoon to come home. When his garden is flooded, he can’t go to garden, and he looks for a job like a builder. I want to change them and I enter SMA N Sumatera Selatan because of economic fact. I want to be like my nephews who got a collage scholarship at Institute Agriculture Bogor (IPB).\r\n	My leadership ambition in the future, I want to happy people closest, especially my parents and my teachers. In this way I can make my parents happy. I want continue my education to higher level. I want to reach my goals as minister of forestry and with my entery in SMA N Sumatera Selatan can help me to get the future … Aamiin.\r\n'),
