('fahran53@gmail.com', 'My name is M. Fahran Arrafi. I am 14 years old. My hobbies are playing football and games. I live with my little and modest family in a small house, but we are happy and have a good life. My family consists of a Father, Mother, and my elder Brother.\r\n\r\nI think that I deserve to be a student of SMAN Sumsel, because I am a humble boy, I can be invited to work together with everyone, I want to practicing my english skill, and the important thing, I want to understand what my friends and the people want. I know it because I\'ll try to see and feel with their heart and their viewpoint. That is the thing that I want. And I think, it is what SMAN Sumsel and Life need. \r\n\r\nAnd for my future leadership, I think what society needs is from how we think to start working, so I want to make the life that everyone can think fairly, globally, and want to work together with all ethnic in Indonesia. This can cause an improvement to all sector of Indonesia. We can make Indonesia to be a great country as we have dreamed. It will be good.\r\n            '),
('farhanmuarif2@gmail.com', 'My name is farhan akbar muarif born in Palembang on 30 october 2003. My brother is studying at Sriiwijaya University. I live with my parents in the village of lubuk harjo. Dad works as a POLRI and Mother works as a midwife, who can take daily life. Education history begins TK Imam Bonjol continued SDN3 Gumawang proceed to SMPN1 Belitang. Extra academic experience in the academic field (MIPA), non academic (OSIS, Scouting), from that experience of responsibility, discipline can shape the character of the future. This year I will continue the next level. I am very interested to SMAN Sumsel because this high school has good mission vision, very complete facilities, and excellent learning system. As evidence, many alumni are accepted PTK PTN best. The existence of a scholarship in SMAN SUMSEL is an opportunity for me to ease the burden of parents, in terms of cost and motivation to contribute to using the scholarship, because the scholarships are given not to students need / want but for those who deserve it. In terms of student activeness (ranking 3 large) I deserve it. For the future after from this high school I want to continue my study to the mining engineering faculty, to be able to work in PT Pertamina. I try to improve my future achievement by joining a student at SMAN SUMSEL.'),
