('ferdiansahdwika@gmail.com', 'Assalamualaikum Wr. Wb.\r\n\r\nMy name is Ferdiansah Dwika Permana. I am the second child of two siblings. I have a lot of friends and I love them very much. I also like do all my duties seriously coz I want get best result in my job.\r\n\r\nMy father\'s name is Imron Rosadi and my mother\'s is Aminah. My father\'s job is cleaning service in a futsal field and get salary Rp. 2.100.000/month and my mother is a housewife. We live in a small house and my parents rent it coz we don\'t have house.\r\n\r\nI really want to become one of students SMA Sumsel because I know this school is the best school in South Sumatera and I hope I also can study and learn how to be a leader for future in this school.\r\n\r\nI got many achievements such as always get rank in my class and I got general champion in my school. I also become one of school representatives in following efficient technology contest and I got the second champion in my town.\r\n\r\nIf I become a leader, I have to give motivate, inspiration to others in order they will success for future.\r\n\r\nWassalamualaikum Wr. Wb.                              '),
('fifiaura148@gmail.com', '                              I lived in a rented house Rp 1.000.000 per year, in that house i lived with my grandmother, grandfather, aunt and her child. Because coincide around my house there is mushalla, so grandfather waork as marbot at that mushalla, with wages Rp 100.000 per month, from the result that grandfather was able to support us all in this house, while my grandmother and aunt is a housewife.\r\n                              I want continue my study at SMAN Sumsel because i know my grandfather expenditure is very much, as a marbot he was paid only Rp 1.200.000 per year, and thats not enough to fulfill our needs like pay waterbill for a month. I realized if i studied at other school is very expensive so i and family cant afford that.\r\n                              Thats why i feel worthy of being one of the students of SMAN Sumsel, in addition to the average value of my academic report for 5 semester above average value and i was at 1st or 2nd rank in the class. Then, my future leadership is i want to be the osis leader in SMAN Sumsel with my character who upholds a sence of dicipline.'),
('figodwipurnama@gmail.com', '                              Assalamualaikum Wr.Wb\r\nLet me to introduce my self, my name is Figo Dwi Purnama. I was born in Pendopo, 17th Mei 2003.I live in Pangkalan Brandan Street No.119 Talang Ubi Barat,Pendopo,PALI. My father name is Kamaludin and my mother name is Fitriana. \r\nOne of my hobbies is gathering with others like follow organization and my other hobby is reading a book. I love reading, reading is an interesting activity, I like to read a history book or comic. My organization\'s experience is following the organization of Osis for 2 years, in grade 7 I became a member of Osis period 2015/2016 and in grade 8 I became chairman of Osis period 2016/2017. I also follow Scouting activities, in grade 8 I was inducted into a Penggalang Ramu.\r\nMy dreams is to become the Head of BIN (Badan Intelejen Negara), because I am interested in the intelligence world that prioritizes intelligence and ingenuity. Like James Bond Movies, Detective Conan, and others. \r\nI feel worthy to go to sman sumsel, because I am one of the best students in my school both in academic and non academic.\r\nMy motivation to go to Sman Sumsel is to boast my parents and increase my independence, intelligence, and skill. \r\nThat is all about myself, Thank you so much for your nice attention.\r\nWassalamualikum. Wr.Wb.'),
('fikry.junior24@gmail.com', 'Assalamu\'alaiikum WR.WB My name is Muhammad fikry rahmansyah , you can call me fikry. I am 15 years old . I am nineth grade student at SMPN 1 PAGARALAM. I want to be a police . My hobby is play football. I live in TALANG JERUK NO.5 .I Live with my little family, which comes from simple family. It consist of four members, there are my father,my mother ,my little sister, and of course i as the firstborn child in my family.i deserve to be student of sman sumsel because i am one of the nation\'s children,with my achievement sman sumsel can support my ideals. If i become a police i want to make the country safe and peaceful.and i want study in the highest university.'),
('firaaprilia176@gmail.com', ' My name is Shafira Aprilia Hadi,i was born in Jakarta on April 30th 2003.My parents name are Jefri Hadi Prayitno and Siti Nadipah.My parents have divorced,and my father live in Jakarta.I live with my mother in Gotong Royong market,Baturaden,Lubuk Raja,OKU.My mother remarried,so i have a stepfather his name is Kodri Edison.Since 2012 my father and i have lost  contact,so i don\'t know how my dad is doing now.I have 2 brothers the first name is Abbas Danuarta,he is 6th grade in elementary school number 33 OKU.And the second name is  Muhammad Fathir he is 4 years old.I live in a house owned by my parent\'s boss,we were told to live in it without paying rent.I like science and math very much I am from poor family and i get in my class.So,i hope i deserve to get into SMA Negeri Sumatera Selatan.I want to be a scientist because i love science and math.I also want to be a phsycologist because i want to give advice to people whose souls are disturbed,and i want them to be people who are useful for the nations.                              '),
('fisfisafnes@gmail.com', '                              Assalamualaikum Wr.Wb\r\nLet me introduce my self.My name is Afnes Fisnanda.My gender is male.I live in Margorejo, northern lubuklinggau district 1,Lubuklinggau Town.My Religion is Islam.I am the second child of two brothers.My father works as a farmer and my mother is a merchant shop.\r\nI study at SMPN B.Srikaton.My Hoby is Badmintoon,but I play Volleyball more often .And I joine SMPN B.SrikatonVolleyball Club.Exercise is done in the afternoon,and or Sunday or school holidays exercise is done in the morning.My school always follows the Volleyball championship tournament among  junior high school students,and indeed often get the champion.In November 2017,my school joined the caroline cup Volleyball championship tournament 2017.My school sent it’s best players in the junior high school sector.The result was positive.Then men’s team won 3rd place,and the princess team won 1st place,and one of my friends of the princess gots the title as the best performer of the junior high school student caroline cup 2017.My school award is not just this,but much more.\r\n   	I know the registration in SMAN Sumsel(Sampoerna Academy) from school.I would love to study at SMAN SUmsel(Sampoerna Academy) because;\r\n1.The school provides accomodation in the form of scholarships for srudents in the region os South Sumatra.\r\n2.The School is international.\r\n3.i am indeed worthy.\r\n	I know that daily life at SMAN Sumsel(Sampoerna Academy) user bahasa Indonesia and English.Although I am not very good in speaking English,but if I am allowed to go to SMAN Sumsel(Sampoerna Academy)  I will be more eager to learn English.\r\nWassalamualaikum Wr.Wb\r\n\r\n'),
('fitrianalau03@gmail.com', 'My name is Laura Fitriana.I am fourteen years old.I from Buay Madang Timur but I school in Junior High School 1 BELITANG.About the trip from home to school reaches 18 kilometers and I using it motorcycle and then this do everyday.I have one brother and haven\'t sister.When I was asked \"why you deserve to be student of SMAN SUMSEL?\" so I will answer with clear that I want have bright future and I think it can be realized with school in SMAN SUMSEL,and then I want know how feel when to have long distance with my parents.My ambition in the future I want make Indonesia have young generation the one that can lead Indonesia to be developed and realize ambition childrens which may be deficient cost to education but have spirit outstanding to improve their fate.                        '),
