('gabygea18@gmail.com', '      Introduce, my name Maria Gabyelent Gea. I was the first daughter of  three siblings, by the couple of Makmur Gea and of Riama Sitohang. I was born in Kayuagung, on 18 January 2004. I and my family a Christian religious, i and my family currently joining the Indonesian Baptist Church. I have some hobbies, the first I like to sing. I am grateful if from my hobby I can successfully win the several championship of  that I have ever followed. Although not all competitions can I win, but I believe that it can be a valuable experience for me in the future. My second hobby is, I can to play musical instruments. Although it can not yet say expert in playing music, but I was able to accompany the song of praise during worship in the Church. The musical instruments I can play are piano, guitar, and bass. I once learned to play music in the Church, but now I learn more by watching it from the internet site.In addition to being active in the arts field, I am also quite achievers in the academic field. Achievements that can be seen in my academic field is during sitting in elementary school and junior school, I was give able to rank the top five. Whether it\'s ranked one, two, three, four, or five.The reason I chose South Sumatera State High School as my secondary school is due. First, I know that South Sumatera State High School is a school that has an international curriculum of education. Which certainly has its own advantages. And this international curriculum is very rare I find in other schools. Secondly, because this school provides scholarships to any outstanding but underprivileged student in the field of economics like me. This certainly is a very tempting offer and draw my attention to me eager to enter this high school of South Sumatra. My third reason is that South Sumatera State High School has a boarding system that I think can make me focus more on my education. And this dormitory system is also an exercise for me to be able to live independently and live harmoniously in diversity.And the last reason I chose south sumatera state high school is because I want to be like an Gajah mada originally from a commoner who thanks to his intelligence, he can be a very wise, respected, and reliable war leader. And I am sure that I can also be like him.With this I hope I can get into South Sumatera State high school and be boast of both my parents and convince myself that I can realize my dream to dedicate every knowledge I have to every child who can not afford to go to school.and Whatever results I  get I believe it all comes from God, because only God\'s plan can bring goodness. Thanks.\r\n\r\n                        '),
('gilangbrilian18@gmail.com', '                              My name is Gilang Brilian Sanjaya. I was born in Pendopo, June 18th 2003. I live in a small Village of Empat  Lawang regencynamed Umo Jati but i study in Junior high school Ma\'arif NU Tugumulyo. My parent work as farmer and i have two young brother, The first one is Arga Rapelino Sanjaya he is elementary student andthe second one is Farhan he just three years old. When i heard about sman sumsel i was interested and i hope if i can join this school i can reach my dream to be a successful person to make my parent and my family proud of me. Eventhough my score is not really good in junior high school but i hope through my attitude i can be a part of ths school to be a future leader someday.'),
('grahadiganangaditya@gmail.com', 'My name Grahadi Ganang Aditya I was born at OKU Timur 16th of February 2003 my nick name is Ganang. I am student of SMP Negeri 1 Belitang, my favorite lesson are mathematics,  science, and English. I like mathematics and science because their challenge my mind to think logical and accurate. i have got some achievement like second place of young scientific competition and third place of quiz competition. My hobby are reading books and karate, i have got some achievement in karate like two achievement of kumite and one achievement of kata competition. My father names is Sholeh Nuryadi, he is civil servants. my mother names is Apriliana she is traders. I have one brother and one sister, my brother name is Nugroho Anis Wijanarko he is collage student at STIKes Muhammadiyah Palembang and my sister names is Risti Asmi Nurlia she is student in elementary school.\r\nI want to become one student of SMA Negeri Sumatera Selatan, because i want to develop my self and with SMA Negeri Sumatera Selatan i want to get achievement especially in science because i like science and make proud my parents and my school. \r\nSince I was child i want to be a doctor but I want to be an army, too. So i think why not to choose of them so can be doctor army, I can get more beneficial to my environment and people around me. After it I want to be ministry of defense and one day may be i can to be president of Republic Indonesia.');
