('gustiiicantikaaa@gmail.com', '               My name is Gusti Cantika Amanda Putri. My friends used to call gusti. I was born in Yogyakarta on the 5th of August 2003, I am the second child of two siblings. I live with my parents and a sister. My father named Cipto jatmiko ariadi, He worked as a laborer and my mother named Emiyanti and he is a housewife, my sister named Desty sagita R.p. We are both just two years apart though my sister and I often disagree, but we still love each other. Personally I have a friendly nature, kind but sometimes quiet, but I am happy to help my friends. in my spare time after school I usually gather with my friends. in every person, must have shortcomings as well as me, I do not like the arrogant because I think honest and humble is the most basic thing to be a better person. I prefer to spend time at home than outside without any clear activity. around the age of 5 years I went to school in PAUD KASIH BUNDA, then I study at elementary school 149 Palembang, I continue my junior high school education to 55 state high school. I through the junior high school diligently and diligently study, I follow the activities of school scouts. we always follow the race held by other schools. and for three years in junior high school I will continue my education to high school, and my first choice is SMAN-N SUMSEL. where I want to try to enter in SMA SUMSEL, so I can be more independent and disciplined. hope I can make my parents happy that has laboriously raised and educated me. I hope I am accepted in SMAN SUMSEL this.               '),
('hani@gmail.com', '                MY NAME IS AISYAH HANI, I WAS BRON IN GUMAWANG 06 NOVEMBER 2003. MY FAVORITE FOOD IS MIE AYAM.MY FAVORITE DRINK IS AN ORANGE JUICE. I AM MOSLEM PEOPLE. MY SPECIAL AMBITION IS A DOCTOR. RED IS MY FAVORITE COLOUR. MY FATHER IS A RELIGION TEACHER AND MY FATHER IS A NURSE. I HAVE ONE SISTER AND ONE BROTHER. MY BROTHER WAS,THE FIRST JUNIOR HIGH SCHOOL, MY SISTER AT UNIVERSITY NOW, AND THE LAST I AM THE THIRD CLASS OF JUNIOR HIGH SCHOOL. I LIVED AT RANTAU JAYA VILLAGE,BELITANG MADANG RAYA OKU TIMUR. MY SCHOOL NOT FAR FROM MY HOUSE. NOW, I AM STUDYING AT SMPN 1 BELITANG. MY SCHOOL IS ON JLN. MP BANGSA RAJA,GUMAWANG BELITANG OKU TIMUR. IN EVERY MORNING I GO TO SCHOOL BY FOOT.\r\n             IN  THE NEXT TIMES,I HOPE I WILL STUDY AT SMAN SUMSEL BECAUSE I HAVE SKILL IN ACADEMIC/NONACADEMIC. I HOPE I WILL GET THERE BECAUSE I INSISTED TO GET IT. IF I CAN STUDY AT SMAN SUMSEL I WILL PRIDE MY PARENTS, BECAUSE I WILL BEING FREE COST OF MY STUDY,BECAUSE MY PARENTS IN DEBT BANK.\r\n\r\nON OF THE REASON ABOUT MY AMBITION,IN FUTURE WHEN I GET A DOCTOR. I WILL BE HELP MANY PEOPLE,BECAUSE A DOCTOR IS NABLE WORK TO BE A DOCTOR IS MY SPECIAL AMBITION STILL WHEN I WAS A CHILD.\r\n\r\n '),
('Harisasalsabila18@gmail.com', '                 My name is Harisa Salsabila. I am the first child of two siblings. My father works as an entrepreneur. My mom works as a traveling merchant. My sister\'s name is Sabrina Fajrin. She was born in Tulang Bawang on July 22, 2005. She is a student in SMP N 3 OKU, class seven. My hobbies is reading various books. My favorit lessons is science and english. My ambition is doctor who have high leadership.\r\n   \r\nI deserve to be in SMA N Sumsel  because I belong to middle to lower economic family. I also include student`who excel in both academic and non academic. I want to continue my education to a higher despite the economic limitations of my family.\r\n\r\nMy leadership ambition that I want Indonesia must be true in accordance with the basic foundation that has been in the form of pancasila. In this modern era pancasila, Pancasila only as a foundation, but not underlying everything that axists in Indonesia. Then, I wan the Indonesian economy to be rebuilt by increasing the quality of Indonesian good. Education in Indonesia is still very low, including in my own area, one of the causes is difficult access to school. I want all children in Indonesia must be smart. \r\n'),
('has16082003@gmail.com', ' Assalammualaikum, my name is Sulis Susanti you can call me Sulis. my age 14 years old, I was born on Lekis Indah Batumarta 2. my hoby is reading I live with my mother and my step father name is pauli. I have two brothers and one litle sister, my brothers are Hengki Armada and Angga Saputra. my litle sister is Dita Amelia, my old brother Hengki Armada work now. my old brother Angga Saputra study in senior high school number 2 OKU, He is  on grade eleven science two. my litle sister  is 1,8 years old, now she learn to walk. \r\n     I like teach my frinds if they not understan about something that explain by our teacher , I hope I could be a techer in the future. but I have problem now not sure that I can continue my study to senior high school  because my brother do not have money for it . so, I hope I could be a student of SMAN SUMSEL for help my old brother because he is already pay my school from grade seven until now . so I hopeful for receive on SMAN SUMSEL to continue my study to senior high school.wasalammualaikum,wr,wb                              '),
('hasyir.saffanah@gmail.com', 'My name is Hasyir Saffanah. I was born in Bumi Pratama Mandira, January 27, 2004. My father’s name is Ahmad Munadi and my mother’s name is Sopiah. I have a sister and 2 brothers. My sister is a student of SMA Negeri Sumatera Selatan. And a brother is going to elementary school. The other is 2 years old. \r\n	I am the second child of my parents who like reading book, swimming, and fishing. I am an optimist person. When people said that I can’t, I trust that I can. I believe I can do what I want but without Allah I can’t do anything.\r\n	I realize that my family and I are poor. But by this condition, I should keep my struggle and spirit to reach my ambition. So my family will not be underestimated by people.\r\n	I know SMA Negeri Sumatera Selatan from my sister who is in 12 graders. It means she will graduate in this year and Insya Allah she will continue her study in her favorite university. This year is the last year for me in Junior High School. And I can conclude that my parents should work hard for it. So that’s why I want to be SMA Negeri Sumatera Selatan’s student. Morever, I see that SMA Negeri Sumatera Selatan has many good activities that can shape the skills of leader. SMA Negeri Sumatera Selatan has brilliant students also.\r\n	In the future, I want tobe a success architect. That’s supported by my liking to mathematic. I think in Indonesia, this job has many working prospects. Because Indonesia is a developed country or in other word, in Indonesia, the building process is more rapidly and it will need an architect. Beside that, I am also inspired by a famous architect in Islam history that lived in 3 period of governments. He was Mimar Sina Pasha. His greatest work is Suleiman mosque in Instanbul.\r\n	Everything that I have achieved is a proof and data from all of my effort and prayer. It is a form of happiness from my parents and me to reach my dreams.\r\n                              '),
