ess from my parents and me to reach my dreams.\r\n        Thank you\r\n                              '),
('heny.pupita@gmail.com', '                              Assalammmualaikum wr.wb\r\nMy name is Heny Puspita Dia Nofa, i am 14 years old, i live in Rantau Jaya, my birthday is OKU TIMUR 18 august 2003, i study to SMP Negeri 2 Belitang, my hobby is singing, my favorite eat of meatballs, my favorite drink of ice cream, favorite colour is yellow and blue. i have a brother, he is Fariel Pra Nofa, He favorite eat of meatballs. I have a father, he is Faisal, my father 38 years old. My father work is pedicap driver.  He always complate my needs. My father salary only for eat everyday so my mother help her work. My mother is susi novitri,she is 41 years old. My mother age is bigger than my father agemy brother 10 years old. he study to SDN 1 GUMAWANG. My brother very fat because he like eat.\r\nI want to go to SMA SAMPOERNA because motivated to continue to high education with free cost special poor student. I want to go to SMA SAMPOERNA because i want to make proud my parents and help load cost school.\r\nMy future goals want to be a teacher. I think the teacher is a hero. I want to be a hero. \r\n'),
