('ibrahim6101214@gmail.com', 'I always feel sad if i see many barren forest. The trees is gone. Does the lumber jack does not  feeling sad to see the tree has gone? The environment getting bad, disaster is everywhere. Because there is no trees which consume the rain. If the tree was able to speak,they will said \" What is wrong with me? What did I do that make me have to die? If we are realized, do we feeling sad to see the children breath with a bad air from the factories, cars, etc? If there are much more trees then there will be oxygen everywhere. Trees are valuable, so please stop the illegal logging.'),
('Ichacadwell@yahoo.com', '          My name is Aisyah Khazanah Miwa. A simple name that means \"the wealth of a prophet\'s wife\". My friends call me Aisha. I was born in Palembang, on 08 April 2004. I am the first child of four siblings and now live in Palembang area.\r\nMy father is Hifni, he is a laborer and my mother is Sri Mulyani and he is a housewife. Although my brother and I often quarrel, we still love each other.\r\nMy religion is Islam as well as my parents and sisters. has a blood group A newly known in 2011. Height of about 142 cm and weight 30kg. I have straight black hair. The light blue color is my favorite color. One of my favorite places is the beach. It was as if looking at the vast blue sea and hearing the sound of the waves roaring, my mood calmed down and all the heavy thoughts that are being felt can be reduced.\r\nRegarding personality, I have a cheerful, friendly, and kind nature because I love to help friends and happy to get along. I am also the type of person who will work hard in every job I am working on so that the work can produce something that is maximal. However, I also have some bad traits. I am spoiled and still often selfish. Until now, I have tried to reduce those bad qualities by trying to study independently.\r\nI have a hobby of reading motivational books. That\'s why I\'m interested in the business world. And free time I use to read books, reading newspapers, swimming, browsing, and watching news in order to benefit from these activities.\r\nAround the age of 1 to 9 years, I graduated from SDN 237 Palembang in 2015. I graduated in elementary school with a satisfactory value.\r\nI continued my junior high school education to SMP Negeri 3 Pemulutan. I went through junior high school diligently and diligently studying.\r\nHope I can be happy both my parents who have struggled to raise and educate me. They always give me encouragement, advice, advice and support both in happy and sad times.                   '),
('Idilubaidillah25@gmail.com', 'Hello, my name is Putri Nabilah, I am 14 years old. I have one brother, my parent name is Mr.Ubaidillah and Mrs.Lena Susanti. I am student Junior High School Number 01 Tanjung Raja. I like math lesson because I think mathematics is a lesson that demands us to memorize the existing formula and I like things my ability to remember. My father works a merchant and my mother too. My father was trading from market to market and my mother was selling at home.\r\nI fell worthy to be a student Sampoerna Acedemy because I have a good memory, a sense of high knowledge and I love new things and challenges and also I often get the overall champion nor class champion.\r\nMy future dream is that I want to become a doctor specialist in internal medicen for that I want to get a scholarship and get a collage degree with the best gardes and I also take the initiative to help people who are less fortunate but have a disease that may be expensive. I want to help the, in the future. They are my motivation to become a doctor.\r\n'),
('imeliasusan212@gmail.com', 'MY NAME IS IMELIA SUSAN AND I STUDY IN JUNIOR HIGH SCHOOL 02 TELUK GELAM IN MULYAGUNA VILLAGE. MY PARENTS WORK AS FARMERS WHICH HERE NOT CONSTANT SALARY BUT THEY STILL WORK HARD FOR THEIR LOVELY CHILDREN THEY ARE MR.SUHARTONO AND MRS YUSMINI.\r\nMY DAILY ACTIVITIES AFTER COMING HOME FROM SCHOOL I ALWAYS HELP MY PARENTS IN DOING ALL THE HOUSE WORK SUCH AS WASHING DISHES WASHING CLOTHES COOKING AND SO ON, AND I ALWAYS FOLLOW ALL KINDS OF ACTIVITY OF THE EXTRACURICULAR IN MY SCHOOL ONE OF THE EXTRACURICULAR IS SCOUT. WHEN I ASK PERMISSION TO MY PARENTS TO BE ACTIVE STUDENT THEY ALLOW EVEN THEY ENCOURAGE ME, AND I AM ALSO EVER INVITED TO BECOME ONE OF SCOUT COMMITEE IN ELEMENTARY SCHOOL NUMBER 2 MULYAGUNA OF COURSE I AM GLAD BECAUSE OF THAT AND I ATTEND THAT INVITATION BESIDES THAT I ALSO PREPARE MY SELF TO FACE NATIONAL EXAMINATION. BECAUSE OF THAT I REALLY TRY HARD AND OF COURSE PRAY IN ORDER TO MAKE MY PARENTS PROUD OF ME I ALWAYS ASK MY PARENTS TO PRAY FOR ME BECAUSE FOR ME PRAYER OF THE PARENTS IS THE MAIN.\r\nI ALSO HOPE I CAN ENTER TO FAVORITE SCHOOL AND BECOME SUCCESS PEOPLE,SO I CAN MAKE MY PARENTS PROUD AND HAPPY  OF ME. ONE AGAIN I ALSO HAVE ONE SIMPLE. I WANNA BE BUSSINESS WOMAN AND LIMIT THE UNEMPLOYMENT AND DESTITUTION IN THIS COUNTRY IN ORDER TO MAKE THIS COUNTRY BECOME PROGRESS COUNTRY IN THE NEXT.'),
('intanmaharanizulma@gmail.com', 'MY NAME IS INTAN MAHARANI ZULMA, IHAVE ONE SISTER WHO IS STUDYING IN TOURISM POLYTECHNIC AND I HAVE ONE SISTER WHO IS NOW IN THE 4TH GRADE OF ELEMENTARY SCHOOL. MY FATHER WAS WORKING IN \"BAPAS LAHAT\" AND MY MOTHER WORKED IN \"THE TOURISM PFFICE\". I KNOW THIS SMAN SUMSEL FROM MY FAMILY AND MY SCHOOL,FROM WHAT I HEAR THIS SMA HAVE A VERY GOOD LEARNING ABOUT LEADERSHIP AND FOREIGN LANGUANGE. I FEEL WORTHY TO ENTER THIS SMA BECAUSE I FEEL ALREADY HAVE A LEADERSHIP SOUL, WHICH MAY BE SHARPERED MORE DEEPLY IN THIS SMA. SO I AM VERY HOPEFUL TO BE ACCEPTED IN THIS SMA, SO THAT I CAN REALIZE MY DREAM TO BECOME A SURGEON WHO HAS HIGH INTERGRITY.'),
('Intanserapek@yahoo.com', '                      MY NAME IS INTAN MERHA MY NICK NAME IS INTAN I LIVE IN SERAPEK CITY I WAS BORN IN TANJUNG LUBUK, 05 FEBRUARY 2004 MY RELLGIUS IS ISLAM I AM INDONESIA MY HOBBIESARE  READING BOOK AND DRAWING MYAMBITON IS DOCTOR MY FAVORITE COLLOUR ARE BLUE AND SILVER ILIKE BAKSO AND SIOMAI AND MY FAVORIYE DRINK ARE MILK AND CHOCHOLATE ICE  MY FATER IS MERI HARWESI AND MY MATHER EMI ANJARSARI I HAVE ONE BROTHER AND ONE SISTER THEY ARE FAIZ AND MUTIARA AM A SHDEUT OT JUNIOR HIGH SCHOOL NUMBER 1 TELUK GELAM I LEKE READING BECAUSE BY READ I GET  MANY  INFORMATION AND I ALWAYS READ OVERY TIME ONE DAY BY MEDIA I KUOW ABOUT SMA SUMSEL AND I AN VERY EXCITED WITH THIS SCHOOL WHICH WILL PRODUCE QUALITY HUMAN RESOURCES SEEDS AND USETUL FOR THE COUNTRY AND COMMUNITY AND FINALLY I REGIESTERED TO STUDY AT SMA NEGERI SUMATERA SELATAN AND I HOPE I CAN STUDY IN THAT SCHOOL BECAUSE I WANT TO BE SUCCESS AND MAKE MY PARENTS HAPPY  BECAUSE THEY ARE FARMERS SO OUR ECONOMY IS LIMITED THAT’S WHY I REALY WANT TO GO TO SCHOOL IN SMAN SUM-SEL AND IF I AM ACCEPTED IN THAT SCHOOL I WILL LEARNING REALLY SO I CAN MAKE MY PARENTS HAPPY        '),
('Irwan1303@gmail.com', 'I want to introduce abaout myself, my name is Irwansyah, I was born in Lubuk Layang, March 15th 2003, I’m the youngest of 5 siblings, I have three brothers and one sister. All my siblings have married except me. I’m 15 years old, now I sit in Junior high school no. 1 Pendopo Barat grade 9. In grade 9, I have rank 1 in first semester, in my school I always be leader of my organization, in 7 grade,  I’m to be a leader of KKR (Kader Kesehatan Remaja), in 8 grade I’m to be a leader of class VIII. E and Leader of OSIS 2016/2017, I have some hobbies in Academic and Non Academic, In the academic I have a skill in Science physics. In non academic I have skill in sport likes Basket ball, Volly Ball etc. \r\n	In my family, I have a father, his name is syamsudin, he was born in lubuk layang, December 30, 1960. My father work as farmer, from his accupations, he got salaries Rp.800.000/month, from his salary we can pay of our house, and also for charge of my transportations and for my eat snack in school. My mother is Ilah, my mother was born in lubuk layang, July,20 1962. She is a housewife, she always make sure of my activities, likes prayer, study and playing with my friends. \r\n	Actually from bottom of my heart, I really want to enter SMAN SUMSEL, because I think this school is very popular in Sumsel and make my skill increase, increase in knowledge, talent, and my hobbies. I think, I have proper to get fellowship to come in SMAN sumsel, as I know this school is very have best qualities and I have achievement to be a students of SMAN Sumsel. I’m Proper to be a students of SMAN sumsel because my family have less economic so I want change our destiny, I want to make proud of my families because I want to be success in future.\r\n	I have a dream, I want to be a Police, because a police has a dedicate to our goverment to make this country better in future,  I think a police looks like gentle and strong, I always prayer to god, one day I can be a police,