('Ismiputri08@gmail.com', '     My name is Ismi Putri Intan, I was born in Magelang at date 20 june 2003. Magelang is a city small in the Jawa tengah. I have someone brother the this time already pass senior high school.\r\n     Moment I small, I live in the land of birth me. Yet, because demand economy, my parent move to Sumatera at 2004 and at moment this my still I year. And to this moment, I grew up in Sumatera. At moment elementary school, I go to school in Batumarta, the place is not so far away from my house. And at moment junior high school I also go to school in Batumarta.\r\n     At moment my parent moved to Sumatera, my father stayed in Lampung and worked at a company to move in fishery. At 2010 year, my father in relationship breakups work because the condition of the company that went bankrupt. After my father out of the company, my father worked as worker until now.\r\n     Since I elementary school until junior high school, I always get the ratings and the value that good enough. Because it, I want to continue my school in senior high school favorite, one of them in senior high school Sumatera Selatan. I want to learn more enterprising again, so I can change the status of economic be better again and I also want boast my parent with achievement me.                           '),
