('karinalingguana@gmail.com', 'My name is Karina lingguana. I was born on Tuesday, August 12, 2003. I live in the way of Muhammad Hatta villlage A. Widodo, I went to SMP NEGERI B. SRIKATON, class ix. 5.\r\nI was the first of three children. My first brother is now a boy in second grade and the last woman who is still a toddler. My family lives in a simple house. It was not the original house of my family , but the house of our great grand mothers relic, so it still looks old- fasioned. My father worked as a farmer working on the rice fields of my grandmother and grandfather. My father worked on the rice fields that are not so vast and earn an uncertain income. My mother is just a housewife who day to day only take care of the younger brother and take care of the house.\r\nI realy hope to get into SMA NEGERI SUMSEL. I want to be able to make both my parent  proud of me with Ican enter in SMA NEGERI SUMSEL which I favourite and that I dream. Besides I can make my family proud of me, I can also offset or reduce the cost that my parents have to spend to countinue my education after I graduate from junior high scool. I also want to make SMA NEGERI SUMSEL mode advanced from the previous year to the next year.\r\n	“Good Luck For Me”\r\n'),
('kimberinanisyah@gmail.com', '                              I don\'t have another reason beside want to help My Parents. I\'m coming from unfortunately family. I have a Sister that is 4th grade in Elementary School, also Young Brother that is 1 year old. My Parents needs much money for having a good education for me and my Sister. That\'s why, I\'m hoping to be a student of Sman SumSel to help My Parents, so they will not spend much money to my education, and the money can be used to my Young Brother. I was Osis member as sport section coordinator. I also became The Chairperson of Environmental Ambassador SMP Negeri 46 Palembang. From these two things I learned how to lead fairly, wisely, honestly and responsibly. I believe that I can to be student of Sman SumSel with my leadeship, achievements and economic situation. I believe that Sman SumSel as the best school of South Sumatera, could give knowledges and lessons for me to reach my dreams come true. I\'m ready for this test. My Parents said \"we trust on you, so ever broke it.\" And I know that \"be the best of the best is better that be the best of the bad.\" So, I wish that I\'ll have much achievements when I\'m being of Sman SumSel\'s student.'),
('kkimberina@gmail.com', 'I have only one reason. my reason is to help my parents. I am from an unfortunately family. I have one sister grade 4 elementary school and also a one-year-old brother. my parents needed a lot of money for a good education for me and my sister. that\'s why, i hope to be a student of Sman Sumsel to help my parents, so they do not spend much money for my education and the money can be used for my younger brother. I have become osis member as coordinator of sports section, also chairman of environment ambassador smpn 46 palembang. from both of them I learned how to properly, wisely, honestly and responsibly. I have also participated in several physics competitions. one of the most memorable is the national-level of physics olympiad in Malang, competing with students from Sabang to merauke and also achievements in Islamic religious science. I believe that I can become a student of Sumsel with my leadership, achievements and economic condition. I believe that sman sumsel as the best school in south sumatera, which can provide knowledge and learning for me to realize my dream become true. I am ready to take the test. my parents said \"we trust on you so don\'t ever broke it.\" i wish that I\'ll have many achievements when I\'m being Sman SumSel\'s student.'),
('lanbae0007@gmail.com', 'My name is Joan Felix Raka, the eldest of two brothers. My hope to study at SMAN South Sumatera is to achieve the ideals, in order to become a successful person, boast and lift the dignity of both parents and can make them proud.\r\n\r\nI was born from an underprivileged family, my father is only an honorary employee in a government agency with uncertain income and sometimes odd jobs, his salary is not up to one million per month\r\n\r\nwhile my mother is just a pastry vendor who since the last two years was forced to stop due to an accident that resulted in his right hand broken and can not normally return as usual.\r\n\r\nwe lived four in a rented house 4x6 m with bathroom outside.\r\n\r\n        '),
