('laurafitriana22@gmail.com', 'My name is Laura Fitriana.I am fourteen years old.I from Buay Madang Timur but I school in Junior High School 1 BELITANG.About the trip from home to school reaches 18 kilometers and I using it motorcycle and then this do everyday.I have one brother and haven\'t sister.When I was asked \"why you deserve to be student of SMAN Sumsel?\" so I will answer with clear that I want have bright future and I think itu cantik be realized with school in SMAN Sumsel,and then I want know how feel when have long distance with my parents.My ambition in the future I want make Indonesia have young generation the one that can lead Indonesia to be developed countries and realize ambition childrens which may be deficient cost to education but have spirit outstanding to improve their fate.\r\n      '),
('Laylaqodri01@gmail.com', '                  I want to tell you about myself...\r\n        My name is Layla Qodri Novita Sari. My friends usually call me Layla, I was born on March 1, 2003, and now I am less than 15 years old. My height  is 145 cm tall and weighs 45 kg,I have tan skin. my blood type is O+. My religion is Islam and every day I am using veil. and my physical characteristic are have a round face with chubby cheeks, and adorned with slightly slanted eyes with sliced brown, with a pug nose .I am the first child of two brothers. I live on kopral kadir street 49,pematang  bango , pagaralam city. My hobbies are reading novels, and volleyball. my family is a family that is not harmonious where my father and mother separated when I was 6 years old, after they parted me and my sister left to leave, and finally we are treated by my grandmother until now at my age almost 15 years, and my grandmother work as farmers to meet our daily needs. My grandmother named YUSNA WATI. While my sister named WIKA NARLISTA WATI now she is 13 years old, my father is named NARSAN, while my mother is YULISTA APRIANI.\r\n       The reason I can enter sman sumsel is I come from the poor family, my score is enough, I can  to compete  academically and non academic. I am not a pessimist but I am an optimist, a crisis, confident, unyielding and ambitious. That is the reason why I deserve this scholarship. And my goal to go to SMAN  Sumsel is I want to achieve my goals, lighten the burden of my grandmother, also want to develop my ability in academic and non academic, because I know that SMAN Sumsel  wear 2 curriculum that is national curriculum (K13) and also international standard curriculum (CEIE and IGCSGE Cambrige).\r\nMy future leadership aspiration is?\r\n        After graduation I will continue my studies in college, and I want to continue my studies at Oxford University and major in psychology, because that is my goal. and after graduating college I want to be a great psychologist and can help my patients, and support my patients who are in great need of me especially for children who experience some kind of psychological pressure that leads to mental damage and a deep sense of trauma. Usually caused by several factors, especially families, I just hope to reduce my patient\'s depression level, and make them recover from their trauma and can live a normal life like a normal human being. I will try so hard that my goals can be achieved, besides pride I can also help those who need me. That is my future leadership aspirations.\r\n          '),
('legisatrio02@gmail.com', 'My name is M.Legi Satrio. People usually call me Legi. I birth in lumpatan, on 26 june 2002. I have two brother and one sister. I aqualize children toward three. I study  in Jhs N 6 sekayu. My hobbies play football, I like play game, and reading book. My ambition wish be Soldier. I like ruse medley. My hight 160 cm, My weight 37 kg and My skin color is tasteful ripe. My father’s name is DARSONO. His job is farmers. My mother’s  name is RUSMAWATI. Her job is houswife.\r\nMy proper be student  Sman’ss, because I aqualize children from parent that simple. I have motto life for study and  I wish be people that success. I very wish proof something for parent, because Sman’ss equalize school when very good. Than from that when I in acceptence, I will to give that best Sman’ss.\r\nLeadership  I ambition  in the future it happened that I wish be leader from Soldier, because Soldier equalize people that very interest to devide state. When I be Soldier, I will to protest citizen Indonesia, I will destroy criminality in Indonesia, and that very interest it happened to destroy people that to disdain state Indonesia.\r\n                              '),
('liliansitiaa@gmail.com', 'I am the first child of five siblings. I live at my grandmoter\'s house. My father works as a casual laborer with an income of 1.000.000 to 2.500.000 a month, and my mother just as a housewife. \r\n\r\nI am an accomplished child plus the condition of my family who are less fornute so I deserve to be a student in Public Senior High School South Sumatera. Because Public Senior High School South Sumatera is a school with an internasional level and is intended for students who are economically disadvantaged.\r\n\r\nI want to be a teacher. I think being a teacher I can teach people what is wrong and right also I want my country to be a better with the teachers who are competent in their field. If I become a teacher I will surely change the area where I live that is Palembang to be a prosperous city with a teacher who teaches the community to be better in the future.'),
('lisaprila22@gmail.com', '	Assalamu’alaikum Wr.Wb\r\nAllow me to introduce my self My nsme is Lisa aprila. I was born on April 22nd 2003. I study at junior High School B.Srikaton,I’m in the 9th grade. I live in Jend.Sudirman street, A.Widodo,Tugumulyo,Musirawas,South sumatera. I’m the first child of 2 siblings. Since I study at junior high school. I have opinion about my future. I hsve comitment that I must the succes and can make my perents, in my class I cant get first rank but. I’m sure that I can get the bright future. I want to be able to pass the test at Sumsel Senior High School, because I want to try make a good impression there. The other reason is I want to study independently there, for away from my parents. Although, my friends are not sure about my success. But, never give up and never care with what the people say. The impotant is I must work hard and always pray for God. Believe and certain that Allah already plan the good for me. If I’m not success to pass the test I do not feel annoyed and disappointed. The important thing I already tried maximally and I’m brave to try without afraid if I will fail. Supported by my parents, my family, and many people who close to me that my spirit is full.\r\n       '),
('lizahframesti@gmail.com', '              My name is Lizah Framesti i am the youngest child of two sisters. I have a  19 year old sister, my father is 46 years old while my mother is 42 years old. I achieved since grade 1 elementary school until now. During 5 semesters in junior high school i always won 1st place in 3 semesters and 2nd winner in two semesters, I really want to go to South Sumatera State High School because with tuhs opportunity I can improve my achievenment, reach my aspiration and boast my parents\r\n             I also want to lighten the burden of my parents. My father was the first son of my grandmother. My mother just worked at home just cleaning the house. My mother had a cystic disease around her uterine wall and had to be operated 2 years ago when I was in seventh grade\r\n          My family who lives in a state of weil-being and does not want to imiate what other rich people do. I just keep on studying so I can get the beasisma so I can lighten my parents\' bevan\r\n          I always pray and worship, pleading to Allah SWT so that I can go to a higher level that is entering to SMA Negeri Sumatera Selatan with a satisfactory value. I also want to prove to people who once mocked me that I can succed with the achievements that I have been pursuing.               '),
('lonepaladin19@gmail.com', '     My name is Muhtadin Al Fiqih. I was born in Pagaralam and i come from a simple family. My father is a Silver Merchant and My mother is a Housewife. I also have a brother and a sister. My brother\'s name is Andy Martha. He\'s the oldest out of three of us. My Sister\'s name is Indah Fitriani. She is the only sister i have. And then Me, The youngest of all\r\n     Being one of Sman Sumsel\'s student is one of my big dreams. I believe that i am suitable to be a Sman Sumsel\'s student. With my background skills I will do the best.\r\n     My goal in this school is to improve my knowledge and education and also to be more confident, brave and talkative especially in English. My sister always says that i\'m a shy person but, she do believes that i\'m capable of doing anything more than I think. I want to be part of this school, because I want to help my parents, to proof everyone.                                   '),
('mafuad388@gmail.com', 'MY NAME IS MUHAMMAD ASRORUL FUAD THE SON OF MR.SUKIMAN AND MRS.SURANI I WASH BORN ON JULY 28TH 2003 IN MULYAGUNA.\r\nI AM A STUDENT AT JUNIOR HIGH SCHOOL 2 TELUK GELAM AND I HAVE MANY FRIENDS MY SCHOOL MY IN TEACHER OF GOOD GIVE CANCE SO THAT STUDENT CAN THINK BROADLY THE SCHOOL HAVE FASILITY COMPLATE AND TIME DISCIPLINE AND THE AROVAD OUR SCHOOL ALWAYS CLEAN SO AS STUDENT COMFORTABLE FOR LEARN. \r\nMY BUSTLE CURRENTY THIS IS HELP PARRENTS FOR EASY THAT BURDEN AND LEARN SO SUCCES LATER. MY MOM WORK AS HOUSE WIFE AND MY DAD WORK AS CASUAL WORKER.\r\nI WANT MOTIFASION FOR A STUDENT SENIOR HIGH SCHOOL SUMATRA SELATAN BECAUSE I WANT LIGH UP BURDENT TO MY PARRENTS AND SHOW TO MY FAMILY THAT I CAN REACH MY DREAM AND PARRENTS CAN HAPPY WITH MY ONE WAY.\r\nMY HOBBY IS DRAWING ESPECAILLY BATIK BECAUSE THIS IS CULTURE HARITAGE MUST THAT CONSERVE.\r\nI ALSO HAVE DREAMS FOR A RAISING THE HAJJ OF MY PARRENTS AND I WANT A ARCHTEC BECAUSE I WISH INDONESIAN COUNTRIES IN THE ADVANCED FIELD DEVELOPMENT SO THAT POPULATION EQUALY BECAUSE SO MANY SLEEP LAND IN INDONESIAN THAT UNTAPED WITH MAXIMUM .\r\nI VERY LIKE MATHEMATICS LESSON.\r\n(ALTHOUGH ME NOT A SMART BUT MY WILL LEARN FROM THE SMART PEAPLE).'),
('marshandaalfa@gmail.com', '      Hello, I want to introduce myself first. My name is Marshanda Alfa Amaria you can call me Marsha or Sasa. I was born at Pagar Alam on 6th July 2003. My hobby are reading, singing and writing. I really love writing a poetry, because I think when I write a poetry I can shed all of my soul and my mind. My ambition is a doctor. Being a doctor is a fun profession and I really love to study about human, that\'s why I like science especially biology and physic. \r\n     I have a simple family, my family consists of 5 persons include me , My father\'s name is Ferry Andrianto he is a welder in small workshop. My mother\'s name is Titi Zaenab she is a helper or usually called assist in the other house, she works near by my house. My brother\'s name is Farrel Dwi Andrian he is 8 years old and student 3rd grade in elementary school. My sister\'s name is Zhahirah Trie Aulia she is 6 years old and student 1st grade in elementary school. I\'m so happy to have them, they teach me about everything. \r\n     By the way I know the information of SMAN SUMSEL from internet access, when I was 4th grade in elementary school I felt interested to enter and join in SMAN SUMSEL. It was my dream from I was kid, so I always study hard to make my dream come true and to make my parents proud of me I always do my best to get great achievement to reach my dream there. I really amaze of this school because the quality of this school is great than the other school. And I really want to know how studying in this school. I know and realize maybe I have many rivals out there to get a dream to can school on this school. But I will give all I have and do my best I\'m still learning about everything to make my knowledge spacious especially English, maybe my English so bad right now and I\'m sorry if there are some mistakes in my text. Why I think that I\'m deserve can enter this school? Because many people always support me and they said that I have good potential. And I try to get good achievement. The quote said that \" Better try than never\" so I try to give all my best to can get my dream. There are 2 probabilities if I success I will get my dream and if I fail I won\'t give up:). But I believe in myself that I can. Many people around me always give me a support even though it just a small thing but it so worth for me and always said to me \"Keep spirit and fight those all demons that make you in bad condition\". It will be my pride if I can reach my dream. Okay I think enough for my description and intermezzo. I\'m so sorry if I\'m bad at my English, I hope I can learn English well than before. Thanks.\r\n            '),
('marsilah28@gmail.com', '             I want to introduce abaout myself, my name is Marsilah, my nick name is sila, I was born in Muara Lintang Lama, october 28th 2002, I’m the youngest of 2 siblings, I Live in Muara Lintang Lama,  I’m 15 years old, now I sit in Junior high school no. 1 Pendopo Barat.  I have some achievement got first rank in first semester to fourth semester, in fifth semseter I got rank 3. I have followed olympiad of science Math year of 2016/2017.  In the SMPN 1 Pendopo Barat I have be a membern of KKR (Kader Kesehatan Remaja), I also followed Extracurricular of science math and scout, I also be a member of OSIS SMPN 1 Pendopo Barat 2106/2017.\r\n	In my family, I have a father, his name is Kaspari, he was born in Muara Lintang lama, may 5, 1962.  He is 55 years old. My father work as farmer and guard of mosque of Nurul Iman Muara Lintang lama, from his accupations, he got salaries Rp. 500.000/month, from his salary he can pay our daily needs and for my eat snack in school. My mother is Warti Harbeta, my mother was born in muara Lintang lama, November,12 1973. She is 44 years old, She is a farmer, I also have a brother his name is Nopriansyah, he is 20 years old, now he studied at UNIB Bengkulu city for sixth semester, he needs cost for one semester is Rp. 1.650.000. \r\n	Actually from bottom of my heart, I really want to enter SMAN SUMSEL, because I think this school is very popular in Sumsel and make my skill increase, increase in knowledge, talent, and my hobbies. I think, I have proper to get fellowship to come in SMAN sumsel, as I know this school is very have best qualities and I have achievement to be a students of SMAN Sumsel. I’m Proper to be a students of SMAN sumsel because my family have less economic so I want change our destiny, I want to make proud of my families because I want to be success in future.\r\n	When I was in the elementary school, I want to be a Doctor because a doctor is good job, a doctor can help people sick and got