('maulidinasc@gmail.com', '- Myself and Family\r\n     My name is Maulidina Suci Paramitha and i am called by Suci name. My father\'s name is Muhammad Mulyadi and my mother\'s name is Ratna Ningsih. I have an older brother, he\'s named Meco Randi Nugroho. My father worked privately while my mother worked to take care of our house. My brother is a student in SMAN 22 Palembang who is now the twelfth grade, and  he will continue his studies at the university. And i am currently studying at SMPN 54 Palembang. And i live  in Sultan Hasanuddin street no.2554 rt.38 / rw.11 kelurahan Karya Baru kecamatan Alang Alang Lebar.\r\n\r\n-Why I Deserve to be Student of SMAN Sumatera Selatan\r\n    In my opinion, i deserve to be a student of SMAN Sumatera Selatan because SMAN Sumatera Selatan i have expected from seventh grade, so i want to go to school in SMAN Sumatera Selatan. And in SMPN 54 Palembang, i got 1st and 2nd rank in the class and i once got the overall champion. I come from a poor family. And in my opinion, this has fulfilled some requirement to become student of SMAN Sumatera Selatan.\r\n\r\n-My Leadership Ambition in the Future\r\n    In my opinion, my leadership ambition in the future is i will give science, that i have obtained from school with sincerity. Because my goal is to be a lecturer. In my opinion, my benefits to be a lecturer, that i can boast of parents and family, i can share my knowledge to others with sincerity and without expecting anything. And this i have done, like teaching my friends if having difficulty in doing the task. And i hope, i can be accepted as a student in SMAN Sumatera Selatan in order to boast my parents.\r\n                              '),
('maysara650@gmail.com', '                              My full name is Aisyah Hasanah. My nick name is Ica. I was born in Baturaja ,august 22th 2003.I am student in Junior High School Number 1 oku. I live at Jl. Rajawali III, Kel Sekar Jaya, Baturaja. My Hobby is dancing. I’ve been winner 2nd dance competion. My ambition is director.\r\nI live with my big family, father, mother, grand mother, sister and brothers. My Father is a traders. My Mother is a teacher. I have 3 siblings. I am third. My sister a student in Health Polytechnic Palembang. My oldest brother is a student in senior high school number 4 oku.He will go to collage this year. My youngest brother is a student  in elementry school number 8 oku. 	\r\nMy family economy is difficult. This is a reason why i want to school in SMAN Sumsel. I will help my parents financially. I hope can be accepted in this school because i have a great ambition. My ambition as a director and  my ambition  in the future , I will have great company .I believe, this school will help me to become a stepping stone to make my dream come true as a real director.\r\n');
