('megang.alviraputri@gmail.com', '                        Assalamualaikum Wr.Wb\r\n\r\n        Hello ! My name is MEGAN ALVIRA PUTRI.I was born in Pekan Baru on May 1 2003.I live in Talang  Ubi Kel.Talang Ubi,Kec.Megang sakti,Musi Rawas regency.My religion is moslem.I am the first daughters in my family.My sister is 5 age.Her name is ANISA QAYLA RENATA.My father’s name is BAMBANG TULODO,he is a farmer.My mother’s name is SUDARTI.She is a house wife.\r\n        My hobby is reading.I love book very much.I often use my time to reading book in library.I’m very happy if I have spare time to reading.From reading I get many knowledge and information.My friends say that I can to change my voice.They are say that my voice is very funny if imitate the other voice.For example,duck,and the other cartoon figure.\r\n       I am student of SMP N MEGANG SAKTI in IX.1 class.In the school I’m join in scout extraculicular.In scout I ever to join in scout contest.That is LT3.And Alhamdulillah my team get the first winner.Then,we are become Musi Rawas representative to join in LT4 Palembang,Sumatera Selatan.I also ever become participant of Mathmatic Cerdas Cermat Competetion.I accept in grandfinal,but I’m not in final.\r\n      Now I register in SMAN SUMATERA SELATAN.I have ambition.If I deserve to be student at SMAN SUMATERA SELATAN,I will show my abilities in academic although nonacademic in scout.I will join in scout of SMAN SUMATERA SELATAN and to lean on Trisatya and Dasa Dharma.I will make SMAN SUMA TERA SELATAN proud and not regret to accept me.\r\n     I also has ambition in the future.I will make my parent proud to me and become a success woman.\r\n          Thanks !\r\n         Wassalamualaikum Wr.Wb\r\n         '),
('melatialmukaroma@gmail.com', 'I would like to introduce myself, my name is Melati Almukaroma. My friends and my family usually call me Melati or Imel. I was born in Pangkalan March 5th 2003. I am from Junior High School B.Srikaton. I live in A.Widodo with my parents, my sister, and my brother. My parents’s name is Botohham (my father) and Suryati (my mother). My sister’s name is Anken Cakraborti and my brother’s name is Kaisar Rizki. I am the second child of 3 siblings. My father works as a farmer and my mother work as a housewife.\r\nI have a hobby, that is playing badminton, although I am less able to play badminton but I am very happy when I play it. My favorite subject is mathematic so when my school believed me to join the mathematic olimpiads I am so happy, although in the end I did not win. Other than that I also ever join the mathematical intelligent contest and I made it into the big 9th semi final although not yet made it into the final round.\r\nI get information about Sempurna senior high School from my school. I want to get into this school because the school is free of charge. So, I thik I can reduce my parents burden. Other than that I want to get into this Sempurna school because I think this school is good school. Actually I am less fluent in english, because I hear that in this school only uses two language that are Indonesian and English I will try to improve it. I believe I can do it and I hope i can be better and  if i get into this school I want to make Sempurna school be better. And the first reasons why I want to get into this school  because I want to make my parents proud of me. I feel i never make my parents proud of me because if I join a contest I never be a champion so, I think if I get into this school my parents will proud of me. In the future, I want to be a accounting. I hope I can get into Sempurna school.\r\n                              '),
('melly.ulandari022@gmail.com', 'My name is Meli ulandari. I am 14 years old. I am the second children of Mr. Ahmad paku alam and Mrs. Halimah. I have a sibling named Sari Paramita.sp. I have a hobby, my hobby is swimming. My ambition is doctor. I have a big dream but my family have obstacle about expence. I think when i have done to join with Senior high school Sampoerna i can study without think about the expense that burdened my parents.\r\nOne of my big dream is free treatment for all of people who haven’t enough money, when I will be specialist doctor I will make it true\r\nI want to collaborate with government and companies of the world so that add the donation to help the others people who has disease.\r\nThe last, my inspiration to join with SHS Sampoerna to improve my family economy’s and to make my parents and someones who think it is impossible proud of that I got.\r\n'),
('merlinbkra@gmail.com', '      My name is Merlin Herlidya Bakara,I am from Dusun II Desa Talang Bulang , Penukal Abab Lematang Ilir.I am was born in Talang Bulang 31st May 2003,So my age now is 14th year ago.I am Have three sister is Two Sister They are Twins,her name is Magda Bakara and Masda Bakara,and one brother his name is Morgan Bakara,Yes that right We are family from Batakness.My ambition is Doctor why ? because I want to help everyone,im look the Second of God:),Sometimes in my spare time I like to drawing,Swimming and cycling.Since I am 6th year I am live in Medan Sumatera Utara,With my grandma and my grandpa from my father parent,In there I am always go to school every day except sunday used Taxy,If Sunday iam with my friend my family always go to church for praying to Lord Jesus:),When Iam.12ndyea old  I am moving to Palembang Sumatera Selatan,Why ? My parent workinginhere is be operator.I am Every day going to school in here used foot,if 06.20 clock I am have go from House to school,yes I do every day.\r\nI am look rather fat but not fat because my weight is 50 kg and my Height is 150 cm,my hair is rather streigh and my skin blacksweet,and my blood is O.My father is Marlon Bakara,He was born in Parapat Danau Toba 29th January 1971,His age now is 47th years ago,in here his Working Is Operator,He get salery every month is 2.000.000 and my mother is Wiji astuti,her working is House Wife,Thnk you                    '),
