('muhamadarsyah@gmail.com', '   MY NAME IS MUHAMAD ARSYAH. MY FAMILY, NEIGHBOUR, AND FRIENDS CALLING ME ARSYAH. I LIVE IN SEKAYU WITH MY FAMILY, MUARA TELADAN STREET. I WAS BORN IN SEKAYU, SEPTEMBER 13 2003. I\'M 14 YEARS OLD. MY FATHER NAME IS AMIR HAMZAH,HE IS 37 YEARS OLD, HE WORK IN DKPPLJ/DPPPA. MY MOTHER NAME IS SYAM SIDAR, SHE IS 36 YEARS OLD, SHE IS HOUSE WIFE.I HAVE 3 SISTER AND NO BROTHER, THE FIRST SISTER IS SARI OKTARINA, SHE IS 17 YEARS OLD, THE SECOND SISTER IS TRI YUNIARSIH, SHE IS 12 YEARS OLD, AND THE LAST SISTER IS ADILA NISA, SHE IS 2 YEARS OLD. I\'M COME FROM JUNIOR HIGH  SCHOOL NUMBER 6 SEKAYU. I HAVE MANY FRIENDS IN MY SCHOOL, WE LIKE PLAY SOCCER AND BASKETBALL IN OUR SCHOOL. I EVER WON SOME CHAMPIONSHIP, THE CAMPIONSHIP IS \"BTA FUTSAL COMPETITION\", \"SMARA FUTSAL COMPETITION\", \"SMEKTRIS CUP\", AND \"SPENZA BASKETBALL COMPETITION\". NOW I\'M JOIN A ORGANIZATION, THE ORGANIZATION IS INDOBARCA MUBA AS MEMBER.\r\n   I DESERVE TO BE A SENIOR HIGH SCHOOL SOUTH SUMATERA STUDENT, BECAUSE I FEEL THAT I AM A PART OF A LESS FAMILY ABLE. I BELIEVE THAT I HAVE A LEADERSIP SOUL, BECAUSE I EVER LEAD AN ORGANIZATION. I ALWAYS PRAY TO ALLAH THAT I CAN PASS IN SENIOR HIGH SCHOOL SOUTH SUMATERA. I REALLY WANT TO BE A SENIOR HIGH SCHOOL SOUTH SUMATERA STUDENT, BECAUSE WITH THIS I CAN REDUCE THE DEPENDENTS OF MY PARENTS, BECAUSE MY PARENTS HAVE TO FINANCE THREE OF MY SISTER ALSO.\r\n   MY AMBITION IN THE FUTURE IS AS AN BUSINESSMAN, BECAUSE I WANT TO BE A LEADER. FOR ME TO BE AN BUSINESSMAN THE HAVE TO TAKE RISK, AND SHOULD BE ABLE TO WORK WITH OTHERS, MAYBE WITH ME STUDYING IN SENIOR HIGH SCHOOL SOUTH SUMATERA, I CAN LEARN ABOUT COOPERATING WITH OTHERS, AND WITH THAT I BECOME BUSINESSMAN IN THE FUTURE.                           '),
