('muhamadlintangpratama000@gmail.com', '    MY NAME IS MUHAMAD LINTANG PRATAMA,MY FRIEND CALL ME LINTANG.I WAS BORN ON DECEMBER 7,2002 IN A VILLAGE LOCATED IN ONE OF THE DISTRICT,SUBDISTRICT OF LUBUK RAJA AND VILLAGE BATUMARTA 3.I AM THE FIRST CHILD OF 3 SIBLINGS AND NOW LIVING IN BATUMARTA AREA.\r\n      MY FATHER NAME IS DARYANTO.HE WAS BORN DECEMBER 01,1976.HE IS 42 YEARS OLD.HE WORKS AS AN SOLDIER.MY MOTHER NAME IS SUTINI.SHE WAS BORN MARCH 5,1980.\r\n      I HAVE ONE SISTER AND ONE LITTLE BROTHER.MY SISTER NAME IS SHERLY DWI ALVIRA.SHE WAS BORN SEPTEMBER 9,2009.AND MY LITTLE BROTHER NAME IS MUHAMMAD TRI ALVARIZI.HE WAS BORN JUNE 11,2011.\r\n     I HAVE HOBBY IN THE FIELD OF SPORT AS VOLLY BALL AND BADMINTON.\r\n\r\n    I WANT TO SCHOOL IN SMAN SUMSEL BECAUSE I CAN COMPETE AND I AM FROM THE MIDDLE FAMILY.\r\n\r\nI WANT TO BE A SUCCESS PERSON IN THE FUTURE AND BOAST BOTH MY PARENT  AND I WANT TO HELP OTHERS AND HAPPY OTHERS WHO ARE LESS ABLE.IF I SUCCESS SOMEDAY                          '),
