('mutiarahusnul600@gmail.com', '    My name is Mutiara Khusnul Khatimah.I am from Junior High School Number 42 Palembang.\r\nI have 3 brothers and 1 sister.My father is a Gojek Driver and my mother is a house wife.\r\n    The reason why I want to be SMAN Sumatera Selatan student are I want to alleviate my parents\' burden and get the best in my education.I have some achievements,such as I have ever entered Smart Meticulous Competition and became the first champion.I also became general champion in my school since I was grade 7 until grade 9.In grade 8,I have ever became the first champion in Murid 5 Acting Competition.In 2016/2017 I served as The Chairman of Student Council Junior High School Number 42 Palembang.\r\n    In the future,my ambition is to get medical scholarship and become a surgeon.Because I want to help people in need sincerely,as well as to construct a hospital whics is free for people who are poor.Besides,I come from underprivileged familiy that I know how expensive medical cost for us.Because of this I want to makes my dream come.That is all about me,thank you.                              '),
('nabilaanggun13@yahoo.com', 'I\'m Nabila anggun al husna . I was born on july 13 th 2003 the second of three children , I live with my parents . My father is an online drive , my mother is a house wife . My brother lectures while an online drive and my sister is 5 grade . I want to lighten the burden of parents by following this selection . Now sma or smk cost a lot , while my father\'s salary is uncertain and my sister still needs school frees . This situation will be difficult for my parents to full fil of our necessity . The only way I can do is to go to school to get a scholarship.\r\nI was hesistant to continue this registration heard that students must english actively while my english is still Imperfect . But when saw my father hard bones work, I am determined to try . I belive Allah swt will help me , with I learn english earnst I hope I am more master of english and within lesson I like mathematic.\r\nI dream of being one of useful people for this country , can help most people Indonesia and economy to have a better life and no more dropping out of school or difficulty in counting school like me'),
('nabilahnandini21@gmail.com', '                              Assalamualaikum wr.wb\r\n        Let me introduce myself, my name is Nabilah Nandini, Nadin is my nickname, i am 15 years old, i was born on 21 November 2002, i am student in SMPN B.Srikaton, i am 1 rank in my class, my favorite class 93 at SMPN B.Srikaton. My school is favorite junior in MUSI RAWAS and has been accredited A, the way of learning and teaching is also very good and easy to be understand, the teachers are very firm and friendly,  we also have achieved some achievements in certain fields, i haved followed the organisation of scout once, 9 grade i did not follow the scout again because my schedule is getting crowded and i have to prepare for UNBK.\r\n         Before i graduate, i\'m still confused to choose a senior high school. I do not want to have a trouble with my parents if i attend school here and have to pay tution every month, not to mention my allowance. And it turns out that at my school there is a registration to enter SMAN SUMSEL where the school is a smart child and from the underpriviliged families can be given the opportunity to go to the school, and also the facilities are guaranted, his disciples are very disciplined and high achievers, after hearing it of course i eager to enroll and attend school there, hopefully i can be accepted into SMAN SUMSEL who i really crave. \r\n       Wassalamualaikum wr.wb'),
('nabila_wahyu2003@yahoo.com', '             INTRODUCE MY SELF AND MY FAMILY. MY NAME IS WAHYU NABILA. PEOPLE USUALLY CALL ME WAHYU. I WAS BORN IN KARANG ANYAR  VILLAGE ON 10 JUNE 2003. I LIVE IN KARANG ANYAR VILLAGE. MY HOOBY IS PLAYING FOOTBALL AND READING NOVELS. I LIKE TO EAT MEATBALLS. I’M THE SECOND CHILD OF FOUR SIBLINGS. I HAVE ONE BROTHER AND TWO SISTERS. NEXT INTRODUCE MY PARENTS. MY FATHER’S  NAME KHOIRUL AMIN. HE WORKS  AS A FARMER. HE WAS BORN IN BUMI AYU ON 19 SEPTEMBER 1973. MY MOTHER’S NAME ERNA WATI. SHE IS A HOUSEWIFE. SHE WAS BORN IN KARANG ANYAR ON 14 NOVEMBER 1973.\r\nI DESERVE TO BE A STUDENT OF SENIOR HIGH SCHOOL SOUTH SUMATERA BECAUSE I’M ONE OF THE POOR FAMILIES AND I WANT TO BOAST BOTH MY PARENTS THAT I’M GO TO SCHOOL IN SENIOR HIGH SCHOOL SOUTH SUMATERA. SO, BY GOING TO SCHOOL IN SENIOR HIGH SCHOOL SOUTH SUMATERA, I CAN ALSO EASE THE EXPENSES OF MY PARENTS AND MY PARENTS CAN PAY CAN PAY FOR OTHER NEEDS. I REALLY WANT TO GO SCHOOL HERE BECAUSE THE SCHOOL IS AN EXCELLENT SCHOOL AND A SCHOOL THAT DOES NOT BURDEN MY PARENTS.\r\nSINCE MY CHILDDHOOD I HAVE THE AMBITION TO BECOME SOLDIER, BECAUSE THE ARMY IS A NOBLE JOB. I LIKE SOLDIERS BECAUSE THEY ARE WILLING TO SACRIFICE THEIR LIVES TO PROTECT INDONESIAN SOCIETY AND PERFORM OTHER TASKS. WHEN I LATER BECOME A SOLDIER THEN I WILL CARRY OUT MY DUTIES IN EARNESTLY AND I WILL ALWAYS KEEP THE SOVEREIGNTY OR PEACE IN INDONESIAN.\r\n                 '),
('nadiaputriramadhoni01@gmail.com', 'HELLO. MY NAME IS NADIA PUTRI RAMADHONI. I AM STUDENT OF JUNIOR HIGH SCHOOL 2 TELUK GELAM. I WAS BORN IN JAKARTA ON OCTOBER 26TH 2003. I LIVE AT MULYAGUNA, OKI REGENCY, SOUTH SUMATRA. I AM FOURTEEN YEARS OLD.MY HOBBY IS READING. MY AMBITION IS SUCCESFUL BUSINESS WOMAN.\r\nI WANT TO TELL YOU ABOUT MY FAMILLY.I COME FROM SIMPLE FAMILLY. MY FATHER IS MR. BUDIONO, HE IS FOURTYSIX YEARS OLD. MY FATHER WAS BORN IN TEMANGGUNG ON NOVEMBER 15TH 1972. MY FATHER IS A DRIVER. MY MOTHER IS MR. SUNARTI, SHE IS THIRTYNINE YEARS OLD, SHE WAS BORN IN LAMPUNG ON MEI 5TH 1979, SHE IS A HOUSE WIFE. I HAVE ONE SISTER, SHE IS ELVA MONICA, SHE IS SIX YEARS OLD, SHE WAS BORN AT MULYAGUNA ON AUGUST 12TH 2011, SHE IS A STUDENT. MY PARENTS IS MY HEROES. MY PARENTS HAVE WILLING TO WORK ONESELF FOR FILLING MY FAMILLY NEEDING.\r\nNEXT, I WANT TO TELL YOU ABOUT MY DAILY ACTIVITIES. AFTER SCHOOL, HELPING MY MOMY HOUSEHOLD.\r\nIN OFTEN SIDE I LIKE SCHOOL EXTRAKULIKULER, SUCH AS, INDONESIAN GIRL SCOUT, ADDESLENT RED CROSS, SPORTY. I HAVE EVEN GOTTEN AS A WINNER IN SPORT.\r\nIN HERE I WANT TO TELL YOU ABOUT MY AMBITION. WHY I WANT TO BE A SUCCESFUL BUSSINES WOMAN? BECAUSE I WANT TO MAKE SOME JOB FOR UNEPLOYMENT. I WANT TO CONTINUE MY STUDY UNTIL UNIVERSITY. BECAUSE I WANT TO BE A SUCCES PEOPLE. THANK YOU.'),
('nandapratiwi.bgst@gmail.com', 'MY NAME IS ANANDA PRATIWI BAGUS SETIAWAN. I AM CHILD OF THREE SIBLING, I HAVE A BROTHER WHO GOES TO HIGH SCHOOL AND A YOUNGER SISTER WHO STILL IN ELEMENTARY SCHOOL. MY FATHER\'S NAME IS SAYUTI AND MY MOTHER\'S NAME IS AGUSTINI. MY FATHER\'S JOB IS EMPLOYEE WORKSHOP AND MY MOTHER IS A HOUSEWIFE. I LIVE IN THE STREET CANDI WALANG HALLWAY KEBON PALEMBANG. MY DAILY ACTIVITIES IS SCHOOL IN JUNIOR HIGH SCHOOL 2 PALEMBANG. IN JUNIOR HIGH SCHOOL ALWAYS GET TOP TEN RANKING,I\'VE ALSO BEEN RATED ONE OVERALL CHAMPION.FROM PRIMARY SCHOOL TO HIGH SCHOOL I ALSO OFTEN BECOME A SCHOOL REPRESENTATIVE IN THE RACE. IN ELEMENTARY SCHOOL I HAVE FOLLOWED EXTRACURRICULAR SCOUTS. MY GOAL IS TO BECOME A LEADER,IF I BECOME A LEADER, I WANT TO BE A CRITICAL SUCCES IN THE ORGANIZATION I LEAD. I WANT TO DO MY BEST TO GET THE BEST RESULTS AND ALSO ALWAYS CONCERNED WITH THE DESIRE OF MEMBERS IN MY ORGANIZATION. I WANT TO BE AN INDONESIAN LEADER, BECAUSE I WANT TO MAKE INDONESIAN BECOME MMRE ADVANCED AND PROSPEROUS LIKE THE CONTENT OF THE CONTENT OF THE FOURTH PARAGRAPH OF THE 1945 CONSTITUTION TEKS. BEING AN INDONESIAN LEADER WHO ALWAYS HOLDS THE PRINCIPLE OF DIVERSITY AND CHARACTER.                           '),
