('neshaaulias23@gmail.com', '                              MY NAME IS NESHA AULIA SALSIBILLAH. MY NICKNAME AT HOME IS ECHA. I AM FIRST DAUGHTER FROM THREE SISTERS. I HAVE TWO SISTERS. THE ONE IS 11 YEARS OLD, GRADE 5 AT ELEMENTARY SCHOOL. AND THE OTHER ONE IS 6 YEARS OLD, GRADE 1 ELEMENTARY SCHOOL. NOW, I SCHOOL AT SMP N 6 UNGGUL SEKAYU. I SCHOOL FAR FROM MY PARENTS. I LIVE AT A BOARDING HOUSE. I WAS BORN IN BANYUASIN, 23 APRIL 2003. NOW, I AM 14 YEARS OLD. MY HOBBY IS READING. MY AMBITION IS A AUTHOR AND A SUBDISTRICT. MY PARENTS LIVE IN BETUNG. IN BETUNG, MY PARENTS JUST OPEN A BUSSINESS STORE. INCOME DAY IS NOT NECESSARILY. THE NAME IS ALSO EFFORT, IF BEING SUSTENANCE, ALHAMDULILLAH. IF NOT ALSO ALHAMDULILLAH. ALL MUST BEING THANKFUL. EVERY NIGHT, MY PARENTS AND MY SISTERS ALWAYS COME BACK TO HOME. THAT\'S NOT MY PARENT\'S HOME ANYMORE. IT\'S MY GRANDMOTHER\'S HOME. MY MOTHER IS A HOUSE WIFE.\r\n                             I DESERVE TO BE STUDENT OF SMAN SUMATERA SELATAN BECAUSE WITH MY LIMITATION OF MY FAMILY, I MUST BE ABLE TO REALIZE THEIR DREAMS BY SEEING ME SUCCESS. I WANT TO BOAST OF MY FAMILY INCLUDING MY PARENTS. I WANT TO SEE MY PARENTS HAPPY. AND BECAUSE SMAN SUMATERA SELATAN IS THE SCHOOL THAT I DREAMED OF SINCE THE THIRD GRADE AT ELEMENTARY SCHOOL. EVERYTIME I REMEMBER SMAN SUMATERA SELATAN I ALWAYS CRY, I PRAY THAT I CAN PASS IN SMAN SUMATERA SELATAN. I WANT TO MAKE MY FAMILY HAPPY. MY FAMILY ALWAYS GIVE SUPPORT AND PRAY THAT I CAN PASS IN SMAN SUMATERA SELATAN. THEREFORE, I DON\'T WANT TO DISSAPOINT MY FAMILY ESPECIALLY MY PARENTS. I WILL KEEP TRYING TO PASS IN SMAN SUMATERA SELATAN. I WILL STUDY HARD TO MAKE MY DREAMS COME TRUE.\r\n                             MY LEADERSHIP AMBITION IN THE FUTURE IS I WANT TO BE AN AUTHOR. I HAVE AMBITION TO BE AN AUTHOR SINCE ELEMENTARY SCHOOL. IF I TO BE AUTHOR, I WILL BUILD MY OWN LIBRARY. I WANT BE LIKE ASMA NADIA. I WILL SEND MY BOOK TO THE FAMOUS BOOKSTORE. I WILL SHARE MY BOOK TO THE ORPHANAGE AND TO PEOPLE