('ninasaputri@gmail.com', '      	Assalamualaikum wr. wb.\r\n	Allow me to introduce my self, my name is Nina Saputri. My friends, usually call me Nina. I was born in Tugumulyo, February 6, 2003. I live in Pesantren street, D.Tegalrejo. I study at Junior High School B.Srikaton. I’m the second child of two siblings. I have an older brother. My father works as a driver. And my mother works as a trader and housewife.\r\n	My hobby is singing. I like singing because it is happiness. I want to study at Sumsel Senior High School, because I want to try the new experience and I want to study alone, life independenly far away from my parents. I want to make my parents proud to me.\r\n	At the first time, I’m not sure to pass the test of Sumsel Senior High School. But I have already worked hard and no matter what happens, I don’t feel sad.\r\n	If I pass the test, I will never useless the opportunity. I will make my parents happy and proud of my success.\r\n	I believe that Allah have already given the good plan for me. And supported by my parents, my friends, and many people who close to me, make my spirit is full. Thank you for all your supports.\r\n                  '),
