('nurmellysyah@gmail.com', 'My name is Nur Mellisyah Oktaviani, my nickname is Meli. I was born in Palembang on October 19th, 2003. I’m a student in SMPN 6 Palembang. I have a hobby of reading books as well as I love to take care of animals. I live in a small environment with both parents and one sister. My father was named Pasmawi, he worked as a small trader. My mother named Susi Agustina and she is a working Kerupuk factory. And my sister named Puspa Valensya as a student with the help of Bidikmisi scholarship. My family\'s economic situation is quite difficult, but it doesn’t discourage me to go ahead and achieve my goals. Discipline and honesty that has been taught my parents, make me believe and deserve to be a student in SMAN Sumatera Selatan and I’m ready to compete to become the best student. I want to continue to study, both in academic and non-academic fields. Determination I want to boast both my parents by way of continuing to study and make achievements, so that later I can also help those around me. I also want to be a useful person for others. My dream is to become a teacher so that the knowledge I get now can be shared again, like the discipline and honesty that my parents have taught me. And I also want to be an entrepreneur, so I can open jobs and reduce unemployment.                              '),
('nursantiskameifa@gmail.com', '     First of all I want to introduce myself my name is Desi Ariska Syawalia. I am a student at class 9.2 SMP NEGERI 6 KAYUAGUNG. Since grade 7 i am determined to study hard so that in the future i can achive my goals. My father name is Nuh Iskandar and my mother name is Nurjanah. Im from poor family, realizing that i must be able to compete with other students and i hope to success without burdening my parents. my father job is only motorcycle taxis driver where everyday the income that my father get is not enough for us to eat and school. Sometimes he back home with a little money and sometimes just enough to eat. My mother is only a house wife beside that my mother also has small job which is home tailor and sometimes the effort that my mother done is not balance with the wage. With this condition it didn\'t fade my fighting spirit and still study hard.  So did i see from my old sisters. I am the 3rd child of five siblings. I have 4 sister, my oldest sister name is Meifa Nursantiska, with economic limitations she fought hard ini his education and now lecture in politeknik Negeri Sriwijaya the major is Informatics Management, my second sister name is Dian Ramadhani Padwika she is now in SMAN Sumatera grade 12 and she will graduate soon, my young sister name is Julia Isnarni now she is grade 8 at junior high school number 6 Kayuagung too same like me and my youngest sister name is Naila Pakhira now she is in elementary school grade 3. Me and my family live in my grandparents\' house at LK. IV Celikah Village no.39 RT.12 beside me and my family, my aunt and my uncle with their child also my grand mother stay there also. \r\nIm from junior high school number 6 kayuagung, i am very motivated with my olds sisters. I want to be able to study well as they do. I hope to be accepted in SMAN SUMSEL. im appropriate to become part of SMAN SUMSEL because im motivated person and have big motivation to reach my dream for helping my parent to up my family’s degree, and make me more independent, more get new knowledge, more get new friends and also i will get more experience for studying in SMAN SUMSEL  because as i know where this school is really- really good to prepare indonesian future leader that was my sister said to me. I want to change everything in my life through becoming part of student SMAN SUMSEL school. If im choosen by SMAN SUMSEL school i will study harder than before i will give more my effort and contribution for SMAN SUMSEL School. SMAN SUMSEL gives opportunity to poor students like me to be the best student without cost, but with complete facilities. Only SMAN SUMSEL that can ease the burden of my parents. With my parent incomes less than Rp.1000.000 per month is not enough,  im not sure if my parents will be able to finance my school if i attend regular high school.  If im being choosen by SMAN SUMSEL im ability to join social class in SMAN Sumatera Selatan as a top 3 highest scores National Examination in Sumatera Selatan because I want to be director of a company so i can lead all of my members to be great team then all of my experiences and the knowledge that i get from SMAN SUMSEL i can share it to all of people for better future  Indonesian generation in next 10 years later.\r\n\r\n\r\n\r\n                         '),
('nuryasaputri0412@gmail.com', '   My full name is nurya saputri. Everyone calls me puput. I was born in palembang on December 4th, 2002, so now I am fifteen years old. I have two brothers but i do not have any sisters. I am the youngest daughter in my family. Although I am the youngest but I am independent in my family. I prepare everything I need without burdening my parents or my borthers. I always try to help my mother to do the chores at home. I live in a small but full of love house which is located on Jl. Kadir TKR lorong Terusan Number 430. There, I always start my day with my parents and my two elder brothers My Father is a laborer, his name is Sofian. He is the best father. He always be responsible of everything in my family. My mother is a housewife, her name Suryani. She is the best cook of all . she always serves my favorite dishes. My two elder brothers are Firman and Ardiansyah. Firman, the eldest, is now working as a policeman while Ardiansyah is working as a security at PT.Semen Baturaja. They both are good at taking care of me I really love them all.\r\n    to make my family proud of me , i have always tried my best. How to make them proud is by studying hard. when I was in the first grade, I always got the top three in my class. this achievement took me to continue to the junior high school level without doing the entrance tests. I am not quickly satisfied yet, in junior high school I never stop studying hard to get the first rank in my class. I believe that the result never cheats the process the best student title in my school also goes to me . Not  anly in academic sector in non academic sector, I also became champions in some fashions show contests and Islamic knowledge contest that I took a part. I am so grateful for everthing that Allah has given to me. this year I am the ninth grade student and I really want to continue my education in the best school i have ever known. SMA Negeri Sumatra Selatan is my dream school where i can develop my skills and get meaningful lessons i hope with my efforts that always do, prayers that  I always ask to allah, and achievements that I have always tried to get, I can make my dream comes true which is becoming a student in a prestigious school in the best school in south Sumatra.I Hope by studying in the best school,with the best teachers,meaningful  teaching and learning process, and also great environment, I am able to develop everthing in me more and more. I really want to join after school club there to make more friend, to learn how to be a good leader and of course to strenghten what I have in me. I believe that this school can lead me to reach my ambition in the future. I hope by studying hard in the best school like this, I am able to continue my education in a medical faculty in the best university. There, I will also study hard and be graduated as the best university student of all. Being a doctor is my ambition. it is a cool accupation where I can help many people to cure their disease. I really want to find ways to cure the diseases like cancer and HIV Aids in the future. I believe by becoming SMA Negeri Sumsel students is my other correct steps to chase my dreams.\r\n                              '),
('OKTAVIANI16@YAHOO.COM', '        MY NAME IS OKTAVIANI.I AM THE FIRST OF TWO CHILDREN.I WAS BORN IN PAYARAMAN,OCTOBER 16,2002.WHICH MEAN I AM 15 YEARS OLD NOW.MY FAMILY AND I LIVE IN JALAN DATUK M.AKIB NUMBER 229,PALEMBANG.MY HOBBIES ARE READING AND MEMORIZING.I AM VERY GRATEFUL FOR ALL THAT HAS GIVEN BY GOD,ESPECIALLY FOR THE FAMILY I HAVE.THEY ARE ALWAYS GIVING LOVES AND SUPPORT TO ME.WHEN I WAS A STUDENT OF PRIMARY SCHOOL,I ALMOST ALWAYS GET A RANKING OF ONE,IT IS JUST THAT I EVER GET A RANKING OF TWO.I ALSO HAD A SCOUT ACTIVITY BUT ONLY BRIEFLY BECAUSE THE NEW SCOUT WAS HELD WHEN I WAS IN SIXTH GRADE.\r\nTHE REASON WHY ME DESERVE TO BE STUDENT OF SMAN SUMSEL BECAUSE I WILL TO MAKE THIS SCHOOL TO BE MORE KNOWN THROUGH MY ACHIEVEMENTS,I WANT TO EXPEL ALL THE ABILITIES I HAVE IN THE SCHOOL.SMAN SUMSEL IS ONE OF THE BEST HIGH SCHOOL IN SUMSEL PRIVINCE,CLEANLINESS,DISCIPLINE AND INDEPENDENCEARE ASSURED,HAS A MYRIAD OF ACHIEVEMENTS THAT CONTINUE TO GROW EACH YEAR,ROOM FACILITIES ARE COMPLETE AND ADEQUTE TO SUPPORT TEACHING AND LEARNING ACTIVITIES.QUIET LEARNING ATMOSPHERE,HAS A LOT ACTIVE AND ACHIEVING EXTRACURRICULAR,AND MANY PRODUCE OUTSTANDING STUDENTS AND ALUMNI AND I WANT TO BE A PART OF IT.\r\nI REALLY WANT TO BE AN INDONESIAN LEADER,ESPECIALLY THE LEADERS OF THE RURAL AREAS BECAUSE I WANT TO MAKE INDONESIA AS A DEVELOPED COUNTRY THAT PROSPER IT IS PEOPLE NOT ONLY FROM THE CITY BUT FROM THE VILLAGE.I WANT TO LIFT PEOPLE\'S ECONOMY BY ESTABLISHING HOME-BASED BUSINESS TO CREATE JOB AGANCY,GIVING DIRECTION AND LITTLE CAPITAL FOR THEIR BUSINESS OR PLANTATION IN ORDER TO REDUCE THE NUMBER OF UNEMPLOYED IN INDONESIA,DO THAT INDONESIA WILL NOT BE INCLUDED IN THE CATEGORY OF POOR COUNTRIES AGAIN.PROCESSING PLACES THAT HAVE THE POTENTIAL TO BECOME TOURIST ATTRACTIONS THAT WILL HELP INDONESIA\'S FINANCES EVEN EMPOWERING NAME INDONESIA THAT HAS A UNIQUE CULTURE,AND EDUCATION FOR FREE.\r\nFOR BIG CITIES I ALSO WANT TO DO ALMOST THE SAME THING AS THE COUNTRYSIDE BUT I WILL TRY TO CONTINUE TO BUILD BIG INDUSTRIES THAT REMAIN ENVIRON MENTALLY FRIENDLY,KEEP INCREASING EXPORT,AND MOST IMPORTANT IS STRENGTHEN AND AFFIRM SECURITY AND INDONESIAN LAW.                '),
('okto2002@gmail.com', '                              \r\nMY NAME IS ROSA OKTAVIA RAMADHANI, I HAVE A FATHER WHO WORK AS THE WORK / TRUCK, MOTHER AND MOTHER HAVE A JOB AS A HOUSEHOLD MOTHER. I AM THE FIRST CHILD OF FOUR BROTHERS. MY REASONS LIKE TO SIGN UP SUMSEL SMA BECAUSE I WOULD NOT WANT TO BELIEVE MY PARENTS. MY FATHER IS THE SINGLE CHILD AND HAVING THE CHILDREN THAT IS STILL BASIC SCHOOL.OLEH BECAUSE IT WOULD LIKE TO MAKE THE LOADS UNDESERVED.I WANT TO REMAIN OUR PARENT ORNG.THANK YOU');
