('prahmawati788@gmail.com', '               I want to describe about my self, my family, my purpose school in SMAN Sumsel\r\nand my ambition  in the future\r\n\r\n       My name is PutriRahmawati, my friend usually call me Putri. I was born on 14 august 2003,inLahat. Now I am fourteen years old. I am the first child of two siblings. I live in PrumnasGupi,Pagaralam,Sumatera Selatan. My hobby are adventure and sports especially karate. My religion is Islam,I wearing hijab for a day, I have short hair, a pug nose, chubby cheeks, tan skin, my blood is type B, my weight is 50 kg,and my height is 158 cm. My father name is Romli.HR, his job is wiraswasta. My mother name is YeniWindarti,her job is teracher. And I also have one sister, her name is ZarahDwiRahayu. My sister is fourth grade in elementary school number one of Pagaralam. I am studying in Junior High School number one of Pagaralam. At the school I don’t follow many extracurricular, I just follow karate. At the first I was afraid to fight but after I practice seriously and my high determination alhamdullilah I became brave to fight and I often follow the championship level city/kabupaten, and province. Although I follow karate I never forget my main duty of learning. Besides studying in the school I also tutoring outside school every Friday and Saturday. After school I help my mother clean the house. I am an ordinary person in the eyes of people who don’t know mw, but actually I am a person who likes to be friends, and happy to joke. The reason why I want to school in SMAN Sumsel because I want to study in a high discipline school, I want to make my parent proud, I want to change my personality to be better than before. I want to realize my dream with I will study diligently. Why I deserve to shool in SMAN Sumsel because I have a high determination to achieve my ambition and motivation from my parents I must higher education from my parents. About my ambition I was more interest in the field of accounting and stat