('putrimardalena07@gmail.com', 'My name is Putri Mardalena, and people call me Putri. I was born in Palembang on March 26, 2003 from a father who works as a motorcycle taxi driver and a mother who works as a fritter seller. My 49-year old father’s name is Marwani, and my 47-year-old mother’s name is Hidayati. I am the second child of 3 siblings. My older sister gets a scholarship, and she has been studying at STT-PLN Jakarta. My younger sister is the first grade student at an elementary school in Palembang. I am a student of SMPN 19 Palembang. Since I was a kid, I have liked things related to leadership. Years ago when I was an elementary school student, I was trusted to be a class captain. I even got the same position during junior high school. My goal is to become a judge. I want to prove that what is true is true and what is wrong will never be true because justice is above all regardless of one\'s social status. None can cover the truth, not even a great amount of money. At school I join dance extracurricular, and outside school I also do karate that now I have reached the plain brown belt, and soon I will take the test for black belt. In karate, I managed to get the third champion for individual female beginner category followed by Dojo Kushin Ryu M Karate-Do of Indonesia in South Sumatera level. I am really determined to study at SMAN SUMSEL because I want to show the world that the daughter of a motorcycle taxi driver and fritter seller can obtain great achievement and help many people as intelligence, diligence and discipline cannot be determined only by wealth or power.\r\n '),
