('reffyoktaza@gmail.com', '                              Assamualaikum wr.wb\r\n  My name is Reffy Oktaza, I am the first child of three brothers from Sopian Edi and Wiwin Sulastri.\r\n Why do I deserve High School SOUTH SUMATERA SOUTH?\r\nBecause I want to go there and also I have a good achievement, in accordance with the vision and mission SMA SOUTH SUMATERA SOUTH is ready to compete both outside and inside, in the current era of globalization. I have English language skills and now deepen the German language, In organizing I joined OSIS and Scouting. My hobbies are playing volleyball and basketball.\r\n    I want to be a doctor, I know doctors in Indonesia is still a lot of poor people and the ability to handle patients, a lot of incidents that resulted in error medical team, here I am as a younger generation to improve it all and do good to people many, but what if I do not go to SMA SOUTH SUMATERA SOUTH, I know the graduates there are spreading the best graduates and ready to compete and a lot of great people out of there and I want to prove it all. May I graduate high school SOUTH SUMATERA SOUTH.\r\n\r\n Thus my eligibility and aspirations entered SMA SOUTH SUMATERA SOUTH, thank you, if there is a mistake I ask for reproof and sorry to Allah swt, I beg pardon.\r\n\r\n Wassalamu alaikum warahmatullahi wabarakatuh\r\n'),
