('rhamasucijasa@gmail.com', 'Story about me :\r\n\r\n          Hy! My name is Rhamasuci Putri Jasa. I am a student of Junior High School Number 15 Palembang, grade nine (IX). I was born in Palembang, 25Th October 2003. I have two siblings, One woman and one man. Their name are Afanda Putri Dwijasa and Aqsa Putra Trijasa. \"Jasa\" was taken from my Father and my Mother\'s name. My sister is still Junior High School, grade seven (VII) and my brother is a student of Playgroup.\r\n          Ok, now! I want to tell about my Parents. My Parents are very kind to their children, they educate us with affection. My Father name is Jailani and my Mother name is Masayu Marleni. My Father works in PT. Lingga Djaja as a day laborer and my Mother does not work because she must taking care of household.\r\n          I think I deserve to be a student of Senior High School South Sumatera because I ever to be the first general champion in my school. I really hope to be a student of that school. If I can to be a student of that school, I will studyhard to reach my dreams and I want make my Family, especially my Father and my Mother proud of me. On future, I want to be a success woman.\r\n          Now, I want to tell about my ambition. Since a long time ago, I want to be a Prosectur or a populer Lawyer because this job is very interesting in my opinion. Why I told this job is very interesting? because they help many people. If I am a lawyer on future, I will defend the truth.\r\nOkay! I think it\'s enough. Thank you!\r\n'),
