('rikhofn@gmail.com', '                              MY NAME IS RIKHO FEBRIAN NURMANSYAH.I HAS ONE BROTHER AND SISTER.MY HOBBY IS READING AND SING.MY AMBITION IS POLICE.I LIFE IN SEKAYU,MUSI BANYUASIN.I WAS BROWN IN SEKAYU 10 FEBRUARY 2003.NOW,I 14 YEARS OLD.I SCHOOL IN SMP N 6 UNGGUL SEKAYU.MY FATHER NAME IS FIRMANSYAH.AND MY MOTHER NAME IS NURLELA. MYBROTHER NAME IS RIZKI PUTERA NURMANSYAH. MY SISTER NAME IS RIZKA PUTERI NURMANSYAH.\r\nI THINK I CANT JOIN IN SMAN SUMSEL BECAUSE I KNOW I CANT TO BE BETTER WITH SCHOOL IN THERE.I HAVE A GOOD THINK AND A GOOD CHARACTER.I NOT PERFECT BUT I CAN DO THE BEST.I HOPE,WITH SCHOOL IN THERE I CAN MAKE A SOLUTION FOR MY PARENTS AND MY FUTURE BECAUSE MY PARENTS RETIRING SOON.I WANT SEE MY PARENTS IS HAPPY.I WANT MY FAMILY SMILE LOOK ME IN THERE.I THINK IF I SCHOOL IN THERE I CAN FOUND A GOOD FRIENDS AND I CAN BE GOLDEN.\r\nI WANT TO BE A POLICE.I WILL TO BE EXAMPLE FOR MANY PEOPLE.I WILL THOUGHT MANY PEOPLE FOR DO THE BEST WITH ISLAMIC PROVISIONS.I WANT EVERYTHING WILL TO BE BETTER BECAUME ME.TRY AND MAKE MANY FRIENDS TO BE BETTER.IF I ACCEPTED IN SMAN SUMSEL.I WILL STUDY HARD.I WANT INDEPENDENT LIFE.I WILL WORK TO BE A USEFUL PERSON.IF I SUCCES BECAUSE SCHOOL IN SMAN SUMSEL.I WILL BRING AND BOAST THE NAME OF THE SCHOOL.I WANT TO SET IT UP MY PARENTS FOR HAJJ.I WILL INVITE THE NEXT GENERATION TO BE A GOOD GENERATION AND ONE STEP AHEAD.I WANT TO CHANGE THE ECONOMY STATE MY FAMILY.\r\n'),
('rikicandrasaputra99@gmail.com', '      My name is Riki Candra Saputra, I live in Senuro village. I am the first child of a Muslim couple and Jeni Rupika. I have a younger sister named Nur Aliyatul Fahima. I am a school at SMPN 01 Tanjung Batu. In addition to my school I attended the mosque. In addition, I also follow the activities of badminton and soccer.\r\n\r\nMy goal to get into SMAN SUMSEL is to make my parents happy.'),
('rimaanadia3@gmail.com', '          Artikel Rima Anadia\r\n	First, I want to introduce my self. My name is Rima anadia, I was born on 30th of march 2003. I have two brothers, and I am the youngest. I live in campang tiga village, cempaka, east OKU, south Sumatera. My hobby is reading novel, because of that I want to be a writer. I am 148 cm tall and 35 kg weight.\r\n	I study at SMPN 1 CEMPAKA, since the seventh grade I got the first rank, until the ninth grade. I joined the poetry competition when we celebrated kartini’s day, I got the first rank, and also join in dancing competition in junior high school level, we got the fourth rank. I can dance but not so good in dancing.\r\n	I am from family (kurang mampu). My father’s name is Tamrin and my mother’s name is Nurhuda. They are fifty two years old. My father is a farmer, and my mother is a housewife. they live in campang tiga too. If  harvest had be over, my father searched the plus job. We don’t have a house, but we live in grandparents’ house, that it had renovated by my uncle and aunt. That is story of my family’s life.\r\n	I have dream so big to school in SMAN SUMATERA SELATAN. I want to take knowledge there. I am sure SMAN SUMATERA SELATAN is senior high school level most favorite in Sumatera selatan, and I am sure studying in SMAN SUMATERA SELATAN, it can make me as a independent person. I want to get the best experience, and make my parent are proud of me.\r\n\r\n                    '),
('riolinggarjati@gmail.com', 'My full name is Rio Linggar Jati commonly called Rio born in Umo Jati Village on December 31, 2003 sex Male, Religion of Islam, status in family of Children of Kandung. I am the son of three of four siblings, the first brother named Rego Lisantro, the second brother named Reyco Marantika, the sister named Rangga Wiranata I aspire to become a doctor, I live with my parents, brother and sister in Umo Jati Lintang Kanan Empat Lawang Village. My father Iduar and my mother Lismawati, my father was born in Umo Jati Village on 05 April 1972 and my mother was born in Umo Jati Village on 07 September 1970 and my parents work as Farmer. Grandfather from Dad named Dali and Grandmother Hamisa, Grandfather from Mother named M. Ropa and Nurjia\'s Grandmother. The purpose and the reason I went to South Sumatera SMAN is to increase the knowledge and also want to add my learning insight, because my interest to the achievements that have been achieved by SMAN South Sumatra during this time, and most important is to help alleviate the burden of parents I am because of my parents from a family who can not afford.'),
('rivaldo@gmail.com', '                MY NAME IS M.UNTUNG RIVALDO, AT SCHOOL MY FRIEDS ALWAYS CALL ME UNTUNG. I WAS BORN IN SEKAYU, 05 APRIL 2003. SO, I AM 14 YEARS OLD. I LIVE IN SEKAYU, KOLONEL WAHID UDIN STREET. I COME FROM JUNIOR HIGH SCHOOL NUMBER 6 SEKAYU. I AM AN ONLY CHILD IN MY FAMILY. MY FATHER NAME IS PAKARUDIN, HE IS 46 YEARS OLD, HE WORK IN JHS 11 SUNGAI KERUH AS SCHOOL GUARD. MY MOTHER NAME IS NURBAITI, SHE IS 49 YEARS OLD, SHE WORK IN ELEMANTRY SCHOOLS 1 RANTAU SIALANG AS TEACHER. I HAVE MANY FRIENS IN MY SCHOOL OR OUTSIDE SCHOOL. IN MY SCHOOL I LIKE PLAY SOCCER AND BASKETBALL WITH MY FRIENDS. I’VE WON THE FUTSAL CHAMPIONSHIP, THE CHAMPIONSHIP IS BTA FUTSAL COMPETITION, AND SMARA FUTSAL COMPETITION. I WAS ACTIVE IN OSIS, AND NOW, I ACTIVE IN INDOBARCA MUBA, AS AN ORGANIZATION MEMBER.\r\n               I DESERVE TO BE A SENIOR HIGH SCHOOL SOUTH SUMATRA STUDENT, BECAUSE I FEEL THAT I AM A PART OF A LESS FAMILY ABLE, AND I FEEL ABOUT ABILITY TO BE A LEADER WHICH COULD BE DEVELOPED IN SMANSUMSEL. I ALSO WANT TO HELP MY FAMILY IN THE ECONOMIC FIELD AND WANT TO CHANGE MY FAMILY SITUATION FOR THE BETTER. IF I CAN BE STUDENT IN SMAN SUMSEL I PROMISE WILLN’T WASTING THIS OPPORTUNITY.\r\n              MY AMBITION IN THE FUTURE IS TO BECOME A PRESIDENT BECAUSE FOR ME PRESIDENT A LEADER IN A COUNTRY. AND TO BECOME A LEADER IS MY DREAM, BECAUSE FOR ME A LEADER IS HAVE A BIG RESPONSIBILITY, AND I BELIEVE I CAN DOING MY RESPONSIBILITY, TO CHANGE THIS COUNTRY CAN BETTER GOOD IN FUTURE. '),
('rizkapargianr@gmail.com', '        My name is RIZKA PARGIAN RAHMADANTI.I was born in Bandung,west java 24 november 2002.I judge my self,i think my character is very good, i like to find friends and not like to find enemies.I want to be a police woman.My hooby is reading a novel. I\'m studying at junior high school number one oku.\r\n         In my family,my father\'s is the head of the family.My father\'s name is SULENDRO.He was born in Grobogan,central java 10 October 1969.My father\'s have a very good character, he is good,humorous,wise,and always keep the promise he made.My father\'s job is laborer in the Bandung city.My mother\'s name is NURLELA.She was born in Baturaja,south sumatra 4 april 1971.My mother\'s have a very good character, she is very kind,loving,and also very understanding.My mother\'s is housewife.The first child of this family,name is RIZKI VARDIANTI.She was born in Tanggerang,west java 8 january 1996.She has a bad character because she\'s a bit grumpy, but i know she\'s very good.She studying in Uiversitas Baturaja.\r\n         Because long ago, my dream is to enter sma favorit.After hear information about sman sumsel, I think now this sma become my goal. Because,in this school I will have opportunity to can the best education, the friends that I will meet here is people who can inspire, and I will be seen as a intellignt and bright future student by the family. With this achievement that I can in this smp.01 oku, I feel it worth to compete for sign in sman sumsel to achieve hope, desire,ideals me and family.              '),
('rizky_akbar2003@yahoo.com', '         My name is Muhammad Rizky Akbar Pradana. I live in Tanjung Kemuning, Belitang II, OKU Timur. I am 15 years old. I was born on April, 15th 2003 in OKU. My hobby is playing volleyball.  I am student of MTs Tanjung Kemuning. In my Madrasah, I always get first rank from seventh grade until ninth grade. I often follow a speech contest. I won it for four times when I am still at MI. And then when I am at MTs I just won it for once. Not only speech contes, but also I follow scout in my Madradah. According to me, scout can form good character of young generation. I also often follow scout contest or scout camp.\r\nMy father’s name is Tohir, S.Pd. He’s a teacher in MTs Mambaul’ulum Margomulyo. He graduates from Sriwijaya University. He’s friendly, but firm. He has a good discipline, and hard worker.\r\nMy mother’s name is Krismiati. She’s a good housewife. She’s very smart but she just graduates from senior high school. Because her parents don’t have cost for her education.\r\nMy Parents always teach me about discipline in study and discipline for time to achive my ambition and to become a usefull person for nation and religion.\r\nI deserve to be accepted in SMAN Sumsel. Because I have a characteristic. I hope it can be develop in this school to be better.My achievement in study and discipline of time that make me feel worthy to be accepted in this school.\r\nIn the future I want to implant an interest in study for new generation.Because an interest in study very less.Therefore I want to apply my knowledge voluntarily.I want to be a teacher that successfully to teach my students to change the future of this country.\r\n\r\n                     '),
('roihanmiqbal124@gmail.com', 'Assalamu\'alaikum Wr.wb\r\nMy Name is Roihan M. Iqbal, my friends call me Roihan. I was born in Lahat, September 28th 2003. I am 14 years old. I am the second child of 2 siblings. My elder sister named Nabila and she is 19 years old now. I am son of couple Muliadi and Nur Mujahidah. I live with my mother and my elder sister, my father has passed away when i am 9 years old. My mother have worked as a honorer teacher of kindgarten in my town.         \r\nI am from JHS 5 lahat. I am student of the best class. My hobbies are playing basketball and reading book.\r\nWhen i was a child until now, i dreamt to be an ambassador of Indonesian to Japan. Before it, i see one of my sister friends lecture in Japan and she is from SMAN Sumatera Selatan. So, i believe i can make my dream come true if i am study in SMAN Sumatera Selatan too. I am promise i will study hard and being a good student so that i can reach my dream and make my family proud to me. Last, i want to be a useful person for other people arround me.\r\nWassalamu\'alaikum Wr.Wb                                                '),
('ronishanadhirah@gmail.com', 'My name is Ronisha Nadhirah. I was born in Baturaja 21 February 2004. I have one brother named Rony Ramadhan and my twin sisters named Ronita Kasih RIskia and Ronida cinta Azisya. My father’s name is Rohimin and my mother’s  name is Yeni Asmarani.\r\nThe reason why I feel worthy to get the scholarship because I am an active student and the value of report cards from 5 semesters that I have followed that is from semester 1-5 is 87,128. However,the value of this report card does not make me proud because I still feel less with the achievements that I have gained. Therefore,I will try more maximal again in studying and become more active again in following the existing organizational and organizational skills to further improve the future achievements. \r\nMy dream  in the future is to become a governor because the governor is a position to lead the implementation of local government based on the policy established with the provincial DPRD.The government also plays a role in fostering,supervising,and coordinating the implementation of district government.\r\n'),
('Rosapitadila13342@gmail.com', '                     My name is Rosa Pita Dila, I have 1 two sisters, and have a brother. And I am the last child, I was born in a village, and I come from a poor family, and I have quite a lot of skills, I think I deserve to be in SMAN Sumsel because I\'m sure that\'s where I can achieve success, my dream to reach the future, and I really want to boast my parents, by following this SMAN Sumsel.         '),
('ruslianasilalahi64@gmail.com', '                     My Name Is Ester Fitria Sari Allagan. I Was Born In Baturaja, July 30, 2003. I\'m 14 Years Old. I\'m The Five Child Of The Five Siblings. My Father\'s Name Is Maris Siallagan. He Is 56 Years Old. He Used Work As An Enterepreneur. My Mother\'s Name Is Rusliana Silalahi. She Is 54 Years Old. She Is A Housewife. My First Sister Is Rini Martina Siallagan. She Is 29 Years Old. She Is A Doctor. My Second Sister Is Irna Prastika Siallagan. She Is A Midwife. My Third Sister Is Damayanti Siallagan. She Is 25 Years Old. She Is A College Student In University Esa Unggul Jakarta. My Fourth Brother Is Berkat Ario Hasiolan Allagan. He Is 21 Years Old. He Has Not Got A Job Yet And Doesn\'t Want To Continue His Education At The University. In My Dream, I Want To Be Doctor. I Want To School In SMAN SUMSEL Because I Want To Help Economic Of My Parents Because They Are Old And SMAN SUMSEL Is Good School For Middle-Aged Childern Like Me. I Feel Worthy Because I Come From A Middle Family And I Also Want To Increase My Ability To Leadership, Public Speaking, Etc.         '),
('sabrinaaa.mela20@gmail.com', '                              I want to describe about my self ,my name is Sabrina Melati you can call me Sabrina,Saberr or Mela .I was born on 20 september 2003 in Pagaralam ,meaning that now I am  14 years, I was the first of 2 siblings ,my sister is all female . My religion is islam. Characteristic of my phiysic are a pug nose, tan skin,eyes that aren’t too big ,chubby cheeks ,have height of approximately 163 cm ,weight 55 kg ,blood type A+ ALHAMDULILLAH I have been wearing veil for a day, I am a student from Junior High School number one in Pagaralam,And I live at simpang padang karet in my grandma house built,  My hobby is writing a story. And I have happy family even though our live simple ,My Father is a motorcycle taxis driver ,My Mother always keeps the small stall that at home ,but every afternoon she teach al Qur’an in a mosque near my grandma house .\r\nWhy I deserve enter at sman sumsel? Because, I come from a poor family , my requirements are completed, I’am ready phisically, mentally and in a lesson and  I am confident,optimistic but not ambitious person.My goals go to SMAN SUMSEL because I want to lighten the burden of parents as wells want to make it proud and also I want to increase my learning experience here because in  SMAN SUMSEL there are 2 curiculum ,i have never learned ,as well I want to hone my skills here . My ideals leardship ,I want to be a buseniss woman who is leading but before that I want to study insyaallah path of scholarship in UGM majoring in management and business ,back to topics I  want to be a restaurant cafe that presents a lot of Indonesian food ,And insyaallah I will be a good bussines woman ,friendly with employes ,and opening tire jobs and insyaallah I will distribute to the family rice capable every Friday .\r\n'),
('safinatunnajah23@gmail.com', 'MY NAME IS SALMA SAFINTUNNAJAH. I ATTENDED IN JUNIOR HIGH SCHOOL 6 KAYUAGUNG. I LIVE IN MULYAGUNA VILLAGE, TELUK GELAM DISTRICT, OKI. I’M THE FIRST CHILD OF TWO SISTERS, MY YOUNGER SISTER NAME IS SYALOMITA FADHILAH, SHE IS STILL 5 YEARS OLD. MY FATHER NAME IS MR.SYAMSU RIZAL AND MY MOTHER NAME IS MRS.SITI MAYSARAH. MY FATHER IS A WIRASWASTA AND MY MOTHER JUST A HOUSEWIFE. MY FATHER OPEN A SHOP THE CONTENTS OF DRINKING WATER AT HOME, ALTHOUGH I WAS NOT SHAME AND REGRET ABOUT MY FATHER WORK, BECAUSE HE WAS LOOKING FOR A LIVING HALAL US ALL.\r\nMANY PEOPLE WHO ASKED ABOUT “WHAT I CAN STILL SCHOOL TO HIGHER EDUCATION”, SOMETIMES TO HEAR IT I WANT TO CRY AND DEVINITELY THAT MAKES MY PARENTS SAD BECAUSE THEIR WORDS. I PROMISE TO TAKE A WILDING WITCH IS DESTROYING MY SPIRIT WITH THE ACHIEVENMEN I WILL ACKNOWLEDGE. I LOVE TO REQUEST TO PERSONAL PEOPLE.\r\nI SCHOOL IN JUNIOR HIGH SCHOOL 6 KAYUAGUNG TO AVOID FROM THE NEGATIVE IMPACT MY FRIENDS AND KNOWING FURTHER ENVIRONMENT OUTSIDE.\r\nDAILY ACTIVITES ME ALWAYS HELPING MY PARENTS IN STORE AFTER RETURN FROM SCHOOL AND READING AL-QURAN IF THERE IS A TIME.I ALWAYS PARCIPATED IN ALL SOTRS OF EXRACULICULAR ACTIVITES AND THAT’S WHEN I HAVE MY PARENTS INSTEAD THEY ENCOURAGE.IN ADDITION TO THAT, I ALSO WAS FACING A NASIONA EXAM PREPARATION AND TETS PREPARATION INTO CERTAINLY PRAY. I ALWAYS ASKING MY PARENTS TO ALWAYS PRAY FOR ME BECAUSE FOR ME THE MAIN PARENTS PRAYER.\r\nACTUALLY MY HOPE IS SIMPLE TO BE THE PROPHET OF PARENTS WITH GET THE WORK IN ACCORDANCE WITH MY CAPABILITIES AND ALWAYS MAKE THEM TO SMILE TO FORGET THE CARE TO CRY.\r\nALL THAT I WILL MAKE FROM SMA SAMPOERNA.                 '),
('Safirazahrani29@gmail.com', '                              My name is Safira Astri Atika Zahrani, people around me just call me Fira. I was born on Palembang, May 29th 2003. Now, I\'m 14 years old. I\'m the first child of two sibilings. My little brother is Elvan, and I\'m a daughter of Aswadi and Tri Mulyani.\r\n\r\nI start my education from Elementary Shool 195 Palembang and get enter in Junior High School 38 Palembang by invitation.  I always get the first rank since on Elementary School, and  i\'m very grateful for that. I interest to art, nature and new-chalengging things. I have great ambition to bring bright future for Indonesia. I think that is the strong point of me.\r\n\r\nThere are still many things I have to learn. I believe that when I continue my education at SMAN Sumsel, I will be able to more open minded, independent and responsible person. To be a leader who always numbered the God as the first, prioritize education quality for every next Indonesian\'s generation. Suffice living facilities, so that the whole people will live insprosperous. And making Indonesia as a modern country without abandoning the original culture.'),
('Safitridesi023@gmail.com', '          Hallo, i want to introduce my self my name is Desy Safitry, I have a big family, my father name is masturi he died at the age 57 years old and my dad has died in 2017, he passed away because of heart disease, my mother name is asiah my mother is currently 56 years old , my mother earned money from the opening of the coffee shop at home, I have two brother and six sister. I am one of the students who excel in school because I always get grade ranked in the class,  I am also active in the organization, and I am one of the member of osis. My goal to get into SMA N SUMSEL is because I want to reduce my mother\'s burden and I have a purpose to improve my life and family in the future. I also aspire to become a prosecutor In order to boast of my family. I hope to be accepted as a student in SMA N SUMSEL.     '),
('salmanoverizal23@gmail.com', 'MY NAME IS SALMA SAFINTUNNAJAH. I ATTENDED IN JUNIOR HIGH SCHOOL 6 KAYUAGUNG. I LIVE IN MULYAGUNA VILLAGE, TELUK GELAM DISTRICT, OKI. I’M THE FIRST CHILD OF TWO SISTERS, MY YOUNGER SISTER NAME IS SYALOMITA FADHILAH, SHE IS STILL 5 YEARS OLD. MY FATHER NAME IS MR.SYAMSU RIZAL AND MY MOTHER NAME IS MRS.SITI MAYSARAH. MY FATHER IS A WIRASWASTA AND MY MOTHER JUST A HOUSEWIFE. MY FATHER OPEN A SHOP THE CONTENTS OF DRINKING WATER AT HOME, ALTHOUGH I WAS NOT SHAME AND REGRET ABOUT MY FATHER WORK, BECAUSE HE WAS LOOKING FOR A LIVING HALAL US ALL.\r\nMANY PEOPLE WHO ASKED ABOUT “WHAT I CAN STILL SCHOOL TO HIGHER EDUCATION”, SOMETIMES TO HEAR IT I WANT TO CRY AND DEVINITELY THAT MAKES MY PARENTS SAD BECAUSE THEIR WORDS. I PROMISE TO TAKE A WILDING WITCH IS DESTROYING MY SPIRIT WITH THE ACHIEVENMEN I WILL ACKNOWLEDGE. I LOVE TO REQUEST TO PERSONAL PEOPLE.\r\nI SCHOOL IN JUNIOR HIGH SCHOOL 6 KAYUAGUNG TO AVOID FROM THE NEGATIVE IMPACT MY FRIENDS AND KNOWING FURTHER ENVIRONMENT OUTSIDE.\r\nDAILY ACTIVITES ME ALWAYS HELPING MY PARENTS IN STORE AFTER RETURN FROM SCHOOL AND READING AL-QURAN IF THERE IS A TIME.I ALWAYS PARCIPATED IN ALL SOTRS OF EXRACULICULAR ACTIVITES AND THAT’S WHEN I HAVE MY PARENTS INSTEAD THEY ENCOURAGE.IN ADDITION TO THAT, I ALSO WAS FACING A NASIONA EXAM PREPARATION AND TETS PREPARATION INTO CERTAINLY PRAY. I ALWAYS ASKING MY PARENTS TO ALWAYS PRAY FOR ME BECAUSE FOR ME THE MAIN PARENTS PRAYER.\r\nACTUALLY MY HOPE IS SIMPLE TO BE THE PROPHET OF PARENTS WITH GET THE WORK IN ACCORDANCE WITH MY CAPABILITIES AND ALWAYS MAKE THEM TO SMILE TO FORGET THE CARE TO CRY.\r\nALL THAT I WILL MAKE FROM SMA SAMPOERNA.'),
('salsa.bila@gmail.com', 'Assalamualaikum.Wr.Wb.\r\nMy name is Salsabila Nur Kamilah. I lived on Pasundan Street, Kalidoni Palembang. I was Studied at Junior High School 29, grade nine. I am fourteen years old. My father is Mr.Sulaiman and my mother is Mrs.Yuyun Kristanti. I was the first child in my family, and i have one little brother. My brother name is Ahmad Habibie Maulidansyah. He was Studied at Primary School 177, grade five. My father worked as an Laborers at the hotel, and my mother worked as an housewife. I aspire to be a Lecturer. The Subjects i really like are Science and English Lessons. My hobby is Singing, Dancing, Acting, and Adventure. I am very motivated to get into South Sumatra High School is because i think this School very nice for Students whose parents work is poor. Mean while that School is also Qualified and International Standard. I think if i get into this School, i will get better Education. I hope to get into this School. THANK\'s for your Attention.\r\nWassalamualaikum.Wr.Wb.'),
('salsaagustin31@yahoo.com', '                              Assalamu’alaikum Wr. Wb\r\n\r\nHello my name is salsa agustin I’m 14 years old,I’m from junior high school number 7 of palembang,I’m child of a couple Syari Zahirin and Erma Kartini , I’m the first child of two siblings, so I have one brother, his name faris alfarizi he’s 8 years old, right now he’s in grade 3 in elementary school number 88 of palembang, my father worked as a laborer and my mother as a housewife.\r\nMy daily activities are school, tutoring and reading Al-Qur’an, in the morning I go to school at 6.15.pm until noon, after school I help mom for a while doing homework, and at 04.00 pm I go tutoring in Budiwijaya, at night I usually read Al-Qur’an.\r\nIn my school I joined Rohis Extracurricular, I often be a guide when reading Al-Qur’an together, I often represent my school in MTQ competition. besides that I am also a memorizer of Al-Qur’an in Chengho Mosque.\r\nMy ambition is a doctor, cause I think be a doctor is a noble job, by being a doctor I hope in the future I can help a lot of people. With my introduction above, I hope to be considered enter and to be a student in SMAN SUMSEL, if I become part of SMAN SUMSEL, I’m sure I will give a good achievement for SMAN SUMSEL. I think It’s enough intruduction from me, and once again I really hope to be a part of SMAN SUMSEL. Thank you\r\n\r\nWassalamu’alaikum Wr.W.b\r\n'),
('salsabila.nur@gmail.com', 'Assalamualaikum.Wr.Wb.\r\nMy name is Salsabila Nur Kamilah. I lived on Pasundan Street, Kalidoni Palembang. I was Studied at Junior High School 29, grade nine. I am fourteen years old. My father is Mr.Sulaiman and my mother is Mrs.Yuyun Kristanti. I was the first child in my family, and i have one little brother. My brother name is Ahmad Habibie Maulidansyah. He was Studied at Primary School 177, grade five. My father worked as an Laborers at the hotel, and my mother worked as an housewife. I aspire to be a Lecturer. The Subjects i really like are Science and English Lessons. My hobby is Singing, Dancing, Acting, and Adventure. I am very motivated to get into South Sumatra High School is because i think this School very nice for Students whose parents work is poor. Mean while that School is also Qualified and International Standard. I think if i get into this School, i will get better Education. I hope to get into this School. THANK\'s for your Attention.\r\nWassalamualaikum.Wr.Wb.\r\n ');
