('salsabilamaharani055@gmail.com', '                                           Description About Myself\r\nMy name is Salsabila Maharani. I was born in Palembang on 23rd of October 2003. I am borned in a happy enough family.\r\n\r\nWhen I was at primary school. I was a diligent and clever person on every subjects. The fact was I was always being on top 3 on every semester. From 1st grader until 6th grader I always got the certificates on every semester. Also I had ever joined English Competition on Palembang, and I was very happy because I could join it although I did not win it.\r\n\r\nAfter I was graduated from elementary school, I continued my education to Islamic Junior High School Number 2 Palembang. There, I also got good achievements on every subjects from the 7th grade till the 9th grade. I was always being on top 3, the facts were that I had certificates of merit every semester. Beside academic achievements I also got nonacademic achievements. It’s in a scout organization. Many  competitions held by scout were joined by me. My friends said that I am an active girl and I’m proud of the pride. But the only problem I faced on my activity in my school that I’m lack of books due to their expensive prices. The solution I did was just I copied the books for supporting my study. \r\n\r\nI am the first person from 3 siblings, my father’s name is Alamsyah. When I was 2 years old my father had no jobs so to fulfill our family needs, he sold cassava chips which he sold it near schools. And after that, my father worked as a motorcycle taxis driver. On that time we did not have a house so we lived on my mother’s sister house for ten years.\r\n\r\nThen my daddy was getting a job as a worker on a company with monthly income, even it was not enough to fulfill our family needs. So that every afternoon after going home from working, my father was still working as a motorcycle taxis driver until now.\r\n\r\nMy mother’s name is Suarni, she does not work but a housewife, and I have 2 brothers, one is at 5th grade of elementary school and another one is at kindergarten. \r\n\r\nI am eager to be a student of Senior High School South Sumatra because I heard that this school will help and support any students with excellent competences (even though she or he is from poor family). I have many dreams to reach, one of them is to make my family be proud with me from my competence in study. And I believe this school will help me.\r\n                              '),
('salsabillanajwaazzahra12@gmail.com', 'my name is salsabilla najwa az zahra. I was born in Lampung city on October 29, 2003. I was a student at smp negeri 1 pagaralam. now I am 9th grade. I have 1 sister and 1 younger brother. I\'m the first child . my brother\'s name is muhammad abdul malik. he went to elementery school number 74 pagaralam. he is class 1. my sister name is fedya zelila azmina, she school at elementery school number  74 pagaralam, she is grade 6. my father\'s name is a Imam mustaqim. my dad\'s job is a civil servant. he is also a teacher in the junior high school number 1 pagaralam. he teaches Islamic religious education lessons. my mother\'s name is devi asti widiyanti. my mother\'s job is a civil servant. my mother also works in RSUD Pagaralam. my mother is a midwife. in my house there is also grandparents. My grandfather\'s name is alimson. my grandfather was an engineer, but now my grandfather is no longer working because he is retired. my grandmother\'s name is erviria. my grandmother is not working, my grandmother is a housewife. I want to go to sman sumsel because I want to actualize my ability to better achievement so that it can be the pride of my family and my achievement ability can be useful for religion, homeland and nation. besides that I want to try to learn independently either in daily life or in the learning process. so I hope in the future I can be a dedicated and mature person in the eyes of family, society and nation. the goal I want to achieve is to be a useful person, success and achievement in leadership in the future                              '),
('Sandykurniadi1010@gmail.com', '     Assalamu alaikum Wr.Wb\r\nGood morning All\r\n               On this occasion, Allow me make an introduction about who I am. My name is Sandy Kurniadi I am the Second of Four children. I was born in Lubuk linggau, 10 ochtober 2003. Currently, my family and I live in desa suka karya kec.STL ulu terawas kab musirawas.\r\n               Speaking of hobby, I have a musical hobby. I can play guitar since 4th Grade and now I accompanying the 4 songs. Because of my love of music, I have a dream to make a band and will share stage with coldplay. Hopefully my dream can come true.\r\nI have 2 siblings who are still in elementary school. My sister’s name is mytha and dafa. As a second child, I have to guide my siblings to grow well. My father works ministry of religion for a that made him too busy, and my mother works in the puskesmas that also made her busy enough to take care of us. So, as the eldest brother, I have to keep them well.\r\nmmm...I guess that’s all Ican say about this introduction. Thank you very much for your attention. I would like to express my gratitude.\r\nI hope this story will be fun\r\n\r\nWasalamualaikum  Wr.Wb\r\n\r\n         '),
('saririzkia00@gmail.com', 'MOTIVATION LETTER\r\n\r\n	My name is Sari Rizkia. I am fourteen years old. I was born and raised in simple family. Since the death of  my father, my mother had to work as a seller. Although the result is small, but enough to meet our daily needs. I have two siblings who are still in school. Of course it costs a lot of for it. However, this not dampen my intention to get the highest education as possible.\r\n	After graduating from Junior High School, I would like to continue my education in SMAN SUMSEL. Because I do not want to burden my mother and I want live more independently. I also have some achievements, such as being a third winner on National Science Olympiad in Social Science field at districts level. And  I often be the second winner of my class. Not only that, I also have expertise in Taekwondo.\r\n	If  I am selected to be accepted in SMAN SUMSEL. I will dedicate myself and give the best for SMAN SUMSEL by actively participating in all activities in this school.\r\n	In future, I aspire to be an entrepreneur. I want to have bussines of my own and hire people who have potential and skill but can not apply their advantages because the lack of employment. So that, I can reducing the unemployment rate.\r\n                              '),
('sariyadi.14feb@gmail.com', '                              I am a student at SMP N5 Gelumbang. I come from a poor family, my father is a farmer and my mother is a housewife. But I have a dream to change my life and change my family life to be better. I want to be a beneficial person for my family, my religion, my nation and my country.\r\nI believe in the promise of Allah with raise the degree of the knowledgeable. So I must to be a knowledgeable with the continuing spirit learning. For that I deserve to be accepted at SMAN SUMSEL.\r\nThank you'),
