('sultanharray@gmail.com', '                              Assalamu\'alaikum Wr.Wb\r\n\r\nLet me introduce my self and my family. My name is Sultan Har Ray, my nickname sultan. I was born in Batam, December 10 2003. I come from Musi Banyuasin. My hobby is reading and Playing VolleyBall. I am 15 Years old. I am one of the student at junior high school number 6 sekayu. I am the first of two childrens. I have father name is Mustadi and mother name is Dewi Sartika. My parents are farmers. I have a sister, my sister name is Thalita Mustika. She is good kid, but sometimes annoy me. Besides that since childhood, i was given a lot of learning about ethic and manners by my parents. so, as the son, i have to keep her well and i\'m very grateful to god because i have this family.\r\n\r\nBecause i have some achievements and have a good learning value. Besides that i come from a family simple so i have to continue my school with full effort so that i can my family\'s economy\r\n\r\nMy ambition in the future is i want to be an entrepreneur because i want to lead a company and i want to help people low to work in my company. Besides that i also want to make my parents happy because i can help other so that my parents are proud me'),
('sultanlulu25@gmail.com', '      DESCRIPTION\r\nI was born on the veranda of mecca 1 year before the great earthquake and tsunami, has devastated Aceh, causing 200 thousand more. Alhamdulillah, I was saved in a parent\'s arms at the time.\r\nMy initial education was obtained from the free school program of the attorney office of ADHIYAKSA 14 Kindergarten, Banda Aceh City, to completion.\r\nFour years later we moved to the city of Padang, and I had school there for about 1 year. And then we moved again to Pagaralam, and continued primary school education SDN-1. And once a Danton Pocil in Pagaralam. at that time we did not have a place to live, grandma who accommodated us all.\r\nAt this time I was still in the 9th grade of SMPN-1 Pagaralam. At school, I joined the martial arts (HIMMSI). Thanks to hard work and passion, until now I have obtained a green belt.\r\nOur lives are in harmony and mutual love and affection, even though our economy is sometimes stagnant, since our parents have no permanent jobs, so the minimum daily needs can be fulfilled.\r\nMy strong desire to get an international high school education, certainly will not be possible to be realized, without any third party who facilitate it. In this case SMAN SUMSEL opened this opportunity, then my desire and determination can be realized, for this I deserve and deserve to get education at SMAN SUMSEL 2018 school year.\r\nExpectations and strong ideals I have planted in my heart, to be a good leader, populist, feel pain, if there are members of the community who are sick, so that harmony in togetherness will be realized. And will also create special programs for students and communities who can not afford to continue their education, so that the entire society that is not able to become a successful and civil society. So the determination will change the Minus to Plus can be achieved should. Amin\r\n                        '),
('tari37675@gmail.com', '                              Hello my name is dwi jaya saputra. I am 15th years old. I am a student in jhs 1 Betung. I am taekwondo athlete. I have been an athlete since 2014. I am red belt now. I am scoutboy. I have been a scoutboy since i was in grade 2. I have followed a lot of scout event. The biggest event i have ever followed was jambore cabang III BANYUASIN 2014. I am a student of advance 2 class in giovani english course. I am in highest class now. I have been course since i was in grade 3. \r\nMy family has 5 personil. My father is a traders in betung. He sell medicines. My mother is a housewife. Sometimes she follows my father to sell medicines in market. i have a brother. His mame is Muhammad Alfarizi. He is studying in brawijaya university. He take english cultural majors. I have a younger sister too. Her name is athira Ramadhana sheva. She is 4years old.\r\nI have been a class leader since i was grade 4. My leaderness ambition in future is: i want to make the fair law in indonesia. '),
('tasyakurniati@gmail.com', '                          My name is Tasya kurniati. I was born on TuesdayDecember 23, 2003. I live in the way of kartini villlage C nawangsasi, I went to SMP NEGERI B. SRIKATON, class ix. 5.\r\nI was the first of three children. My first brother is now a boy in second grade and the last woman who is still a toddler. My family lives in a simple house. It was not the original house of my family , but the house of our great grand mothers relic, so it still looks old- fasioned. My father worked as a farmer working on the rice fields of my grandmother and grandfather. My father worked on the rice fields that are not so vast and earn an uncertain income. My mother is just a housewife who day to day only take care of the younger brother and take care of the house.\r\nI realy hope to get into SMA NEGERI SUMSEL. I want to be able to make both my parent  proud of me with Ican enter in SMA NEGERI SUMSEL which I favourite and that I dream. Besides I can make my family proud of me, I can also offset or reduce the cost that my parents have to spend to countinue my education after I graduate from junior high scool. I also want to make SMA NEGERI SUMSEL mode advanced from the previous year to the next year.\r\n	“Good Luck For Me”\r\n?\r\n\r\n\r\n  '),
('tiarajulmiati@gmail.com', 'My full name Tiara Julmiati is commonly called Tiara was born in Nibung Village on 04 July 2003 sex Female, Religion of Islam, status in family of Children of Kandung. I am the first child of two siblings, my sister named Ahmat Rifalde, I aspire to become a Natural Science Subject Teacher, I live with my parents and my sister in Nibung Lintang Village Right at Four Lawang. My father was Ghupron and my mother Tilawati, my father was born in Nibung Village on August 17, 1975 and Mother was born in Nibung Village on December 25, 1981 and my parents worked as Farmers. Grandfather of Father named Mahrup and Grandmother Maymuna, Grandfather of Mother named Ujang and Grandmother Hosia. The purpose and the reason I went to South Sumatera SMAN is to increase the knowledge and also want to add my learning insight, because my interest to the achievements that have been achieved by SMAN South Sumatra during this time, and most important is to help alleviate the burden of parents I am because of my parents from a family who can not afford.'),
('tinapebrianti2@gmail.com', '             Assalamualaikum\r\nMy name i Tina Pebrianti just call me Tina my age 15 years. I was born on February 2, 2003 my hobbies reading, making up stories, playing soccer and others. Born from a simple family where my father job is a traveling co-worker and motorcycle taxi as his side job name my dad Jhony Papa his 60 years old my father is an old man who embraced two at once as a mother and father because my mother had died last I met mother when I want to go to Junior High School he returned to Baturaja after chemo therapy in Palembang. to braid my hair while I was undergoing orientation  mara, my mother name Susianah she is a religious teacher in SD N 01 OKU. I have a sister named Ancelly aged 17 years old he was still in High School N 1 OKU. I deserve entry in this smansumsel because I am a smart, independent and active, I want to feel more abilities here and learn away from parents. My goal is to be proud of my parents, to be an educated, succesfull person           '),
