('ucikhusnulfadila@gmail.com', '                           My Name Is Uci Khusnul Fadila. I Was Born In Batumarta, January 01, 2004. I\'m 14 Years Old. I\'m School At Smp N 3 Oku Class 9a. I Live In Pasar Gotong Royong Batumarta 2. My Dream Is Midwife. My Hobby Is Reading A Book. \r\n\r\n             My Father Name Is Saipul Bahri. He Was Born In Gistang, November 04, 1969. He Is 48 Years Old. He Works As An Entrepreneur. My Mother Name Is Neni Agustina. She Was Born In Batu Kuning, August 07, 1976. She Is 41 Years Old. She Work As Housewife.\r\n\r\n             I Have One Sister And One Brother. My Sister\'s Name Is Sanira Nuraini. She Was Born In Ogan Komering Ulu, August 19, 2013. She Is 4 Years Old. She Has Not Gone To School Yet. My Brother\'s Name Is Denny Noprianto. He Was Born In Baturaja, November 01, 2006. He Is 11 Years Old. He School At Sd N 33 Oku Class 5.\r\n\r\n              I Want To School In Sman Sumsel Because I Think It\'s A Good School, And Doesn\'t Cost. In Order To Reduce The Burden Of My Parents, Because I Have A Brother And Sister To Bear. I Know About Sman Sumsel From My School.               '),
('uliborusimbolon1707@gmail.com', '               My name is YULIANTI TIOPANI SIMBOLON. I am the second of five children. I am school in SMPN 1 BETUNG. My hobbies are trading books, singing and playing music. The instruments i can play are guitars and organis. I live in betung. I live with my family. My parents opened a food stall at home. The results of our stalls are not too many. With a mediocre income then my parents can not send me to school with good quality like SMAN SUMSEL. \r\nI am including a child who Excel, therefore i feel worthy to enter to SMAN SUMSEL and become a student in this school. Ever since i entered to junior high school, i always got a rank and i once got a general champion in the eighth grade. I have also participated in several district level competition and won the championships. Because i belong to a disadvantage family, i find it difficult to enter a good quality school due to cost constraints. If i can enter to this school, then i can lighten the burden of both my parents and make them proud of me. \r\nI aspire to be CEO. I really want to lead a company. I really  hope that i can continue my education in this school. I hope that by becoming a student of SMAN sumsel i can learn more about leadership for my stock pursurig the ideals of being CEO and help me to Achievement my goals in the future.                                                                               ');
