('ulparegina619@gmail.com', '          MY NAME IS TIARA ANGGRAINI . I WAS BORN 5TH OF JULY 2003 IN PALEMBANG .I LIVE AT PALEMBANG . I HAVE 1 BROTHER AND 1 SISTER . MY BROTHER NAME IS AGUNG ROMADHON . HE HAVE MARRIED SINCE 2015 . AND HAVE A BABY BOY. HIS BABY NAME IS M.ARKA.HADZA,ABDULLAH . MY SISTER NAME IS ULPA REGINA . SHE IS STILL SINGLE . MY FATHER NAME IS HARISEL ERMAN . HE DOESN\'T WORK ANYMORE , BECAUSE HE HAVE STROKE SINCE I WAS ELEMANTARY(GRADE 5) . MY MOTHER NAME IS ELOK ASTILAWATI . SHE WAS SMALL TRADING WHEN I KID .\r\n          I THINK ,IF I ENTER THIS SCHOOL ,I CAN STUDY HARD . FROM STUDY HARD I CAN MAKE THE BEST ACHIEVEMENT AT THIS SCHOOL .  I SEE AT SOCIAL MEDIA SENIOR HIGH SCHOOL  SUMSEL TEACH ALL THEIR STUDENT WITH PROFESSIONAL , AND SO MAKE STUDENT MORE DILLIGENT TO STUDY HARD DIFFERENT WITH THE OTHERS SCHOOL . I WANT TO BE A LECTURER BECAUSE I WANT TO MAKE THE OTHERS PEOPLE SMART . IF I HAVE HIGH KNOWLEDGE , SO I CAN BE A GOOD LECTURER IN THE FUTURE .                  '),
('umitazzarani@gmail.com', '       My name\'s Umita Syahrani. I was born in Palembang, 9 june 2003. Now, i\'m 15 years old. Since childhood i stay at the city born, precisely at flats. I am the sixth child of 6 siblings. I very grateful to have a family that always loves and helps me.\r\n      My father is A street vendor, his stall is beside the Palembang post office, merdeka street. Every two days, after i finished my School, i go to my father\'s stall and i help him until night.\r\n      When i was A student of primary School, i was active following Scout organization, at the time,i had first experience of camping activities. During camping activities, there were many of competition which were held by the comittee. I followed drawing competition and I won the second place, blessed.When I was A student of junior High School, I\'d got the first place of rank in my class. And then I got the best jurnalisme achievement of my School by SUMEKS newspaper.\r\n      In the future I want the quality of education in Indonesia to increase especialy for disadvantaged, children Each child must have a S2 degree or at least D3.'),
('ummichoirunnisa@gmail.com', 'A. MY SELF\r\nMY NAME IS AYU UMMI CHOIRUNNISA, I WAS BORN IN PALEMBANG, 10 SEPTEMBER 2003.MY RELIGION IS ISLAM. I LIVE AT JL. MAYOR ZEN LR. MUFAKAT, I COME FROM SMP NEGERI 8 PALEMBANG . I AM A LOT OF INFORMASION GOOD SCHOOL’S AND THE INTERNET THAT. I WANT TO STUDYING TO A HIGHER LEVEL AND BETTER. AND I AM A LOT OF INFORMASION GOOD SCHOOL\'S AND THE INTERNET THAT THE SCHOOL SMAN SUMSEL MANY PRODUCE STUDENT\'S QUALITY, ACHIEVEMENT AND ABLE TO ACHIEVE THE VALUE OF LESSON HIGH ENOUGH SO THAT THE STUDENT\'S SMAN SUMSEL EASY TO ENTER THE COLLEGE OF A GOOD ALL OVER THE INDONESIAN UNIVERSITY AND UNIVERSITY ABROAD.\r\n\r\nB. WHY YOU DESERVE TO BE STUDENT OF SMAN SUMATERA SELATAN\r\nFIRST, BECAUSE I COME FROM SOUTH SUMATERA AND I COME FROM A SIMPLE FAMILY. SECOND, BECAUSE I HAVE EMBROIDERY AND STRONG DESIRE TO ENTER SMAN SUMSEL. THE THIRD, BECAUSE I FEEL, MY PARENTS NOT FEEL ABLE TO PAY FOR LOG IN TO STATE HIGH SCHOOL THAT REQUIRE THE COST OF HIGH ENOUGHT SO THAT I TRIED TO ENTER SMAN SUMSEL, TO GET A SCHOLARSHIP SO AS TO REDUCE THE BURDEN OF PARENTS.\r\n\r\nC. MY LEADERSHIP AMBITION IN THE FUTURE\r\nI TRIED TO PURSUE BETTER EDUCATION AND TO THE LEVEL OF HIGHER . SO I CAN PURSUE IDEALS THAT WANT TO BE A SUCCESFUL BASED ON FAITH AND PIETY. SO THAT IT CAN  SCENT THE NAME OF THE NATION AND COUNTRY\r\n                              '),
('umniyyahkhoirunnisa245@gmail.com', '                   HELLO \r\n     I WANT INTRODUCE MY SELF. MY NAME IS UMNIYYAH KHOIRUNNISA AMIEN. I WAS BORN IN PASURUAN, 19 DECEMBER 2003. I HAVE BROTHER AND SISTER. MY SISTER NAME IS HABIBAH SYARIFATURRAHMA AMIEN. MY BROTHER NAME IS IMAM SYARIFUDIN. MY FATHER NAME IS MOCHAMMAD AMIEN. MY MOTHER NAME IS SRI KARUNIA. I STUDY IN JUNIOR HIGH SCHOOL NUMBER SIX SEKAYU. MY HOBBY IS SPORTS. I DON’T LIVE WITH MY PARENTS, I LIVE IN BOARDING, BECAUSE MY SCHOOL AND MY HOUSE IS LONG FAR, APPROXIMATELY ONE HOUR.\r\n     \r\n     I WANT TO GO TO SCHOOL IN SMAN SUMATERA SELATAN, BECAUSE THE EDUCATION IS GOOD, THE STUDY ROOM IS VERY MUCH, THE FACILITIES ARE COMPLETE AND SMAN SUMATERA SELATAN  IS A PLACE TO CONTINUE A GOOD EDUCATION AND VERY MUCH IN DEMAND BY MANY PEOPLE, BESIDES SCHOOL IN SMAN SUMATERA SELATAN I CAN HELPING MY PARENTS BURDEN, BECAUSE MY FATHER IS A FARMER AND MY MOTHER IS A HOUSEWIFE. THAT’S WHY I WANT TO GO TO SCHOOL IN SMAN SUMATERA SELATAN. I HOPE BY GOING TO SCHOOL IN SMAN SUMATERA SELATAN CAN HELP ME IN REACHING MY DREAM.\r\n\r\n     MY AMBITION IN THE FUTURE IS TO GO TO SCHOOL IN SMAN SUMATERA SELATAN, I AM ACCEPTED IN SMAN SUMATERA SELATAN I WANT TO CONTINUE MY EDUCATION TO S-1, AFTER S-1 I WILL CONTINUE MY EDUCATION TILL S-2. AFTER THAT I WILL FIND A GOOD JOB, I WANT TO BOAST MY PARENTS, THAT I ALSO WANT TO BOAST MY SCHOOL, BY WORKING I WANT TO CHANGE THE ECONOMIC STATE OF MY FAMILY, I WANT TO SEE MY FAMILY HAPPY LIVE, I DO NOT WANT TO DISAPPOINT MY FAMILY WHO HAS FINANCED MY EDUCATION.\r\n\r\n           '),
('untungaldojoler@gmail.com', '    MY NAME IS M.UNTUNG RIVALDO, AT SCHOOL MY FRIEDS ALWAYS CALL ME UNTUNG. I WAS BORN IN SEKAYU, 05 APRIL 2003. SO, I AM 14 YEARS OLD. I LIVE IN SEKAYU, KOLONEL WAHID UDIN STREET. I COME FROM JUNIOR HIGH SCHOOL NUMBER 6 SEKAYU. I AM AN ONLY CHILD IN MY FAMILY. MY FATHER NAME IS PAKARUDIN, HE IS 46 YEARS OLD, HE WORK IN JHS 11 SUNGAI KERUH AS SCHOOL GUARD. MY MOTHER NAME IS NURBAITI, SHE IS 49 YEARS OLD, SHE WORK IN ELEMENTARY SCHOOL 1 RANTAU SIALANG AS TEACHER. I HAVE MANY FRIENS IN MY SCHOOL OR OUTSIDE SCHOOL. IN MY SCHOOL I LIKE PLAY SOCCER AND BASKETBALL WITH MY FRIENDS. I’VE WON THE FUTSAL CHAMPIONSHIP, THE CHAMPIONSHIP IS BTA FUTSAL COMPETITION, AND SMARA FUTSAL COMPETITION. I WAS ACTIVE IN OSIS, AND NOW, I ACTIVE IN INDOBARCA MUBA, AS AN ORGANIZATION MEMBER.\r\n    I DESERVE TO BE A SHS SOUTH SUMATERA STUDENT, BECAUSE I FEEL THAT I AM A PART OF A LESS FAMILY ABLE, AND I FEEL ABOUT ABILITY TO BE A LEADER WHICH COULD BE DEVELOPED IN SMANSUMSEL.IALSO WANT TO HELP MY FAMILY IN THE ECONOMIC FIELD AND WANT TO CHANGE MY FAMILY SITUATION FOR THE BETTER. IF I CAN BE STUDENT IN SHS SOUTH SUMATERA I PROMISE WILLN’T WASTING THIS OPPORTUNITY.\r\n    MY AMBITION IN THE FUTURE IS TO BECOME A PRESIDENT BECAUSE FOR ME PRESIDENT A LEADER IN A COUNTRY. AND TO BECOME A LEADER IS MY DREAM, BECAUSE FOR ME A LEADER IS HAVE A BIG RESPONSIBILITY, AND I BELIEVE I CAN DOING MY RESPONSIBILITY, TO CHANGE THIS COUNTRY CAN BETTER GOOD IN FUTURE.\r\n                           '),
('uyunnisya0306@gmail.com', '   When I go to school in SMPUN 8 Palembang, I heard a lot about the alumni who go to school in SMAN SumSel. Most of them feel proud to have entered SMAN Sumsel. The scholarship program there makes me interested. To be honest, I would love to go to school and enter in SMAN Sumsel.\r\n\r\nThe reason I go to SMAN Sumsel is to help ease my parents burden. I have two younger sisters. I am so sad if they later drop out of school. As the years ago by, the world will be most expensive. Let alone see the condition of the company where my father worked threatened bank ruptey, the burden of us family only toughter.\r\n\r\nFor that I as the first child in the family hoping to go to school in SMAN Sumsel. Hopefully with my recipt there will make my family proud and develop my talent.\r\n\r\nI really like singing and drawing. I also often attend many races duning elementary school and the results are quite satisfactory. The money I earned from some of those races can increase revenue.\r\n\r\nI hope my talent can grow again in SMAN later. Hopefully me go to SMAN Sumsel, I can convincing. My dad if I can be a usuful child for my sisters and my family.\r\n\r\n                          '),
