('windirs20@gmail.com', '                           Assalammualaikum wr.wb.\r\n         Let me intoduce my self.My name is Windi Rahmasari.My friends usually call me Windi.I was born in Tugumulyo on August 20,2003.I’m the youngest daughter of two sisters.I study at juniour high school.I’m in the nineth garde now.In the class I got two send rank from 35 students.I lives with my parents in a village called Triwikaton village.My father works as a teacher at a primary school in Tugumulyo,and my Mother is a housewife.\r\n         I want to study indepedently and improve my achievement.I want to make both my parents proud of me.By entering to SMA Negeri Sumatera Selatan country using english as a colloquial.SMA Negeri Sumatera Selatan has extracurricullar activity they are very interesting subjects.And what makes me more interested is vision or mission of SMA Negeri Sumatera Selatan.Almost all students in SMA Negeri Sumatera Selatan can enter the famous faculty or university and it makes me very interested to go to SMA Negeri Sumatera Selatan.I hope I can enter to SMA Negeri Sumatera Selatan and I will very  thank you to the board of teachers and principal if I can be accepted  me as a student in SMA Negeri Sumatera Selatan.And hopefully I can pass every tests given to SMA Negeri Sumatera Selatan.And good luck for me.\r\n       Wassalammualaikum wr.wb \r\n            '),
