('yessidesmatalasari19666@gmail.com', ' Assalamualaikum\r\n Wr.Wb.\r\n\r\n    Let me to introduce my self my name is YESSI DESMATALA SARI. I was \r\nborn in P1.Mardiharjo December 20, december, 2002, Musi Rawas regency, \r\nSouth Sumatera. My parents are TRI CAHYONO and DWI SUMIYATI. My father \r\nworks as a labourer and my mother is a house wife. I have one brother. \r\nHis name is ANANTA JUNI SAHPUTRA. I really love my family.\r\n    I study at Junior High School O.Mangunharjo. I join some \r\nextracuricular, scouting and English Club. I am really active in \r\nscouting. I always be a leader in my group of scouting. My school often \r\njoins some competition in scouting. Last year, I followed Story Telling \r\ncompetition in Musi Rawas regency unfortunately, I didnt win. But, it is\r\n unforgettable experience. \r\n    In my village, I join IRMAS. By joining it, I learn how to have a \r\ngood organization, and how to handle it well. I have some hobbies. My \r\nhobbies are writing, dancing and playing volleyball. I usually dance in \r\nwedding ceremony and formal activities. I also often follow volleyball \r\ntournament.\r\n    I have some motivations to study at SMAN SUMATERA SELATAN.\r\nFirst, I have a big responsibility to my parents.\r\nSecond, I like to have more knowledge because I want to be a Governur. I\r\n also like challenges. My parents really support me to be a great people\r\n who is useful for my beloved country.\r\n    I think it is enough for me. Thank you very much for the attention. I\r\n will be so happy if I become a student of SMAN SUMATERA SELATAN.\r\n\r\nWassalamualaikum Wr.Wb.\r\n                             '),
('yohana.ansar10@gmail.com', '                              My name is Ainun. I was born in Banyuasin on October 10, 2003. I am the fourth of six childern. I was born from a simple family. My dad\'s  job is farmer and my mother as housewife. Earnings my parents are not necessarili and not big because as a farmer who sometimes rice plants are often affected by diseases and pests that cause the result is not much. I am currently studying at SMP N 3 MUARA TELANG. Now it\'s headed to the National Examination of academic year 2017-2018. One of the reasons I want to go to SMA N SUMATERA SELATAN is because a professional teacher. There is much evidence that SMA N SUMATERA SELATAN has created highly qualified human resources in certain fields. My hobbies are reading and writing, hopefully with my schooling in SMA N SUMATERA SELATAN this can develop more talent that I have, I also hobby sports especially in badminton game I ever championed in one of O2SN activities on year 2016. Master teaches us to be smart leaders. Not only that, we must also be a person who can change any bad attitude for the better. GOOD LUCK!.'),
('yolandajulianti15@gmail.com', 'Assalamualaikum.\r\nHello, let me introduce myself. My name is Serry Sesilia. Now, I attend MTS An-nuur Palembang. I\'m 14 years old. I was born on September, 15tn 2003 in Palemban. I live at Sumatera street 2, Block BI 02 OPI Jakabaring. My father\'s name is NUsmanto, who is 52 years old and work as a labor. While my mother\'s name is Hauliti, whose age is 50 years old and work as a merchant. I have abrother named Hendy Dollys, 31 years old, and a sister named Vessy Clara, 25 years old who has been married.\r\nThere are some reasons leading me intend to enter State Senior High School at South Sumatera, they are, First, I want to sek for knowledge and to reach my dream. Second, I want to lighten my parents burden of life. Third, I really dream of being a doctor. By then, I do hope I could serve the better medical service with affordable cost to as many as possible people, so the life expectancy in Indonesia could be increased. I extremely wish that I could attend this school to make my dream real in the future.\r\nThank you, Wassalamualaikum.'),
('yulandasantalia16@gmail.com', 'Assalamualaikum Warahmatullahi Wabarakatuh\r\nMy name is Yulanda Santalia, you can call me Yulanda, I\'m 15 years old, I live in Muarasaeh, I was born on December 16, 2002, my father\'s name is Arpan, He is 51 years old, my dad\'s job is a farmer and a gardener my mother\'s name is Emilia, She is 42 years old, my mother\'s job is a farmer as well as a housewife. I have 3 sisters. I myself are the 3rd child of 4 siblings.\r\nwhy I deserve to be one of the students at SMAN SUMSEL, because I have good academic ability, and I have integrity and solidarity instilled since childhood by my family, and it is only through this school that I will be able to form a leader\'s character in my self as well as forming the person to be a useful human being and benefiting the people.\r\n\r\n\r\n                              '),
