('yuniarhasana@gmail.com', 'Assalamualaikum warrahmatullahi wabarakatuh \r\nMy name is Yuniar Hasana. I live at lukman idris street No. 091 Palembang City. I am a student of Junior High School number 11 Palembang. I am a servant of Allah Swt who wants to realize the dreams. Every human being has dreams, and every human being has way to realize that dreams. And I want to realize my dreams through Senior High School Sumatera Selatan. And I believe I can do it. My hobby is playing chess. My parents are hardworking people. My father’s name is Aprianto. he is an ambitious man. My mother’s name is Tuti Lesmana. She is a good housewife, a strong woman, and a caring mother. My sister’s name is Rahma Oktavia. She is friendly.\r\nI am a prospective Senior High School Sumatera Selatan who is hungry for knowledge, loves english lessons, and I love new things. Alhamdulillah, I have 7 trophies on my cupboard, and that’s all the gifts of Allah Swt. \r\nMy future leadership is I want to be a useful person for the nation and country. And an example for everyone that money doesn’t not guarantee everything. We only need the pleasure of Allah Swt.\r\nWassalamualaikum Warrahmatullahi Wabarakatuh \r\n'),
('yusniarniyusuf@gmail.com', 'MOTIVATION LETTER\r\n\r\n	My name is Sari Rizkia. I am fourteen years old. I was born and raised in simple family. Since the death of  my father, my mother had to work as a seller. Although the result is small, but enough to meet our daily needs. I have two siblings who are still in school. Of course it costs a lot of for it. However, this not dampen my intention to get the highest education as possible.\r\n	After graduating from Junior High School, I would like to continue my education in SMAN SUMSEL. Because I do not want to burden my mother and I want live more independently. I also have some achievements, such as being a third winner on National Science Olympiad in Social Science field at districts level. And  I often be the second winner of my class. Not only that, I also have expertise in Taekwondo.\r\n	If  I am selected to be accepted in SMAN SUMSEL. I will dedicate myself and give the best for SMAN SUMSEL by actively participating in all activities in this school.\r\n	In future, I aspire to be an entrepreneur. I want to have bussines of my own and hire people who have potential and skill but can not apply their advantages because the lack of employment. So that, I can reducing the unemployment rate.\r\n                              '),
('zaenazulkhoiriah03@gmail.com', 'Lets me introduce my self, my name is Zaena Zulkhoiriah. I was born in palembang 31th of march 2003, and now my age is fifteen years old. I have beloved and an awesome parents that always support me, they are my father and my mother, my father name is Ahmad Suhaimi and my mother name is Yursilawati and also I have one little sister, the name is Zahra Ramadhani and two little brothers are Zibran Anugrah Ramadhan and Zidan Khoirul Basyar. And i am living in prasejahtera family, now i am standing at junior high school number five palembang. In the school I joined any activities such as in academyc and non academyc events, sometimes I often get a lot of achievments like get top five rank in the class and become one of member poem competition, cepat tepat competition and for non academyc I was get second winner of drawing competition and third winner paduan suara competition, in the school also I was known as an active and deligent student. In every Monday and thursdsay after school. I always going to gloria for having english course and every a month I get an exercise like swim as extrakulikuler from the school.\r\nAt the beginning I have a plan to get school in sman sumsel, as I known that the school is a boarding school and the most favorite school in palembang with an international curriculum. Because of that I really wanted to become one of the student and with this school also I can achieving my goals such as to improving my skills become indonesian future leader, to raise up my parents finnancial, to having a lot of friends, eksperiences, knowledge and culture and also of course i want to make parents proud of me; like someday I want to be able to defray my parents pligriage to mecca and I want to continuing my study in some favorites university.\r\nIn the future if I become success person I want to sharing and giving some motivation about my eksperiences cause i am glad to see people happy and have any knowledge with an excellent and high intelegent personallity about behavior, brain in the society.\r\n                              '),
('zahrapa28@gmail.com', '                         Assalamualaikum wa.wb\r\n\r\n   I would like to introduce myself. My name is Zahra Prisky Ardiningrum. I have many nicknames lol :v. My friends at school call me Zahra, my neighbours call me Rara and my big family and my close friends call me Yaya. I was born on August 2nd 2003. I live in Jl.Pahlawan Amir F.trikoyo Musi Rawas. My hobbies are singing, dancing, swimming, and watching film. My favorite subjects are English and Math. My idea is a doctor. I study at Junior High School B.srikaton, I am in the 9th  grade. I am the daughter of two pairs, Heri Purwanto and Rosilah. My father was born on October 19th 1971. He is a merchant. My mother was born on May 27th 1972. She is a government employee. She works in a nursing home as head of the administrative sub-divison. I have two lilte sisters. They are Aristawidya Anbita Barokah Almukaromah, called teta. She was born on December 22nd 2007. She is eleven years old. She studies at Elementary School. And Aqillah Putri Zahira, called lala. She was born on January 1st 2013. She is five years old. Now she studies at kindergarten. So I’m the oldest daughter.\r\n   In Junior High School, I’ve been participating of math group contest. In semi final we got 3rd rank but in final we didn’t win. And every years, since I was in the 5th  grade ‘till now I always joined the Engish speech contest but I never won. In the 8th  grade I joined O2SN swimming and I lost again. Altough I lost it in every contest I’d the courage to join the contest. I hope if I’m in Senior High School I’ll join many contest and will be the 1st winner.\r\n   I want to study at South Sumatera Senior High School. What is the reasons I want to study at South Sumatera Senior High School ? The first reasons is South Sumatera Senior High School is the best school in South Sumatera. South Sumatera Senior High School uses two curriculums that is 2013 and Cambridge. With the existence of Cambridge curriculum there, I can take the exam to enter Cambridge University. My idea from child is to go abroad and get medical scholarship abroad exactly in New Zealand. I know from Internet and peoples that South Sumatera Senior High School uses it’s daily English. And the second reasons why I want to study there, because in that school uses English as daily language. If I study in tat school I can improve my English ability. The third reasons is that school is free and has dormitories . Why? Because I don,t want to be troublesome to my parents. I don’t want to be a burden to my parents because I’ve two sisters who will go to school as well. And I want to be a more independent person.\r\n   If I am accepted at South Sumatera Senior High School my parents will be proud of me. Because I’m the first child, my sisters will learn from me how to be a smart, accomplished, charachter and independent, to be a firm and responsible person. They’re secretly want to be like me and I will be a role model for my sisters. After I study at South Sumatera Senior High School I’ll be the better person than I’m in Junior High School. I’ll be one of the achievers in there and can boast of a school with many trophies, medals, and charter that I brought to school. I’ll join Cambridge International Examination. I’ll study hard for my big dream. I hope you will accept me . I just one of the students who want to study at South Sumatera Senior High School and the girl who has a big dream.\r\n\r\n   Wassalamualaikum wa.wb\r\n     '),
('zefirasilvia19@gmail.com', 'MY  NAME IS ZEFIRA SILVIA, I`M THE FIRST CHILD OF SPOUSE ZEIN FIRDAUS ARIFIN AND MUJI ASIH, AND I HAVE FOR SIBLINGS. MY FATHER IS AN OILMAN TRANSPORTATION MUARADUA-BANDAR LAMPUNG, AND MY MOTHER IS AS HELPER GRANDMA IN THE INN. WE LIVE AT GRANDFA`S HOUSE. EVERY DAY I JOIN STUDY ENGLISH AT GLOBAL ENGLISH COURSE IN MUARADUA MORE EVER MATH AND SCIENCE.I AM ELIGIBLE OR ACCEPTED IN STATE SENIOR HIGH SCHOOL SUMATRA SELATAN BECAUSE I GOT ACHIEVEMENT LIKE CLASS CHAMPION, I ALSO ACTIVE JOIN ORGANIZATION SCHOOL. I OFTEN JOIN CONTEST IN SCHOOL SUCH AS MATH COMPETITION, SHORT STORY, AND NEWS READING. I AM READY TO KEEP BEING THE BEST STUDENT AND I`M READY TO KEEP MY ACHIEVEMENT THAT I DID BEFORE TO MAKE MY TEACHER, ALMA MATER AND ESPECIALLY MAY PARENTS ARE PROUND OF ME.ABOUT LEADERSHIP I`LL TRY TO OFFER THE QUALITY OF LEARNING AS SOON AS CONTRIBUTE INSHIGH IN THE FIELD OF POWER OR AREAS OF AOUTHORITY. I`LL TRY TO BECOME A MENTOR IN A INTENERARY OF VOSION AND EXPANDING SKILL, TALENT, ABILITY AND ACHIEVEMENT THAT I CAN DO.          '),
('zefirasilvia@gmail.com', 'MY NAME IS ZEFIRA SILVIA, I`M THE FIRST CHILD OF SPOUSE ZEIN FIRDAUS ARIFIN AND MUJI ASIH, AND I HAVE FOUR SIBLINGS. MY FATHER IS AN OILMAN TRANSPORTATION MUARADUA-BANDAR LAMPUNG, AND MY MOTHER IS AS HELPER GRANDMA IN THE INN. WE LIVE AT GRANDFA`S HOUSE. EVERY DAY I JOIN STUDY ENGLISH AT GLOBAL ENGLISH COURSE IN MUARADUA MOREEVER MATH AND SCIENCE.\r\n\r\nI AM ELIGIBLE OR ACCEPTED IN STATE SENIOR HIGH SCHOOL SUMATRA SELATAN BECAUSE I GOT ACHIEVEMENT LIKE CLASS CHAMPION, I ALSO ACTIVE JOIN ORGANIZATION SCHOOL. I OFTEN JOIN CONTEST IN SCHOOL SUCH AS MATH COMPETITION, SHORT STORY AND NEWS READING. I AM READY TO KEEP BEING THE BEST STUDENT AND I`M READY TO KEEP MY ACHIEVEMENT THAT I DIDI BEFORE TO MAKE MY TEACHER, ALMA MATER AND ESPECIALLY MAY PARENTS ARE PROUND OF ME.\r\n\r\nABOUT LEADERSHIP I`LL TRY OFFER THE QUALITY OF LEARNING AS SOON AS CONTRIBUTE INSHIGH IN THE FIELD OF POWER OR AREAS OF AOUTHORITY. I`LL TRY TO BECOME A MENTOR IN A INTENERARY OF VOSION AND EXPANDING SKILL, TALENT, ABILITY AND ACHIEVEMENT THAT I CAN DO.                 '),
('zhaafirazhr@gmail.com', 'My name is zhaafira. I\'m from Smp N 8 Palembang. The main reason why i really want to get into Sman Sumsel is to boast my parents. Boast my parents is my dreams. All the children in this world would want to boast their parents. Including me. I know information about Sman Sumsel from my school. And after hearing the information from the teachers, i\'m interested take this test. I also know Sman Sumsel is a school that provides help for under privilleged children. I am very proud, it turns out there are school that support children from poor family like me. My mother agree with my decision to enter Sman Sumsel. But i am very hesitant to take the test. I\'m  afraid i will not pass, but my mother always gives me spirit and prayer. Finally, i decided to take this test until the last stage. Pass or not i will receive. Sman sumsel is also a school that activities english for daily conversation. Hopefully, with this school,children from poor families like me can continue their schooling and a chieve their ambition. Insha allah, if i graduate i will scent the name of school Sman Sumsel.               '),
('zhelinjulia.anggrainj@gmail.com', '     Assalamualaikum wr.wb\r\n\r\n      Hello! My name Zhelin Julia Anggraini, I usually called zhelin. I was born in Palembang on 28 july 2003. I live in KH.Wahid Hasyim street. I live in my grandfather\'s house with my parents, and my sisters. I am a student in MTs N 1 Palembang. In my school follow some extracurricular like scout , OSIS, and PMR. at the time of my elementary ever participate in the city level LTBB competitions. The lesson I like is Indonesian, English, although I am not very fluent in English.I aspire to be a successful businessman and boast of both my parents.\r\n      My hobbies are cooking and traveling. if there is spare time i often help my mother cooking. since childhood i like to cook because for me cooking is an activity that can help me to live independently. at other times I usually read books, like novels, history books and more.\r\n     I am the first child of 3 brothers. My father\'s name is napoliyon. He was born on 17 September 1972 and worked as a bajaj driver every day. My father\'s last education is high school. My father is very disciplined about time. He really does not like slow jobs. For me my father is my hero. While my mother was named sri agustini, she was born on 24 august 1985. my mother is a housewife. My mother\'s last education is junior high. my mother is very strict in terms of cleanliness, and my mother is a bit grumpy. My mom and dad really want me to be one of the students at SMAN Sumsel.\r\n    I want to be one of the students in SMA N Sumsel because I want to boast both my parents and teachers who have been guiding me all this time and I want to study more independently again in this South Sumatera SMAN and I want to develop more my ability.\r\n   \r\n     Wassalamualikum wr.wb\r\n\r\n'),
('zihannabilla333@gmail.com', '      Assalammualaikum Wr. Wb.\r\n	I want to introduce my self, my name iz Zihan Nabila. You can call me Zihan/Zizi. I was born on 23th April 2003, and now i’m 14 years old. I life in Perumnas, JL. Merawan blok C no 12 Sekayu. I’m student of SMP Negeri 6 Unggul Sekayu grade 9. I’m the first couple of Mr. Irwan Nopebri and Mrs. Wiwin Agustina. And i have brother. He name is Muhammad Habi Bullah Nur Yasin. Job my father is Police man and job my mother is house wife.\r\n	I’ll leave the SMP Negeri 6 Unggul Sekayu and go the SMA. And the intentions of my heart, it’s very eager to be students of SMAN Sumsel. In fact, i know that SMAN Sumsel is reserved for the achievement of families pre-prosperous. But it didn’t make me lose heart because I come from a wealthy family. Seen from my parents especially my dad, my father is a “Polri”. It’s true , of a police offier be able to live my family. It could have motor vehides like cars and motorbikes but didn’t cover the possibility that my father had debts that i don’t know. But what i heard from my mother, they are debt wether it’s where. This makes me think that i haave to reduce the burden on parents with me to go to school in SMAN Sumsel. I really need help, i want to be proud of my family especially my parents. \r\n	And if i was accepted into students SMAN Sumsel i will study with sincerely. Also, i would like to learn to be a leader. Can we see, the condition in Indonesia is very alarming, especially when viewed from the Education.  The role of teacher is very important in the future, without any teacher education has nothing to do. Therefore, if at any time if i become a leader i’m going to make education in Indonesia continues to rise by facilitating teachers, and harness the potential of the Natural Resources in the in order to generate income areas that support education in area. \r\n	Perhaps this is what i can write. I’m sorry it there was a mistake the words. I really hope that i was accepted into SMAN Sumsel. So, wassalammualaikum wr.wb.\r\n                        '),
('zulkiplisoraya@gmail.com', '     I want to introduce abaout myself, my name is Ahmad Yani, my nick name is yani, I was born in Nanjungan, December 09th 2003, I’m the youngest of 2 siblings, I Live in Nanjungan,  I’m 14 years old, now I sit in Junior high school no. 1 Pendopo Barat.  I have some achievement got first rank in first semester to fiveth semester. I have some hobbies in Academic and Non Academic, In the academic I have a skill in Science biology and Math. In non academic I have skill in sport likes Basket ball, Football,etc. \r\n	In my family, I have a father, his name is Jonusli, he was born in Nanjungan July 1st 1976.  He is 41 years old. My father work as farmer, from his accupations, he got salaries Rp. 650.000/month, from his salary he can pay our daily needs and for my eat snack in school. My mother is Eka Susanti, my mother was born in Nanjungan July 1st 1980. She is 37 years old, She is a farmer, I also have a brother his name is Randi Kernendi, he was born in Nanjungan December 15th 1997. He is 20 years old\r\n	Actually from bottom of my heart, I really want to enter SMAN SUMSEL, because I think this school is very popular in Sumsel and make my skill increase, increase in knowledge, talent, and my hobbies. I think, I have proper to get fellowship to come in SMAN sumsel, as I know this school is very have best qualities and I have achievement to be a students of SMAN Sumsel. I’m Proper to be a students of SMAN sumsel because my family have less economic so I want change our destiny, I want to make proud of my families because I want to be success in future.\r\n	When I was in the child, I want to be a Directur bank, because a Directur Bank is good job, a Directur Bank can help people. In future  I hope my ambitions come true and I will attempt to study hard and prayed to god, to make my family proud with me. amien\r\n                         ');
